[587] = {name = "Essen herbeizaubern", additional_info = "60 Mana\nWirken in 3 sek.\n[q]Zaubert 20 Muffins herbei und versorgt den Magier sowie seine Verbündeten mit etwas Essbarem.\n\n Herbeigezauberte Gegenstände verschwinden, wenn Ihr Euch länger als 15 Minuten ausloggt."},
[588] = {name = "Inneres Feuer", additional_info = "30 Mana\nSofort\n[q]Der Zaubernde wird von einer Explosion der heiligen Energie erfüllt, die seine Rüstung um 315 erhöht. Ein erlittener Nahkampf- oder Distanzangriffstreffer verbraucht eine Aufladung. Hält 10 min lang an oder bis alle 20 Aufladungen verbraucht sind."},
[589] = {name = "Schattenwort: Schmerz", additional_info = "{25 Mana} {30 Meter Reichweite}\nSofort\n[q]Ein Wort der Dunkelheit, das 18 sec lang 30 Punkt(e) Schattenschaden zufügt."},
[591] = {name = "Göttliche Pein", additional_info = "{30 Mana} {30 Meter Reichweite}\nWirken in 2 sek.\n[q]Zerschmettert einen Feind und fügt ihm 28 to 34 Punkt(e) Heiligschaden zu."},
[592] = {name = "Machtwort: Schild", additional_info = "{80 Mana} {40 Meter Reichweite}\n{Sofort} {4 sek. Abklingzeit}\n[q]Nutzt die Seelenkraft des Gruppenmitglieds zum Abschirmen und absorbiert dabei 94 Punkt(e) Schaden. Hält 30 sec lang an. Solange der Schild hält, wird das Zauberwirken durch erlittenen Schaden nicht unterbrochen. Nachdem das Ziel einmal abgeschirmt wurde, kann es 15 sec lang nicht wieder abgeschirmt werden."},
[594] = {name = "Schattenwort: Schmerz", additional_info = "{50 Mana} {30 Meter Reichweite}\nSofort\n[q]Ein Wort der Dunkelheit, das 18 sec lang 66 Punkt(e) Schattenschaden zufügt."},
