[597] = {name = "Essen herbeizaubern", additional_info = "105 Mana\nWirken in 3 sek.\n[q]Zaubert 20 Laibe Brot herbei und versorgt den Magier sowie seine Verbündeten mit etwas Essbarem.\n\n Herbeigezauberte Gegenstände verschwinden, wenn Ihr Euch länger als 15 Minuten ausloggt."},
