[693] = {name = "Seelenstein herstellen (schwach)", additional_info = "85% von Grundmana\nWirken in 3 sek.\nReagenzien:\nSeelensplitter\n[q]Lässt einen schwachen Seelenstein entstehen. Der Seelenstein kann zum Speichern der Seele eines Ziels benutzt werden. Wenn das Ziel stirbt, während seine Seele gespeichert ist, kann es mit 400 Gesundheit und 700 Mana wiederbelebt werden.\n\n Herbeigezauberte Gegenstände verschwinden, wenn Ihr Euch länger als 15 Minuten ausloggt."},
