[696] = {name = "Dämonenhaut", additional_info = "120 Mana\nSofort\n[q]Schützt den Zaubernden, indem es 30 min lang die Rüstung um 120 erhöht und alle 5 Sek. 5 Punkt(e) Gesundheit wiederherstellt."},
[697] = {name = "Leerwandler beschwören", additional_info = "100% von Grundmana\nWirken in 10 sek.\nReagenzien:\nSeelensplitter\n[q]Beschwört einen Leerwandler, der unter dem Befehl des Hexenmeisters steht."},
[698] = {name = "Ritual der Beschwörung", additional_info = "{300 Mana} {30 Meter Reichweite}\nWirken in 5 sek.\nReagenzien:\nSeelensplitter\n[q]Beginnt ein Ritual, das das anvisierte Gruppenmitglied beschwört. Um das Ritual zu vervollständigen, werden der Zaubernde und zwei zusätzliche Gruppenmitglieder benötigt. Um teilzunehmen, müssen sich alle Spieler außerhalb eines Kampfes befinden, auf das Portal rechtsklicken und dürfen sich nicht bewegen, bis das Ritual abgeschlossen ist."},
[699] = {name = "Blutsauger", additional_info = "{85 Mana} {20 Meter Reichweite}\nKanalisiert (Wirken in 5 sek.)\n[q]Überträgt pro Sekunde 17 Punkt(e) Gesundheit vom Ziel auf den Zaubernden. Hält 5 sec lang an."},
[700] = {name = "Schlaf", additional_info = "{60 Mana} {30 Meter Reichweite}\nWirken in 1.5 sek.\n[q]Versetzt das feindliche Ziel bis zu 20 sec lang in Schlaf. Jeglicher zugefügte Schaden wird das Ziel wieder aufwecken. Es kann immer nur jeweils ein Ziel schlafen."},
[701] = {name = "Feuerblitz", additional_info = "{10 Mana} {30 Meter Reichweite}\nWirken in 3 sek.\n[q]Überzieht ein Ziel mit 19 Feuerschaden."},
[702] = {name = "Fluch der Schwäche", additional_info = "{20 Mana} {30 Meter Reichweite}\nSofort\n[q]Der vom Ziel verursachte Schaden wird 2 min lang um 3 reduziert. Es kann immer nur jeweils ein Fluch pro Hexenmeister auf einem beliebigen Ziel aktiv sein."},
[703] = {name = "Erdrosseln", additional_info = "{50 Energie} {Nahkampfreichweite}\nSofort\nBenötigt Verstohlenheit\n[q]Erdrosselt den Feind und verursacht 18 sec lang 144 Schaden, erhöht durch Eure Angriffskraft. Muss verstohlen und hinter dem Ziel sein. Gewährt 1 Combopunkt."},
[704] = {name = "Fluch der Tollkühnheit", additional_info = "{35 Mana} {30 Meter Reichweite}\nSofort\n[q]Verflucht das Ziel mit Tollkühnheit, wodurch sich die Nahkampfangriffskraft 2 min lang um 20 erhöht, jedoch die Rüstung um 140 verringert. Mit einem Fluch belegte Feinde fliehen nicht und ignorieren Furcht- und Entsetzenseffekte. Es kann immer nur jeweils ein Fluch pro Hexenmeister auf einem beliebigen Ziel aktiv sein."},
[705] = {name = "Schattenblitz", additional_info = "{70 Mana} {30 Meter Reichweite}\nWirken in 2.8 sek.\n[q]Schleudert einen Schattenblitz auf den Feind und verursacht 52 to 61 Punkt(e) Schattenschaden."},
[706] = {name = "Dämonenrüstung", additional_info = "275 Mana\nSofort\n[q]Schützt den Zaubernden und verbessert die Rüstung um 210, den Schattenwiderstand um 3 und stellt alle 5 Sek. 7 Gesundheit wieder her. Hält 30 min an."},
[707] = {name = "Feuerbrand", additional_info = "{45 Mana} {30 Meter Reichweite}\nWirken in 2 sek.\n[q]Verbrennt den Gegner und fügt ihm [ 24 * ( ( ( 1 ) ) ) ] Feuerschaden sowie im Verlauf von 15 sec insgesamt 40 zusätzlichen Feuerschaden zu."},
[709] = {name = "Blutsauger", additional_info = "{135 Mana} {20 Meter Reichweite}\nKanalisiert (Wirken in 5 sek.)\n[q]Überträgt pro Sekunde 29 Punkt(e) Gesundheit vom Ziel auf den Zaubernden. Hält 5 sec lang an."},
[710] = {name = "Verbannen", additional_info = "{100 Mana} {30 Meter Reichweite}\nWirken in 1.5 sek.\n[q]Verbannt das feindliche Ziel und verhindert damit jegliche Aktion, macht es aber bis zu 20 sec lang unverwundbar. Es kann immer nur jeweils ein Ziel verbannt werden. Funktioniert nur bei Dämonen und Elementaren."},
[711] = {name = "Höllenfeuer", additional_info = "{25 Mana} {30 Meter Reichweite}\n{Wirken in} {3 sek. 6 sek. Abklingzeit}\n[q]Überzieht alle Feinde in einem Umkreis von 10 Metern mit 69 to 78 Punkt(en) Flammenschaden."},
[712] = {name = "Sukkubus beschwören", additional_info = "100% von Grundmana\nWirken in 10 sek.\nReagenzien:\nSeelensplitter\n[q]Beschwört einen Sukkubus, der unter dem Befehl des Hexenmeisters steht."},
