[724] = {name = "Brunnen des Lichts", additional_info = "225 ManaWirken in 1.5 sek. 10 min Abklingzeit\n[q]Beschwört einen Brunnen des Lichts in der Nähe des Zaubernden. Befreundete Ziele können den Brunnen des Lichts anklicken, um im Verlauf von 10 sec 800 Gesundheit wiederherzustellen. Ein erlittener Angriff bricht den Effekt ab. Der Brunnen des Lichts bleibt 3 min lang bestehen oder bis alle 5 Aufladungen verbraucht sind."},
