[759] = {name = "Manaachat herbeizaubern", additional_info = "530 Mana\nWirken in 3 sek.\n[q]Zaubert einen Manaachat herbei, der zum sofortigen Wiederherstellen von 375 to 425 Mana verwendet werden kann.\n\n Herbeigezauberte Gegenstände verschwinden, wenn Ihr Euch länger als 15 Minuten ausloggt."},
