[768] = {name = "Katzengestalt", additional_info = "55% von Grundmana\nSofort\n[q]Gestaltwandlung in Katzengestalt, erhöht Nahkampfangriffskraft um 40 plus Beweglichkeit. Beschützt den Zaubernden auch vor Verwandlungseffekten und erlaubt den Einsatz von verschiedenen Katzenfähigkeiten.\n\n Der Akt des Gestaltwandelns befreit den Zaubernden von Verwandlungs- und bewegungseinschränkenden Effekten."},
[769] = {name = "Prankenhieb", additional_info = "{20 Wut} {Nahkampfreichweite}\nSpontanzauber\nBenötigt Bärengestalt, Terrorbärengestalt\n[q]Schlägt 3 in der Nähe befindliche Feinde und verursacht 36 Punkt(e) Schaden."},
[770] = {name = "Feenfeuer", additional_info = "{55 Mana} {30 Meter Reichweite}\nSofort\n[q]Verringert die Rüstung des Ziels 40 sec lang um 175. Während der Wirkungsdauer kann das Ziel weder Verstohlenheit anwenden noch unsichtbar werden."},
[772] = {name = "Verwunden", additional_info = "{10 Wut} {Nahkampfreichweite}\nSpontanzauber\nBenötigt Nahkampfwaffe\nBenötigt Kampfhaltung, Verteidigungshaltung\n[q]Verwundet das Ziel, lässt es 9 sec lang bluten und fügt damit 15 Punkt(e) Schaden zu."},
[774] = {name = "Verjüngung", additional_info = "{25 Mana} {40 Meter Reichweite}\nSofort\n[q]Heilt beim Ziel 12 sec lang 32 Punkt(e) Schaden."},
[775] = {name = "Baumgestalt", additional_info = "20% von Grundmana\nSofort 5 min Abklingzeit\n[q]Verwandelt den Druiden in eine Baumgestalt. Alle negativen körperlichen Effekte werden aufgehoben, der Zaubernde ist für 8 sec gegen körperlichen Schaden immun, kann aber nicht angreifen, sich bewegen oder Zaubersprüche wirken. Beschützt den Zaubernden auch vor Verwandlungseffekten.\n\n Der Akt der Gestaltwandlung befreit den Zaubernden von Wurzel-, Schlingen- und Eiskälteeffekten."},
[776] = {name = "Magie aufheben", additional_info = "{24 Mana} {30 Meter Reichweite}\n{Sofort} {1 sek. Abklingzeit}\n[q]Hebt die gesamte gegen ein befreundetes Ziel gewirkte Magie auf und verhindert 5 sec lang, dass Magie auf das Ziel angewendet werden kann."},
[778] = {name = "Feenfeuer", additional_info = "{75 Mana} {30 Meter Reichweite}\nSofort\n[q]Verringert die Rüstung des Ziels 40 sec lang um 285. Während der Wirkungsdauer kann das Ziel weder Verstohlenheit anwenden noch unsichtbar werden."},
[779] = {name = "Prankenhieb", additional_info = "{20 Wut} {Nahkampfreichweite}\nSpontanzauber\nBenötigt Bärengestalt, Terrorbärengestalt\n[q]Schlägt 3 in der Nähe befindliche Feinde und verursacht 18 Punkt(e) Schaden."},
