[781] = {name = "Rückzug", additional_info = "{50 Mana} {Nahkampfreichweite}\n{Sofort} {5 sek. Abklingzeit}\nBenötigt Nahkampfwaffe\n[q]Versucht, sich vom Ziel zurückzuziehen und verringert dadurch die Bedrohung. Charakter verlässt Kampfmodus."},
[782] = {name = "Dornen", additional_info = "{60 Mana} {30 Meter Reichweite}\nSofort\n[q]Aus dem befreundeten Ziel sprießen Dornen, die jedem, der es schlägt, 6 Punkt(e) Naturschaden zufügen. Hält 10 min lang an."},
[783] = {name = "Reisegestalt", additional_info = "20% von Grundmana\nSofort\n[q]Verwandelt den Druiden in eine Reisegestalt und erhöht dadurch das Bewegungstempo um 40%. Beschützt den Zaubernden auch vor Verwandlungseffekten. Kann nur draußen verwendet werden.\n\n Der Akt des Gestaltwandelns befreit den Zaubernden von Verwandlungs- und bewegungseinschränkenden Effekten."},
