[974] = {name = "Erdschild", additional_info = "{15% von Grundmana} {40 Meter Reichweite}\nSofort\n[q]Schützt das Ziel mit einem Erdschild, der die erhöhte Zauberdauer oder verringerte Kanalisierungsdauer durch erlittenen Schaden um 30% verringert und Angriffe das geschützte Ziel um heilen lässt. Dieser Effekt tritt nur einmal alle paar Sekunden auf. 6 Aufladungen. Hält 10 min lang an. Der Erdschild kann immer nur auf einem Ziel gleichzeitig aktiv sein, und auf jedem Ziel kann nur ein Elementarschild aktiv sein.\n(3.5s Abklingzeit)"},
