[1006] = {name = "Inneres Feuer", additional_info = "165 Mana\nSofort\n[q]Der Zaubernde wird von einer Explosion der heiligen Energie erfüllt, die seine Rüstung um 945 erhöht. Ein erlittener Nahkampf- oder Distanzangriffstreffer verbraucht eine Aufladung. Hält 10 min lang an oder bis alle 20 Aufladungen verbraucht sind."},
