[1020] = {name = "Gottesschild", additional_info = "110 Mana\nSofort 5 min Abklingzeit\n[q]Schützt den Paladin 12 sec lang vor allen Schäden und Zaubern, erhöht jedoch die Zeit zwischen seinen Angriffen um 100%. Einmal geschützt, kann der Paladin 1 min lang nicht erneut durch Gottesschild, Göttlicher Schutz oder Segen des Schutzes unverwundbar gemacht werden."},
[1021] = {name = "Gottesschild", additional_info = "Wirken in 3 sek."},
[1022] = {name = "Segen des Schutzes", additional_info = "{25 Mana} {30 Meter Reichweite}\nSofort 5 min Abklingzeit\n[q]Ein anvisiertes Gruppenmitglied ist 6 sec lang vor allen körperlichen Angriffen geschützt, allerdings kann es dabei weder angreifen noch körperliche Fähigkeiten einsetzen. Spieler können pro Paladin immer nur mit einem einzigen Segen belegt sein. Einmal geschützt, kann das Ziel 1 min lang nicht erneut durch Göttlicher Schutz oder Segen des Schutzes unverwundbar gemacht werden"},
