[1064] = {name = "Kettenheilung", additional_info = "{260 Mana} {40 Meter Reichweite}\nWirken in 2.5 sek.\n[q]Heilt das verbündete Ziel um 332 to 381 Gesundheit und springt dann weiter, um weitere Ziele in der Nähe zu heilen. Wenn der Zauber auf ein Gruppenmitglied gewirkt wird, springt die Heilung nur auf andere Gruppenmitglieder über. Nach jedem Sprung beträgt die Heilung 50% des vorhergehenden Wertes. Heilt insgesamt 3 Ziele."},
