[1076] = {name = "Dornen", additional_info = "Wirken in 3 sek."},
[1079] = {name = "Zerfetzen", additional_info = "{30 Energie} {Nahkampfreichweite}\nSofort\nBenötigt Katzengestalt\n[q]Finishing-Move, der Schaden im Lauf der Zeit verursacht. Der Schaden erhöht sich pro Combopunkt sowie durch Eure Angriffskraft:\n 1 Punkt: 42 Schaden im Verlauf von 12 sec\n 2 Punkte: 66 Schaden im Verlauf von 12 sec\n 3 Punkte: 90 Schaden im Verlauf von 12 sec\n 4 Punkte: 114 Schaden im Verlauf von 12 sec\n 5 Punkte: 138 Schaden im Verlauf von 12 sec"},
[1082] = {name = "Klaue", additional_info = "{45 Energie} {Nahkampfreichweite}\nSofort\nBenötigt Katzengestalt\n[q]Den Feind mit Klauen beharken und ihm so zusätzlich 27 Punkt(e) Schaden zufügen. Gewährt 1 Combopunkt."},
