[1121] = {name = "Umschlingen", additional_info = nil},
[1122] = {name = "Inferno", additional_info = "{100% von Grundmana} {30 Meter Reichweite}\nWirken in 2 sek. 1 Stunde Abklingzeit\nReagenzien:\nHöllenstein\n[q]Beschwört einen Meteor aus dem Wirbelnden Nether, der 200 Punkt(e) Feuerschaden verursacht und alle feindlichen Ziele in dem Gebiet 2 sec lang betäubt. Aus dem Krater erhebt sich eine Höllenbestie, die 5 min lang unter dem Befehl des Zaubernden steht. Sobald die Kontrolle verloren ist, muss die Höllenbestie unterworfen werden, um sie unter Kontrolle zu halten. Kann nur draußen verwendet werden."},
[1123] = {name = "Ritual der Verdammnis", additional_info = "Wirken in 3 sek.\n[q]Lehrt das Ritual der Verdammnis."},
[1124] = {name = "Höllenfeuer II", additional_info = "{27 Mana} {30 Meter Reichweite}\n{Wirken in} {3 sek. 6 sek. Abklingzeit}\n[q]Überzieht alle Feinde in einem Umkreis von 10 Metern mit 80 to 91 Punkt(en) Flammenschaden."},
