[1463] = {name = "Manaschild", additional_info = "40 Mana\nSofort\n[q]Absorbiert 120 Punkt(e) körperlichen Schaden und entzieht stattdessen Mana. Entzieht dem Ziel 2 Punkt(e) Mana pro absorbiertem Schaden. Hält 1 min lang an."},
