[1490] = {name = "Fluch der Elemente", additional_info = "{100 Mana} {30 Meter Reichweite}\nSofort\n[q]Verflucht das Ziel und verringert 5 min lang seinen Feuer- und Frostwiderstand um 45. Erhöht außerdem den erlittenen Feuer- und Frostschaden um 6%. Es kann immer nur jeweils ein Fluch pro Hexenmeister auf einem beliebigen Ziel aktiv sein."},
[1494] = {name = "Wildtiere aufspüren", additional_info = "Sofort\n[q]Zeigt den Aufenthaltsort aller in der Nähe befindlichen Wildtiere auf der Minikarte an. Es kann immer nur jeweils eine Art des Fährtenlesens benutzt werden."},
[1495] = {name = "Mungobiss", additional_info = "{30 Mana} {Nahkampfreichweite}\n{Sofort} {5 sek. Abklingzeit}\n[q]Ein Gegenangriff auf den Feind fügt ihm 25 Punkt(e) Schaden zu. Kann nur eingesetzt werden, nachdem Ihr ausgewichen seid."},
[1499] = {name = "Eiskältefalle", additional_info = "50 Mana\n{Sofort} {15 sek. Abklingzeit}\n[q]Eine Eiskältefalle platzieren, die den ersten sich nähernden Feind einfriert und 10 sec lang jegliche Aktion des Feindes verhindert. Jeglicher erlittener Schaden wird das Eis wieder brechen. Die Falle bleibt 1 min lang bestehen. Fallen können nur außerhalb von Kampfaktivitäten platziert werden. Es kann immer nur jeweils eine Falle aktiv sein."},
[1509] = {name = "GM Only OFF", additional_info = nil},
[1510] = {name = "Salve", additional_info = "{350 Mana} {8 - 35 Meter Reichweite}\nKanalisiert (Wirken in 6 sek.) 1 min Abklingzeit\nBenötigt Distanzwaffe\n[q]Feuert kontinuierlich eine Salve Munition auf das Zielgebiet und verursacht 6 sec lang pro Sekunde 50 Punkt(e) Arkanschaden bei feindlichen Zielen im Umkreis von 8 Metern."},
[1513] = {name = "Wildtier ängstigen", additional_info = "{35 Mana} {10 Meter Reichweite}\n{Wirken in} {1.5 sek. 30 sek. Abklingzeit}\n[q]Jagt einem Wildtier Angst ein, woraufhin es bis zu 10 sec lang voller Furcht wegläuft. Erlittener Schaden kann den Effekt unterbrechen. Es kann immer nur jeweils ein Wildtier mit dem Furchteffekt versehen werden."},
[1515] = {name = "Wildtier zähmen", additional_info = "{60% von Grundmana} {30 Meter Reichweite}\nKanalisiert (Wirken in 20 sek.)\n[q]Beginnt mit dem Zähmen eines Wildtiers, damit es Euer Gefährte wird. Eure Rüstung ist um 100% verringert, während Ihr Euch 20 sec lang auf das Zähmen des Wildtiers fokussiert. Falls Ihr die Aufmerksamkeit des Wildtiers aus irgendeinem Grund verlieren solltet, schlägt der Vorgang der Zähmung fehl. Nachdem das Wildtier gezähmt ist, wird es sehr unzufrieden und nicht loyal sein. Füttert das Tier sofort, um es zufrieden zu stellen."},
[1516] = {name = "Schnellschuss", additional_info = "5 - 30 Meter Reichweite\n1 min Abklingzeit\nBenötigt Distanzwaffe\n[q]Feuert Eure Waffe sofort ab und verursacht so 5 Punkt(e) zusätzlichen Schaden."},
[1528] = {name = "Meister befreien", additional_info = "5 Meter Reichweite\nSofort\n[q]Befreit Euren Meister von allen Fesseln."},
[1535] = {name = "Totem der Feuernova", additional_info = "95 Mana\n{Sofort} {15 sek. Abklingzeit}\nTools: Feuertotem\n[q]Beschwört ein Totem der Feuernova mit 5 Punkt(en) Gesundheit, das 5 sec lang anhält. Wenn es nicht innerhalb von 4 Sek. zerstört wird, fügt das Totem Feinden in einem Umkreis von 10 Metern 53 to 62 Punkt(e) Feuerschaden zu."},
