[3967] = {name = "Große Eisenbombe", additional_info = "Wirken in 12.5 sek.\nTools: Schmiedehammer , Bogenlichtschraubenschlüssel\nReagenzien:\nEisenbarren (3), Schweres Sprengpulver (3), Silberkontakt\n(2)\nBenötigtIngenieurskunst\n(190)\n[q2]Benutzen: Fügt 149 to 201 Feuerschaden zu und betäubt Ziele 3 sec lang in einem Umkreis von 5 Metern. Jeglicher Schaden wird den Effekt abbrechen. (1 Min Abklingzeit)\nGeplündert von: Argentumwachposten"},
[3968] = {name = "Goblin-Landmine", additional_info = "Wirken in 12.5 sek.\nTools: Schmiedehammer , Bogenlichtschraubenschlüssel\nReagenzien:\nSchweres Sprengpulver (3), Eisenbarren (2), Gyrochronatom\n[q]Eine Goblin-Landmine bauen.\nBenötigtIngenieurskunst\n(195)\n[q2]Benutzen: Platziert die Goblin-Landmine auf dem Boden. Sie explodiert, sobald eine feindliche Kreatur an ihr vorbeigeht, und fügt ihr 394 to 506 Feuerschaden zu. Die Mine ist 1 min lang aktiv. (1 Min Abklingzeit)"},
