[11442] = {name = "Welkberührung", additional_info = "Nahkampfreichweite\nSofort\n[q]Lässt einen Feind erkranken, verursacht alle 10 Sek. 2 Punkt(e) Schattenschaden, entzieht alle 10 Sek. 2 Punkt(e) Mana und überträgt sie auf den Zaubernden. Hält 3 min lang an."},
[11443] = {name = "Verkrüppeln", additional_info = "{8% von Grundmana} {30 Meter Reichweite}\nWirken in 3 sek.\n[q]Erhöht die Zeit zwischen Angriffen eines Feindes um 100%, verringert sein Bewegungstempo um 50% und zusätzlich seine Stärke um 50%. Hält 15 sec lang an."},
[11444] = {name = "Untote fesseln", additional_info = "{50 Mana} {30 Meter Reichweite}\nWirken in 2 sek.\n[q]Fesselt einen untoten Feind bis zu 20 sec lang und hindert ihn daran, Zauber zu wirken, anzugreifen oder sich zu bewegen. Jeglicher zugefügte Schaden wird das Ziel befreien. Es kann immer nur jeweils ein Ziel gefesselt sein."},
[11445] = {name = "Knochenrüstung", additional_info = "10% von Grundmana\n{Sofort} {4 sek. Abklingzeit}\n[q]Hüllt den Zaubernden in eine Knochenrüstung und absorbiert 1 min lang 278 to 322 Punkt(e) Schaden. Solange die Rüstung hält, kann das Wirken von Zaubern nicht durch physische Angriffe unterbrochen werden."},
