[12824] = {name = "Verwandlung", additional_info = "{90 Mana} {30 Meter Reichweite}\nWirken in 1.5 sek.\n[q]Verwandelt den Feind in ein Schaf und zwingt ihn, 30 sec lang so herumzuwandern. Während das Schaf herumwandert, kann es weder angreifen noch Zauber wirken, regeneriert sich aber sehr schnell. Jeglicher erlittene Schaden verwandelt das Ziel in seine normale Gestalt zurück. Es kann immer nur jeweils ein Ziel verwandelt werden. Wirkt nur bei Wildtieren, Humanoiden und Tieren."},
