[12903] = {name = "[q2]Gnomen-Unglücksverhinderungsgürtel", additional_info = "Wirken in 45 sek.\nTools: Schmiedehammer , Bogenlichtschraubenschlüssel\nReagenzien:\nSchwärzlicher Gürtel , Mithrilbarren (4), Echtsilberbarren (2), Instabiler Auslöser , Aquamarin (2)\n[q2]Gnomen-Unglücksverhinderungsgürtel\nWird beim Anlegen gebunden\nTaille Leder\n66 Rüstung\n+6 Ausdauer\nHaltbarkeit 30 / 30\nBenötigtIngenieurskunst\n(215)\n[q2]Benutzen: Ein Kraftfeldschild beschützt Euch vor dem nächsten zugefügten 500-Schaden im Verlauf der nächsten 10 min. WARNUNG: Kraftfeld kann überladen werden, wenn es getroffen wird. Der Träger wird dann für gewisse Zeit aus dieser Dimension entfernt. (Procchance: 5%) (1 Stunde Abklingzeit)"},
