[14293] = {name = "[q2]Geringer Magiezauberstab", additional_info = "Wirken in 10 sek.\nTools: Runenverzierte Kupferrute\nReagenzien:\nEinfaches Holz , Geringe Magieessenz\n[q]Lässt einen geringen Zauberstab entstehen.\n[q2]Geringer Magiezauberstab\nWird beim Anlegen gebunden\nDistanz Zauberstab\n12 - 22 Arkanschaden Tempo 1.50\n(11.33 Schaden pro Sekunde)\nHaltbarkeit 35 / 35\n5"},
[14294] = {name = "Salve", additional_info = "{420 Mana} {8 - 35 Meter Reichweite}\nKanalisiert (Wirken in 6 sek.) 1 min Abklingzeit\nBenötigt Distanzwaffe\n[q]Feuert kontinuierlich eine Salve Munition auf das Zielgebiet und verursacht 6 sec lang pro Sekunde 65 Punkt(e) Arkanschaden bei feindlichen Zielen im Umkreis von 8 Metern."},
[14295] = {name = "Salve", additional_info = "{490 Mana} {8 - 35 Meter Reichweite}\nKanalisiert (Wirken in 6 sek.) 1 min Abklingzeit\nBenötigt Distanzwaffe\n[q]Feuert kontinuierlich eine Salve Munition auf das Zielgebiet und verursacht 6 sec lang pro Sekunde 80 Punkt(e) Arkanschaden bei feindlichen Zielen im Umkreis von 8 Metern."},
[14296] = {name = "Schwarzer Pfeil", additional_info = "8 - 35 Meter Reichweite\nSofort\nBenötigt Distanzwaffe\n[q]Feuert einen schwarzen Pfeil auf das Ziel ab, verringert das Bewegungstempo des Ziels um 70%, verursacht 150 Schattenschaden und zieht 30 sec lang 150 Mana ab."},
[14297] = {name = "Schattensturm", additional_info = "45 Meter Reichweite\nSofort\n[q]Schleudert Schattenblitze auf Gegner, die sich in einem Umkreis von 20 bis 45 Metern befinden."},
