[14302] = {name = "Feuerbrandfalle", additional_info = "90 Mana\n{Sofort} {15 sek. Abklingzeit}\n[q]Eine Feuerfalle platzieren, die 15 sec lang dem ersten sich nähernden Feind 215 Punkt(e) Feuerschaden zufügt. Die Falle bleibt 1 min lang bestehen. Fallen können nur außerhalb von Kampfaktivitäten platziert werden. Es kann immer nur jeweils eine Falle aktiv sein."},
[14303] = {name = "Feuerbrandfalle", additional_info = "135 Mana\n{Sofort} {15 sek. Abklingzeit}\n[q]Eine Feuerfalle platzieren, die 15 sec lang dem ersten sich nähernden Feind 340 Punkt(e) Feuerschaden zufügt. Die Falle bleibt 1 min lang bestehen. Fallen können nur außerhalb von Kampfaktivitäten platziert werden. Es kann immer nur jeweils eine Falle aktiv sein."},
[14304] = {name = "Feuerbrandfalle", additional_info = "190 Mana\n{Sofort} {15 sek. Abklingzeit}\n[q]Eine Feuerfalle platzieren, die 15 sec lang dem ersten sich nähernden Feind 510 Punkt(e) Feuerschaden zufügt. Die Falle bleibt 1 min lang bestehen. Fallen können nur außerhalb von Kampfaktivitäten platziert werden. Es kann immer nur jeweils eine Falle aktiv sein."},
[14305] = {name = "Feuerbrandfalle", additional_info = "245 Mana\n{Sofort} {15 sek. Abklingzeit}\n[q]Eine Feuerfalle platzieren, die 15 sec lang dem ersten sich nähernden Feind 690 Punkt(e) Feuerschaden zufügt. Die Falle bleibt 1 min lang bestehen. Fallen können nur außerhalb von Kampfaktivitäten platziert werden. Es kann immer nur jeweils eine Falle aktiv sein."},
