[14310] = {name = "Eiskältefalle", additional_info = "75 Mana\n{Sofort} {15 sek. Abklingzeit}\n[q]Eine Eiskältefalle platzieren, die den ersten sich nähernden Feind einfriert und 15 sec lang jegliche Aktion des Feindes verhindert. Jeglicher erlittener Schaden wird das Eis wieder brechen. Die Falle bleibt 1 min lang bestehen. Fallen können nur außerhalb von Kampfaktivitäten platziert werden. Es kann immer nur jeweils eine Falle aktiv sein."},
[14311] = {name = "Eiskältefalle", additional_info = "100 Mana\n{Sofort} {15 sek. Abklingzeit}\n[q]Eine Eiskältefalle platzieren, die den ersten sich nähernden Feind einfriert und 20 sec lang jegliche Aktion des Feindes verhindert. Jeglicher erlittener Schaden wird das Eis wieder brechen. Die Falle bleibt 1 min lang bestehen. Fallen können nur außerhalb von Kampfaktivitäten platziert werden. Es kann immer nur jeweils eine Falle aktiv sein."},
