[14316] = {name = "Sprengfalle", additional_info = "395 Mana\n{Sofort} {15 sek. Abklingzeit}\n[q]Eine Feuerfalle platzieren, die explodiert, wenn sich ein Feind nähert. Die Falle verursacht 145 to 193 Feuerschaden und verbrennt 20 sec lang alle Feinde in einem Umkreis von 10 Metern, indem sie ihnen 240 zusätzlichen Feuerschaden zufügt. Die Falle bleibt 1 min lang bestehen. Fallen können nur außerhalb von Kampfaktivitäten platziert werden. Es kann immer nur jeweils eine Falle aktiv sein."},
[14317] = {name = "Sprengfalle", additional_info = "520 Mana\n{Sofort} {15 sek. Abklingzeit}\n[q]Eine Feuerfalle platzieren, die explodiert, wenn sich ein Feind nähert. Die Falle verursacht 208 to 265 Feuerschaden und verbrennt 20 sec lang alle Feinde in einem Umkreis von 10 Metern, indem sie ihnen 330 zusätzlichen Feuerschaden zufügt. Die Falle bleibt 1 min lang bestehen. Fallen können nur außerhalb von Kampfaktivitäten platziert werden. Es kann immer nur jeweils eine Falle aktiv sein."},
[14318] = {name = "Aspekt des Falken", additional_info = "35 Mana\nSofort\n[q]Der Jäger nimmt die Aspekte eines Falken an: Die Distanzangriffskraft wird um 35 erhöht. Es kann immer nur jeweils ein Aspekt aktiv sein."},
[14319] = {name = "Aspekt des Falken", additional_info = "50 Mana\nSofort\n[q]Der Jäger nimmt die Aspekte eines Falken an: Die Distanzangriffskraft wird um 50 erhöht. Es kann immer nur jeweils ein Aspekt aktiv sein."},
[14320] = {name = "Aspekt des Falken", additional_info = "70 Mana\nSofort\n[q]Der Jäger nimmt die Aspekte eines Falken an: Die Distanzangriffskraft wird um 70 erhöht. Es kann immer nur jeweils ein Aspekt aktiv sein."},
