[14323] = {name = "Mal des Jägers", additional_info = "{30 Mana} {100 Meter Reichweite}\nSofort\n[q]Legt das Mal des Jägers auf das Ziel und erhöht dabei die Distanzangriffskraft aller Angreifer gegen dieses Ziel um 45. Zusätzlich ist mit dieser Fähigkeit das Ziel immer sichtbar, auch wenn es in den Verstohlenheitsmodus geht oder unsichtbar wird. Das Ziel wird außerdem auf der Minikarte angezeigt. Hält 2 min lang an."},
[14324] = {name = "Mal des Jägers", additional_info = "{45 Mana} {100 Meter Reichweite}\nSofort\n[q]Legt das Mal des Jägers auf das Ziel und erhöht dabei die Distanzangriffskraft aller Angreifer gegen dieses Ziel um 75. Zusätzlich ist mit dieser Fähigkeit das Ziel immer sichtbar, auch wenn es in den Verstohlenheitsmodus geht oder unsichtbar wird. Das Ziel wird außerdem auf der Minikarte angezeigt. Hält 2 min lang an."},
[14325] = {name = "Mal des Jägers", additional_info = "{60 Mana} {100 Meter Reichweite}\nSofort\n[q]Legt das Mal des Jägers auf das Ziel und erhöht dabei die Distanzangriffskraft aller Angreifer gegen dieses Ziel um 110. Zusätzlich ist mit dieser Fähigkeit das Ziel immer sichtbar, auch wenn es in den Verstohlenheitsmodus geht oder unsichtbar wird. Das Ziel wird außerdem auf der Minikarte angezeigt. Hält 2 min lang an."},
[14326] = {name = "Wildtier ängstigen", additional_info = "{50 Mana} {10 Meter Reichweite}\n{Wirken in} {1.5 sek. 30 sek. Abklingzeit}\n[q]Jagt einem Wildtier Angst ein, woraufhin es bis zu 15 sec lang voller Furcht wegläuft. Erlittener Schaden kann den Effekt unterbrechen. Es kann immer nur jeweils ein Wildtier mit dem Furchteffekt versehen werden."},
