[14514] = {name = "Blinzeln", additional_info = "75 Mana\nSofort\n[q]Teleportiert den Zaubernden 20 Meter nach vorn, es sei denn, etwas steht im Weg. Befreit den Zaubernden auch von jeglichen Banden."},
[14515] = {name = "Gedanken beherrschen", additional_info = "{30 Mana} {20 Meter Reichweite}\nWirken in 2 sek."},
[14516] = {name = "Schlag", additional_info = "Nahkampfreichweite\nNächster Nahkampf\nBenötigt Nahkampfwaffe\n[q]Schlägt einen Feind und fügt erhöhten Nahkampfschaden zu."},
[14517] = {name = "Kreuzfahrerstoß", additional_info = "{40 Mana} {Nahkampfreichweite}\nSofort\nBenötigt Nahkampfwaffe\n[q]Verursacht 27 Punkt(e) Schaden bei einem Feind und erhöht seinen erlittenen Heiligschaden um 10 Punkt(e) pro Kreuzfahrerstoß. Kann bis zu 5-mal angewendet werden. Hält 30 sec lang an."},
[14518] = {name = "Kreuzfahrerstoß", additional_info = "{40 Mana} {Nahkampfreichweite}\nSofort\nBenötigt Nahkampfwaffe\n[q]Verursacht 50 Punkt(e) Schaden bei einem Feind und erhöht seinen erlittenen Heiligschaden um 20 Punkt(e) pro Kreuzfahrerstoß. Kann bis zu 5-mal angewendet werden. Hält 30 sec lang an."},
[14520] = {name = "Mentale Beweglichkeit", additional_info = "[q]Verringert die Manakosten Eurer Spontanzauber um 2%."},
[14521] = {name = "Meditation", additional_info = "[q]Ermöglicht, dass 5% Eurer Manaregeneration während des Zauberwirkens weiterläuft."},
[14522] = {name = "Unbezwingbarer Wille", additional_info = "[q]Erhöht Eure Chance, Betäubungs-, Furcht- und Stilleeffekten zu widerstehen, um weitere 3%."},
[14523] = {name = "Schweigsame Entschlossenheit", additional_info = "[q]Verringert die von Euren Zaubern verursachte Bedrohung um 4%."},
[14524] = {name = "Zauberstab-Spezialisierung", additional_info = "[q]Erhöht Eure Schadenswirkung mit Zauberstäben um 5%."},
[14525] = {name = "Zauberstab-Spezialisierung", additional_info = "[q]Erhöht Eure Schadenswirkung mit Zauberstäben um 10%."},
[14526] = {name = "Zauberstab-Spezialisierung", additional_info = "[q]Erhöht Eure Schadenswirkung mit Zauberstäben um 15%."},
[14527] = {name = "Zauberstab-Spezialisierung", additional_info = "[q]Erhöht Eure Schadenswirkung mit Zauberstäben um 20%."},
[14528] = {name = "Zauberstab-Spezialisierung", additional_info = "[q]Erhöht Eure Schadenswirkung mit Zauberstäben um 25%."},
[14530] = {name = "Tempo", additional_info = "Sofort\n[q]Erhöht das Lauftempo 10 sec lang um 40%."},
[14531] = {name = "Märtyrertum", additional_info = "[q]Gewährt Euch eine Chance von 50%, den Effekt 'Fokussiertes Zauberwirken' zu erhalten, der 6 sec lang anhält, nachdem Ihr Opfer eines kritischen Nahkampf- oder Distanzangriffs wart. Der Effekt 'Fokussiertes Zauberwirken' verhindert, dass Ihr Zauberzeit durch Euch zugefügten Schaden verliert. Zusätzlich wird Euer Widerstand gegenüber Unterbrechungseffekten um 10% erhöht.\n(Procchance: 50%)"},
[14532] = {name = "Krabblergift", additional_info = "Wirken in 2 sek.\n[q]Erhöht den erlittenen körperlichen Schaden von in der Nähe befindlichen Feinden 5 min lang um 30%."},
[14533] = {name = "Abtrennung", additional_info = "Sofort\n[q]Erhöht 5 min lang den von in der Nähe befindlichen Feinden erlittenen Feuer-, Frost- und Arkanschaden um 50%."},
[14534] = {name = "Stachelstich", additional_info = "Sofort\n[q]Erhöht die Zeit zwischen Angriffen in der Nähe befindlicher Feinde 5 min lang um 54%."},
[14535] = {name = "Baggererkrankung", additional_info = "Sofort\n[q]Verringert alle Attribute von in der Nähe befindlichen Feinden 5 min lang um 25%."},
[14537] = {name = "Sechsdämonentasche", additional_info = "30 Meter Reichweite\nSofort\n[q]Überzieht den Feind mit der Macht des Windes, des Feuers und all solchen Dingen!"},
[14538] = {name = "Auraschock", additional_info = "Sofort\n[q]Verringert das Zaubertempo von in der Nähe befindlichen Feinden 5 min lang um 35%."},
[14539] = {name = "Eitriges Enzym", additional_info = "Sofort\n[q]Erhöht den erlittenen Naturschaden von in der Nähe befindlichen Feinden um 50% und erhöht den von ihnen erlittenen Schattenschaden um 50%. Hält 5 min lang an."},
