[17628] = {name = "Oberste Macht", additional_info = "{Sofort} {1 sek. Abklingzeit}\n[q]Erhöht die Schadenswirkung von Zaubern und magischen Effekten 2 hrs lang um bis zu 150. Es kann immer nur der Effekt von jeweils einem Fläschchen aktiv sein. Dieser Effekt hält über den Tod hinaus an."},
