[17727] = {name = "Zauberstein herstellen (groß)", additional_info = "750 Mana\nWirken in 5 sek.\nReagenzien:\nSeelensplitter\n[q]Stellt einen großen Zauberstein für den Zaubernden her. Wenn er verwendet und benutzt wird, entfernt der große Zauberstein alle magischen Effekte vom Zaubernden und absorbiert 1 min lang 650 Punkt(e) Magieschaden. Außerdem erhöht das Anlegen eines großen Zaubersteins Eure Chance für einen kritischen Zaubertreffer um 1%.\n\n Herbeigezauberte Gegenstände verschwinden, wenn Ihr Euch länger als 15 Minuten ausloggt."},
