[17738] = {name = "Fluch der Seuchenratte", additional_info = "{10% von Grundmana} {30 Meter Reichweite}\nWirken in 1.5 sek.\n[q]Verwandelt einen Feind in eine Ratte und zwingt ihn, bis zu 14 sec lang so herumzuwandern und alle 2 Sekunden in der Nähe befindlichen Verbündeten 500 Naturschaden zuzufügen. Während die Ratte herumwandert, kann sie weder angreifen noch Zauber wirken, regeneriert sich aber sehr schnell. Es kann immer nur jeweils ein Ziel verflucht werden."},
