[17951] = {name = "Feuerstein herstellen", additional_info = "700 Mana\nWirken in 3 sek.\nReagenzien:\nSeelensplitter\n[q]Stellt einen Feuerstein her, der in der Schildhand verwendet werden kann. Bei Verwendung wird die Waffenhandwaffe mit Feuer verzaubert und gewährt jedem Angriff die Chance, 40 to 60 zusätzlichen Feuerschaden zuzufügen. Außerdem erhöht das Anlegen eines Feuersteins den Schaden von Feuerzaubern um 14.\n\n Herbeigezauberte Gegenstände verschwinden, wenn Ihr Euch länger als 15 Minuten ausloggt."},
