[18540] = {name = "Ritual der Verdammnis", additional_info = "{100% von Grundmana} {30 Meter Reichweite}\nWirken in 10 sek. 1 Stunde Abklingzeit\nReagenzien:\nDämonenstatuette\n[q]Beginnt ein Ritual, das einen zufälligen Teilnehmer opfert, um eine Verdammniswache zu beschwören. Die Verdammniswache muss sofort unterworfen werden, sonst wird sie die Teilnehmer des Rituals angreifen. Um das Ritual zu vervollständigen, werden der Zaubernde und 4 zusätzliche Gruppenmitglieder benötigt. Um teilzunehmen, müssen alle Spieler auf das Portal rechtsklicken und dürfen sich nicht bewegen, bis das Ritual abgeschlossen ist."},
