[20154] = {name = "Siegel der Rechtschaffenheit", additional_info = "20 Mana\nSofort\n[q]Erfüllt den Paladin 30 sec lang mit heiligem Geist, der jedem Nahkampfangriff zusätzlichen Heiligschaden in Höhe von 3 - 9 verleiht. Langsamere Waffen verursachen mehr Heiligschaden pro Schlag. Es kann immer nur jeweils ein Siegel auf dem Paladin aktiv sein."},
