[20162] = {name = "Siegel des Kreuzfahrers", additional_info = "40 Mana\nSofort\n[q]Erfüllt den Paladin 30 sec lang mit dem Geist eines Kreuzfahrers und verleiht 60 Nahkampfangriffskraft. Außerdem greift der Paladin um 40% schneller an, verursacht jedoch bei jedem Angriff weniger Schaden. Es kann immer nur jeweils ein Siegel auf dem Paladin aktiv sein.\n\n Die Entfesselung der Energie dieses Siegels richtet einen Feind 10 sec lang und erhöht den erlittenen Heiligschaden bis zu 30. Eure Nahkampfangriffe frischen die Dauer dieses Siegels auf. Es kann immer nur jeweils ein Richturteil pro Paladin aktiv sein."},
[20164] = {name = "Siegel der Gerechtigkeit", additional_info = "13% von Grundmana\nSofort\n[q]Erfüllt den Paladin 30 sec lang mit dem Geist der Gerechtigkeit, der jedem Nahkampfangriff eine Chance verleiht, 2 sec lang zu betäuben. Es kann immer nur jeweils ein Siegel auf dem Paladin aktiv sein.\n\n Die Entfesselung der Energie dieses Siegels richtet einen Feind 10 sec lang und hindert ihn an der Flucht. Eure Nahkampfangriffe frischen die Dauer dieses Siegels auf. Es kann immer nur jeweils ein Richturteil pro Paladin aktiv sein."},
[20165] = {name = "Siegel des Lichts", additional_info = "110 Mana\nSofort\n[q]Erfüllt den Paladin 30 sec lang mit göttlichem Licht, das jedem Nahkampfangriff eine Chance verleiht, den Paladin um 39 Punkt(e) zu heilen. Es kann immer nur jeweils ein Siegel auf dem Paladin aktiv sein.\n\n Die Entfesselung der Energie dieses Siegels richtet einen Feind 10 sec lang und verleiht Nahkampfangriffen, die gegen den gerichteten Feind ausgeführt werden, eine Chance den Angreifer um 25 Punkt(e) zu heilen. Eure Nahkampfangriffe erneuern die Dauer dieses Effekts. Es kann immer nur jeweils ein Richturteil pro Paladin aktiv sein."},
[20166] = {name = "Siegel der Weisheit", additional_info = "135 Mana\nSofort\n[q]Erfüllt den Paladin 30 sec lang mit göttlicher Weisheit, die jedem Nahkampfangriff eine Chance verleiht, 50 Punkt(e) Mana des Paladins wiederherzustellen. Es kann immer nur jeweils ein Siegel auf dem Paladin aktiv sein.\n\n Die Entfesselung der Energie dieses Siegels richtet einen Feind 10 sec lang und verleiht Angriffen und Zaubern, die gegen den gerichteten Feind ausgeführt werden, eine Chance beim Angreifer 33 Punkt(e) Mana wiederherzustellen. Eure Nahkampfangriffe erneuern die Dauer dieses Effekts. Es kann immer nur jeweils ein Richturteil pro Paladin aktiv sein."},
