[20347] = {name = "Siegel des Lichts", additional_info = "140 Mana\nSofort\n[q]Erfüllt den Paladin 30 sec lang mit göttlichem Licht, das jedem Nahkampfangriff eine Chance verleiht, den Paladin um 53 Punkt(e) zu heilen. Es kann immer nur jeweils ein Siegel auf dem Paladin aktiv sein.\n\n Die Entfesselung der Energie dieses Siegels richtet einen Feind 10 sec lang und verleiht Nahkampfangriffen, die gegen den gerichteten Feind ausgeführt werden, eine Chance den Angreifer um 34 Punkt(e) zu heilen. Eure Nahkampfangriffe erneuern die Dauer dieses Effekts. Es kann immer nur jeweils ein Richturteil pro Paladin aktiv sein."},
