[20687] = {name = "Sternenregen", additional_info = "{500 Mana} {30 Meter Reichweite}\nKanalisiert (Wirken in 10 sek.)\n[q]Fügt 10 sec lang Feinden im ausgewählten Gebiet alle 2 Sek. 760 to 840 Punkt(e) Arkanschaden zu."},
[20688] = {name = "Sengpfeil", additional_info = "50 Meter Reichweite\nBenötigt Distanzwaffe\nReagenzien:\nFeuerteer\n[q]Schießt einen Flammenpfeil gegen einen Feind und fügt Waffenschaden plus 600 zu. Jeglicher zugefügte Schaden basiert auf Feuermagie."},
[20690] = {name = "Mondfeuer", additional_info = "{375 Mana} {50 Meter Reichweite}\nSofort\n[q]Fügt einem Feind 1140 to 1260 Punkt(e) Arkanschaden zu und dann 12 sec lang alle 3 Sek. zusätzlich 285 to 315 Punkt(e) Schaden."},
[20691] = {name = "Spalten", additional_info = "15 Meter Reichweite\nNächster Nahkampf\n[q]Fügt einem Feind und seinen nächsten Verbündeten normalen Schaden zu. Wirkt auf bis zu 5 Ziele."},
[20692] = {name = "Feuerball", additional_info = "50 Meter Reichweite\nWirken in 1.5 sek.\n[q]Verursacht 1360 to 1840 Punkt(e) Feuerschaden bei einem Feind."},
