[20694] = {name = "Heilige Nova", additional_info = "315 Mana\nSofort\n[q]Verursacht eine Explosion göttlichen Lichts, fügt in der Nähe befindlichen Feinden 720 to 880 Punkt(e) Heiligschaden zu und verringert until cancelled lang des Zaubernden Maß an Bedrohung."},
[20695] = {name = "Heiliges Schmettern", additional_info = "{100 Mana} {40 Meter Reichweite}\nWirken in 1.5 sek.\n[q]Zerschmettert einen Feind und fügt ihm 1350 to 1650 Punkt(e) Heiligschaden zu."},
[20696] = {name = "Heiliges Schmettern", additional_info = "{100 Mana} {40 Meter Reichweite}\nWirken in 1.5 sek.\n[q]Zerschmettert einen Feind und fügt ihm 1350 to 1650 Punkt(e) Heiligschaden zu."},
[20697] = {name = "Machtwort: Schild", additional_info = "{200 Mana} {40 Meter Reichweite}\nSofort\n[q]Umgibt den Zaubernden mit einem Schild, der bis zu 30 sec lang bestehen bleibt und maximal 5000 Punkt(e) körperlichen oder magischen Schaden absorbiert. Solange der Schild hält, werden Zauber nicht durch körperliche Angriffe unterbrochen."},
[20698] = {name = "Zorn", additional_info = "{200 Mana} {40 Meter Reichweite}\nWirken in 1 sek.\n[q]Schleudert einen Blitzschlag auf einen Feind und verursacht 1020 to 1380 Punkt(e) Naturschaden."},
[20699] = {name = "Wucherwurzeln", additional_info = "30 Meter Reichweite\nSofort\n[q]Umwickelt in der Nähe befindliche Feinde mit Wurzeln, macht sie bis zu 15 sec lang bewegungsunfähig und fügt ihnen alle 3 Sek. 333 to 367 Punkt(e) Naturschaden zu."},
[20700] = {name = "Ritual der Verdammnis", additional_info = nil},
