[20705] = {name = "Machtschild 500", additional_info = "[q]Falls man im Gefecht Opfer eines kritischen Treffers wird, besteht eine Chance von 1%, in einen magischen Schild gehüllt zu werden, der die nächsten 515 Punkt(e) Schaden absorbiert.\n(Procchance: 5%)"},
[20706] = {name = "Machtwort: Schild 500", additional_info = "40 Meter Reichweite\nSofort\n[q]Nutzt die Kraft der Seele zum Abschirmen und absorbiert dabei 515 Punkt(e) Schaden. Hält 30 sec lang an. Solange der Schild hält, wird das Zauberwirken durch erlittenen Schaden nicht unterbrochen. Nachdem das Ziel einmal abgeschirmt wurde, kann es 15 sec lang nicht wieder abgeschirmt werden."},
[20707] = {name = "Seelenstein-Auferstehung", additional_info = "30 Meter Reichweite\nWirken in 3 sek.\n[q]Speichert die Seele des befreundeten Ziels. Wenn das Ziel stirbt, während seine Seele gespeichert ist, kann es sich mit 400 Gesundheit und 700 Mana wiederbeleben."},
