[20709] = {name = "Arkanitdietrich", additional_info = "5 Meter Reichweite\nWirken in 5 sek.\n[q]Ermöglicht das Öffnen von kniffligen Schlössern. Dieser Vorgang verzehrt den Dietrich."},
[20710] = {name = "Innerer Mut 20", additional_info = "[q]Chance von +10%, Furchtzaubern und Furchteffekten zu widerstehen."},
[20711] = {name = "Geist der Erlösung", additional_info = "[q]Beim Tod verwandelt sich der Priester 10 sec lang in einen Geist der Erlösung. Der Geist kann sich weder bewegen oder angreifen, noch kann er das Ziel von Zaubern oder Effekten sein. In dieser Gestalt kann der Priester jeglichen Heilzauber ohne irgendwelche Kosten wirken. Nach Ablauf der Verwandlung stirbt der Priester."},
