[21082] = {name = "Siegel des Kreuzfahrers", additional_info = "25 Mana\nSofort\n[q]Erfüllt den Paladin 30 sec lang mit dem Geist eines Kreuzfahrers und verleiht 36 Nahkampfangriffskraft. Außerdem greift der Paladin um 40% schneller an, verursacht jedoch bei jedem Angriff weniger Schaden. Es kann immer nur jeweils ein Siegel auf dem Paladin aktiv sein.\n\n Die Entfesselung der Energie dieses Siegels richtet einen Feind 10 sec lang und erhöht den erlittenen Heiligschaden um bis zu 20. Eure Nahkampfangriffe frischen die Dauer dieses Siegels auf. Es kann immer nur jeweils ein Richturteil pro Paladin aktiv sein."},
