[21161] = {name = "[q4]Sulfuronhammer", additional_info = "Wirken in 1 min\nTools: Schmiedehammer\nReagenzien:\nSulfuronblock (8), Dunkeleisenbarren (20), Arkanitbarren (50), Essenz des Feuers (25), Blut des Berges (10), Lavakern (10), Feuerkern (10)\n[q4]Sulfuronhammer\nWird beim Anlegen gebunden\nZweihändig Streitkolben\n176 - 295 Schaden Tempo 3.70\n(63.65 Schaden pro Sekunde)\nHaltbarkeit 120 / 120\n60\n[q2]Trefferchance: Schleudert eine glühende Kugel hinaus, die 83 to 101 Punkt(e) Feuerschaden sowie zusätzlich 8 sec lang 16 Punkt(e) Schaden verursacht."},
