[24670] = {name = "Inferno", additional_info = "{350 Mana} {100 Meter Reichweite}\nWirken in 3 sek.\nReagenzien:\nHöllenstein\n[q]Beschwört einen Meteor aus dem Wirbelnden Nether, der 200 Punkt(e) Feuerschaden verursacht und alle feindlichen Ziele in dem Gebiet 2 sec lang betäubt. Aus dem Krater erhebt sich eine Höllenbestie, die 5 min lang unter dem Befehl des Zaubernden steht. Sobald die Kontrolle verloren ist, muss die Höllenbestie unterworfen werden, um sie unter Kontrolle zu halten. Kann nur draußen verwendet werden."},
