[24858] = {name = "Moonkingestalt", additional_info = "35% von Grundmana\nSofort\n[q]Verwandelt den Druiden in die Mondkingestalt. In dieser Gestalt wird der durch Gegenstände erzielte Rüstungswert um 360% erhöht\n\nS03 - Tuning and Overrides Passive - Druide\nkostet 'Mondfeuer' 50% weniger Mana und verursacht 100% mehr regelmäßigen Schaden, können Eure regelmäßigen Schadenszauber kritischen regelmäßigen Schaden verursachen und wird Euer Zauberschaden um ( 60 * 2) erhöht\n\n Außerdem wird die kritische Zaubertrefferchance aller Gruppenmitglieder im Umkreis von 30 Metern um 3% erhöht.\n\nS03 - Tuning and Overrides Passive - Druide\nIn Mondkingestalt kann der Druide keine Heilzauber wirken\n\n In Mondkingestalt kann der Druide nur Gleichgewichtszauber wirken. Verringert in dieser Gestalt die erzeugte Bedrohung aller Arkan- und Naturzauber um 0%\n\n\n\n Der Akt des Gestaltwandelns befreit den Zaubernden von Verwandlungs- und bewegungseinschränkenden Effekten."},
