[25288] = {name = "Rache", additional_info = "{5 Wut} {Nahkampfreichweite}\n{Spontanzauber} {5 sek. Abklingzeit}\nBenötigt Nahkampfwaffe\nBenötigt Verteidigungshaltung\n[q]Führt einen sofortigen Gegenangriff gegen den Feind aus, der 81 to 99 Punkt(e) Schaden verursacht und dabei ein hohes Maß an Bedrohung generiert. 'Rache' muss auf Blocken, Ausweichen oder Parieren folgen."},
[25289] = {name = "Schlachtruf", additional_info = "10 Wut\nSpontanzauber\n[q]Der Krieger schreit, wodurch sich die Nahkampfangriffskraft der Gruppe innerhalb eines Radius von 20 Metern um 232 erhöht. Hält 2 min lang an."},
[25290] = {name = "Segen der Weisheit", additional_info = "{125 Mana} {30 Meter Reichweite}\nSofort\n[q]Belegt ein befreundetes Ziel mit einem Segen und stellt 5 min lang alle 5 Sek. 33 Punkt(e) Mana wieder her. Spieler können pro Paladin immer nur mit einem einzigen Segen belegt sein."},
[25291] = {name = "Segen der Macht", additional_info = "{130 Mana} {30 Meter Reichweite}\nSofort\n[q]Belegt ein befreundetes Ziel mit einem Segen und erhöht 5 min lang die Nahkampfangriffskraft um 185. Spieler können pro Paladin immer nur mit einem einzigen Segen belegt sein."},
