[25296] = {name = "Aspekt des Falken", additional_info = "120 Mana\nSofort\n[q]Der Jäger nimmt die Aspekte eines Falken an: Die Distanzangriffskraft wird um 120 erhöht. Es kann immer nur jeweils ein Aspekt aktiv sein."},
