[25300] = {name = "Meucheln", additional_info = "{60 Energie} {Nahkampfreichweite}\nSofort\n[q]Das Ziel meucheln und ihm 150% Waffenschaden plus 225 zufügen. Muss hinter dem Ziel sein. In der Waffenhand muss sich ein Dolch befinden. Gewährt 1 Combopunkt."},
