[27585] = {name = "[q3]Schwerer Obsidiangürtel", additional_info = "Wirken in 1 min\nTools: Schmiedehammer\nReagenzien:\nKleiner Obsidiansplitter (14), Verzauberter Thoriumbarren (4), Essenz der Erde (2)\n[q3]Schwerer Obsidiangürtel\nWird beim Anlegen gebunden\nTaille Platte\n397 Rüstung\n+25 Stärke\nHaltbarkeit 45 / 45\n60\n[q2]Anlegen: +5 zu allen Widerstandsarten."},
[27586] = {name = "[q4]Gezackter Obsidianschild", additional_info = "Wirken in 1 min\nTools: Schmiedehammer\nReagenzien:\nGroßer Obsidiansplitter (8), Kleiner Obsidiansplitter (24), Verzauberter Thoriumbarren (8), Essenz der Erde (4)\n[q4]Gezackter Obsidianschild\nWird beim Anlegen gebunden\nSchildhand Schild\n2645 Rüstung\n48 Blocken\nHaltbarkeit 120 / 120\n60\n[q2]Anlegen: Erhöht Eure Chance, Angriffe mit einem Schild zu blocken, um 2%.\n[q2]Anlegen: +5 zu allen Widerstandsarten.\n[q2]Anlegen: Bei einem Treffer durch einen gegnerischen Zauber besteht eine Chance von 5%, dass der Angreifer 3 sec lang zum Schweigen gebracht wird. (Procchance: 5%, 20s Abklingzeit)"},
[27587] = {name = "[q4]Dicke Obsidianbrustplatte", additional_info = "Wirken in 1 min\nTools: Schmiedehammer\nReagenzien:\nGroßer Obsidiansplitter (18), Kleiner Obsidiansplitter (40), Verzauberter Thoriumbarren (12), Essenz der Erde (10), Gewaltiger Smaragd (4)\n[q4]Dicke Obsidianbrustplatte\nWird beim Anlegen gebunden\nBrust Platte\n814 Rüstung\n+38 Stärke\n+16 Ausdauer\nHaltbarkeit 165 / 165\n60\n[q2]Anlegen: Bei einem Treffer durch einen Schadenszauber (mit Ausnahme von Zaubern mit regelmäßigem Schaden) besteht eine Chance von 30%, 6 sec lang einen Zauberschild zu aktivieren der 300 to 500 Schaden der entsprechenden Schadenskategorie absorbiert. (Procchance: 30%, 10s Abklingzeit)"},
[27588] = {name = "[q3]Leichter Obsidiangürtel", additional_info = "Wirken in 1 min\nTools: Schmiedehammer\nReagenzien:\nKleiner Obsidiansplitter (14), Verzaubertes Leder (4)\n[q3]Leichter Obsidiangürtel\nWird beim Anlegen gebunden\nTaille Kette\n224 Rüstung\nHaltbarkeit 40 / 40\n60\n[q2]Anlegen: +32 Angriffskraft.\n[q2]Anlegen: Erhöht Eure Chance, einen kritischen Treffer zu erzielen, um 1%.\n[q2]Anlegen: +5 zu allen Widerstandsarten."},
[27589] = {name = "[q4]Dunkler Griff des Zerstörers", additional_info = "Wirken in 1 min\nTools: Schmiedehammer\nReagenzien:\nGroßer Obsidiansplitter (8), Kleiner Obsidiansplitter (24), Verzaubertes Leder (8), Fläschchen mit oberster Macht\n[q4]Dunkler Griff des Zerstörers\nWird beim Anlegen gebunden\nHände Kette\n279 Rüstung\nHaltbarkeit 50 / 50\n60\n[q2]Anlegen: +28 Angriffskraft.\n[q2]Anlegen: Erhöht Eure Chance, einen kritischen Treffer zu erzielen, um 1%.\n[q2]Anlegen: Bei einem erfolgreichen Nahkampf- oder Distanzangriff erhaltet Ihr 8 Mana, während dem Ziel 8 Mana entzogen werden."},
[27590] = {name = "[q4]Obsidianpanzertunika", additional_info = "Wirken in 1 min\nTools: Schmiedehammer\nReagenzien:\nGroßer Obsidiansplitter (15), Kleiner Obsidiansplitter (36), Verzaubertes Leder (12), Wächterstein (10), Azerothianischer Diamant (4)\n[q4]Obsidianpanzertunika\nWird beim Anlegen gebunden\nBrust Kette\n458 Rüstung\nHaltbarkeit 140 / 140\n60\n[q2]Anlegen: +76 Angriffskraft.\n[q2]Anlegen: Erhöht Eure Chance, einen kritischen Treffer zu erzielen, um 1%.\n[q2]Anlegen: Der erlittene Zauberschaden wird um 10 verringert."},
