[27605] = {name = "Schattenwort: Schmerz", additional_info = "{470 Mana} {30 Meter Reichweite}\nSofort\n[q]Ein Wort der Dunkelheit, das 18 sec lang 852 Punkt(e) Schattenschaden zufügt."},
