[27607] = {name = "Machtwort: Schild", additional_info = "{500 Mana} {40 Meter Reichweite}\n{Sofort} {4 sek. Abklingzeit}\n[q]Nutzt die Seelenkraft des Gruppenmitglieds zum Abschirmen und absorbiert dabei 942 Punkt(e) Schaden. Hält 30 sec lang an. Solange der Schild hält, wird das Zauberwirken durch erlittenen Schaden nicht unterbrochen. Nachdem das Ziel einmal abgeschirmt wurde, kann es 15 sec lang nicht wieder abgeschirmt werden."},
