[27609] = {name = "Magiebannung", additional_info = "{18% von Grundmana} {30 Meter Reichweite}\nSofort\n[q]Bannt auf dem Ziel liegende Magie und entfernt 2 schädliche Zauber von einem Freund oder 2 nützliche Zauber von einem Feind."},
