[27619] = {name = "Eisblock", additional_info = "15 Mana\nSofort 5 min Abklingzeit\n[q]Ihr werdet in einen Eisblock eingehüllt, der Euch 10 sec lang vor allen körperlichen Angriffen und Zaubern schützt, allerdings könnt Ihr während dieser Zeit weder angreifen noch Euch bewegen und auch keine Zauber wirken."},
