[27621] = {name = "Totem des Windzorns", additional_info = "250 Mana\nSofort\n[q]Beschwört ein Totem des Windzorns mit 5 Punkt(en) Gesundheit zu Füßen des Zaubernden. Das Totem verzaubert die Waffenhandwaffen aller Gruppenmitglieder mit Wind, wenn sie sich im Umkreis von 20 Metern aufhalten. Bei jedem Treffer besteht eine Chance von 20%, dass der Angreifer 1 zusätzlichen Angriff mit 315 Punkt(en) zusätzlicher Angriffskraft erhält. Hält 1.50 min lang an."},
[27623] = {name = "Totem der Feuernova", additional_info = "640 Mana\n{Sofort} {15 sek. Abklingzeit}\n[q]Beschwört ein Totem der Feuernova mit 5 Punkt(en) Gesundheit, das 5 sec lang anhält. Wenn es nicht innerhalb von 4 Sek. zerstört wird, fügt das Totem Feinden in einem Umkreis von 10 Metern 413 to 459 Punkt(e) Feuerschaden zu."},
