[34074] = {name = "Aspekt der Viper", additional_info = "{Sofort} {1 sek. Abklingzeit}\n[q]Der Jäger nimmt die Aspekte einer Viper an. Jeder Distanz- und Nahkampfangriff regeneriert Mana, der gesamte verursachte Schaden wird jedoch um 50% verringert. Zusätzlich erhaltet Ihr alle 3 Sek. 4% Eures maximalen Manas. Das gewonnene Mana basiert auf dem Angriffstempo Eurer Distanzwaffe. Benötigt eine Distanzwaffe. Es kann immer nur jeweils ein Aspekt aktiv sein."},
[34433] = {name = "Schattengeist", additional_info = "30 Meter Reichweite\nSofort 5 min Abklingzeit\n[q]Erschafft einen schattenhaften Geist, der das Ziel angreift. Angriffe des Schattengeists gewähren dem Zaubernden 0% Mana. Der erlittene Flächenschaden des Schattengeists ist verringert. Hält 15 sec lang an."},
[41637] = {name = "Gebet der Besserung", additional_info = nil},
[42896] = {name = "Arkanschlag", additional_info = "{7% von Grundmana} {30 Meter Reichweite}\nWirken in 2.5 sek.\n[q]Überzieht einen Feind mit Energie und verursacht 1047 to 1215 Arkanschaden. Mit jedem Wirken von 'Arkanschlag' werden der verursachte Schaden aller Arkanzauber um 1047 to 1215% und die Manakosten von 'Arkanschlag' um 0% erhöht. Dieser Effekt ist bis zu 0-mal stapelbar und hält until cancelled lang an oder bis ein Arkanzauber außer 'Arkanschlag' gewirkt wurde."},
[43680] = {name = "Untätig", additional_info = "Sofort\n[q]Eure Teammitglieder haben sich über Eure Faulheit beschwert! Nehmt am PvP-Kampf teil, sonst werdet Ihr als inaktiv markiert und könnt keine Ehre erhalten."},
[43681] = {name = "Inaktiv", additional_info = "Sofort\n[q]Ihr erhaltet keine Ehrenpunkte, bis Ihr in den PvP-Kampf eingreift.\n Ihr werdet vom Schlachtfeld entfernt werden, wenn Ihr weiterhin inaktiv bleibt."},
[48108] = {name = "Kampfeshitze", additional_info = "Sofort\n[q]Jedes Mal, wenn Ihr mit 'Feuerball', 'Feuerschlag', 'Versengen', 'Lebende Bombe' oder 'Frostfeuerblitz' 2 kritische Zaubertreffer in Folge erzielt, besteht eine Chance, dass Euer nächster innerhalb von 10 sec gewirkter 'Pyroschlag' zu einem Spontanzauber wird."},
[53489] = {name = "Die Kunst des Krieges", additional_info = "Sofort\n[q]Erhöht sowohl den kritischen Schaden Eurer Richturteilszauber, als auch den Eurer Zauber 'Kreuzfahrerstoß' und 'Göttlicher Sturm' um 750%. Zudem wird, wenn Eure Nahkampfangriffe kritisch treffen, die Zauberzeit Eures nächsten Wirkens von 'Lichtblitz' oder 'Exorzismus' um 0.75 Sek. verringert."},
[53601] = {name = "Geheiligter Schild", additional_info = "{12% von Grundmana} {40 Meter Reichweite}\nSofort\n[q]Jedes Mal, wenn das Ziel Schaden erleidet, wird es von einem geheiligten Schild umhüllt, der 500 Schaden absorbiert und die Chance des Paladins, mit 'Lichtblitz' einen kritischen Treffer zu erzielen, 6 sec lang um 50% erhöht. Dieser Effekt kann nur einmal alle 6 Sek. auftreten. Hält 30 sec lang an. Es kann immer nur jeweils ein Ziel mit diesem Zauber belegt sein."},
[53672] = {name = "Lichtenergie", additional_info = "Sofort\n[q]Kritische Treffer Eures Zaubers 'Heiliger Schock' verringern die Zauberzeit Eures nächsten Wirkens von 'Lichtblitz' um 0.75 Sek. oder erhöhen die kritische Trefferchance Eures nächsten Wirkens von 'Heiliges Licht' um 10%."},
[58597] = {name = "Geheiligter Schild", additional_info = "Unbegrenzte Reichweite\nSofort\n[q]Jedes Mal, wenn das Ziel Schaden erleidet, wird es von einem geheiligten Schild umhüllt, der 500 Schaden absorbiert und die Chance des Paladins, mit 'Lichtblitz' einen kritischen Treffer zu erzielen, 6 sec lang um 50% erhöht. Dieser Effekt kann nur einmal alle 6 Sekunden auftreten. Hält 6 sec lang an."},
