[398198] = {name = "Sturm der Schwerter", additional_info = "{20 Energie} {100 Meter Reichweite}\nSofort\n[q]Finishing-Move, der Eure Parierchance erhöht. Combopunkte erhöhen die Dauer und die Parierchance:\n 1 Punkt: 10 Sek., 12% Parierchance\n 2 Punkte: 15 Sek., 14% Parierchance\n 3 Punkte: 20 Sek., 16% Parierchance\n 4 Punkte: 25 Sek., 18% Parierchance\n 5 Punkte: 30 Sek., 20% Parierchance"},
[398199] = {name = "Hochmuttunika", additional_info = nil},
[398538] = {name = "Armschiene mit Rune prägen - Schwache Abwehr", additional_info = "Wirken in 5 sek.\nBenötigt Armschienen\nTools: Runenverzierte Kupferrute\nReagenzien:\nGeringe Magieessenz , Seltsamer Staub\n[q]Armschienen dauerhaft verzaubern, sodass die Verteidigungsfertigkeit des Trägers um 1 erhöht wird."},
[398603] = {name = "Runenschnitzen", additional_info = "Sofort\n[q]Ergänzt Eure Ausrüstung um mächtige Runen."},
[398604] = {name = "Runenschnitzen", additional_info = nil},
[399954] = {name = "Brustrunenfähigkeit", additional_info = "Sofort\n[q]Legt einen Gegenstand mit eingeprägter Rune für den Brustplatz an, um eine Fähigkeit in diesem Ausrüstungsplatz zu aktivieren."},
[399956] = {name = "Verstümmeln", additional_info = "{40 Energie} {Nahkampfreichweite}\nSofort"},
[399960] = {name = "Verstümmeln", additional_info = "Nahkampfreichweite\nSofort\n[q]Greift sofort mit beiden Waffen an, verursacht 100% Waffenschaden sowie mit jeder Waffe zusätzlich [100 / 100 * (5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60)] Schaden. Der Schaden gegen vergiftete Ziele ist um 20% erhöht. Gewährt 2 Combopunkte."},
[399961] = {name = "Verstümmeln", additional_info = "Nahkampfreichweite\nSofort\n[q]Greift sofort mit beiden Waffen an, verursacht 100% Waffenschaden sowie mit jeder Waffe zusätzlich [100 / 100 * (5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60)] Schaden. Der Schaden gegen vergiftete Ziele ist um 20% erhöht. Gewährt 2 Combopunkte."},
[399962] = {name = "Verstümmeln", additional_info = nil},
[399963] = {name = "Vergiften", additional_info = "{35 Energie} {Nahkampfreichweite}\nSofort\nBenötigt Nahkampfwaffe\n[q]Finishing-Move, der sofort Giftschaden abhängig von den Dosen 'Tödliches Gift' auf dem Ziel verursacht. Nach einem Angriff mit 'Vergiften' ist die Frequenz, mit der das Ziel mit 'Sofort wirkendes Gift' belegt werden kann, für 1 Sek. plus je 1 weitere Sekunde pro Combopunkt um 75% erhöht. Pro Combopunkt wird eine Dosis aktiviert:\n 1 Dosis: [((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 80 / 100) * 1 + Attack power * 0.072] Schaden\n 2 Dosen: [((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 80 / 100) * 2 + Attack power * 0.144] Schaden\n 3 Dosen: [((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 80 / 100) * 3 + Attack power * 0.216] Schaden\n 4 Dosen: [((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 80 / 100) * 4 + Attack power * 0.288] Schaden\n 5 Dosen: [((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 80 / 100) * 5 + Attack power * 0.36] Schaden"},
[399965] = {name = "Tödliche Mischung", additional_info = "[q]Gewährt Euren Giften mehrere Verbesserungen:\n\n Wenn Ihr das Ziel mit irgendeinem anderen Gift vergiftet, belegt Ihr es auch mit tödlichem Gift.\n\n Wenn Eure Waffe mit keinem Gift überzogen ist, besteht eine Chance, dass sie sofort wirkendes Gift anwendet, als wäre sie mit sofort wirkendem Gift überzogen.\n\n Der Schaden des tödlichen Gifts und des sofort wirkenden Gifts wird nun durch Eure Angriffskraft erhöht.\n\n Euer 'Tödliches Gift' kann jetzt gegen Ziele wirken, die bereits vom 'Tödlichen Gift' eines anderen Schurken betroffen sind."},
[399966] = {name = "Beinrunenfähigkeit", additional_info = "Sofort\n[q]Legt einen Gegenstand mit eingeprägter Rune für den Beinplatz an, um eine Fähigkeit in diesem Ausrüstungsplatz zu aktivieren."},
[399967] = {name = "Handrunenfähigkeit", additional_info = "Sofort\n[q]Legt einen Gegenstand mit eingeprägter Rune für den Handplatz an, um eine Fähigkeit in diesem Ausrüstungsplatz zu aktivieren."},
[399968] = {name = "Vergiften", additional_info = "[q]Erhaltet die Fähigkeit 'Vergiften':\n\n\n Finishing-Move, der sofort Giftschaden abhängig von den Dosen 'Tödliches Gift' auf dem Ziel verursacht. Nach einem Angriff mit 'Vergiften' ist die Frequenz, mit der das Ziel mit 'Sofort wirkendes Gift' belegt werden kann, für 1 Sek. plus je 1 weitere Sekunde pro Combopunkt um 75% erhöht. Pro Combopunkt wird eine Dosis aktiviert:\n 1 Dosis: [((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 80 / 100) * 1 + Attack power * 0.072] Schaden\n 2 Dosen: [((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 80 / 100) * 2 + Attack power * 0.144] Schaden\n 3 Dosen: [((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 80 / 100) * 3 + Attack power * 0.216] Schaden\n 4 Dosen: [((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 80 / 100) * 4 + Attack power * 0.288] Schaden\n 5 Dosen: [((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 80 / 100) * 5 + Attack power * 0.36] Schaden"},
[399969] = {name = "Tödliche Mischung", additional_info = "[q]Erhaltet die Fähigkeit 'Tödliche Mischung':\n\n\nGewährt Euren Giften mehrere Verbesserungen:\n\n Wenn Ihr das Ziel mit irgendeinem anderen Gift vergiftet, belegt Ihr es auch mit tödlichem Gift.\n\n Wenn Eure Waffe mit keinem Gift überzogen ist, besteht eine Chance, dass sie sofort wirkendes Gift anwendet, als wäre sie mit sofort wirkendem Gift überzogen.\n\n Der Schaden des tödlichen Gifts und des sofort wirkenden Gifts wird nun durch Eure Angriffskraft erhöht.\n\n Euer 'Tödliches Gift' kann jetzt gegen Ziele wirken, die bereits vom 'Tödlichen Gift' eines anderen Schurken betroffen sind."},
[399985] = {name = "Schattenschlag", additional_info = "{20 Energie} {25 Meter Reichweite}\nSofort\nBenötigt Nahkampfwaffe\nBenötigt Verstohlenheit\n[q]Teleportiert Euch hinter Euer Ziel und schlägt zu, um ihm 150% Waffenschaden zuzufügen. Muss im Verstohlenheitsmodus sein. Gewährt 1 Combopunkt."},
[399986] = {name = "Shurikenwurf", additional_info = "{30 Energie} {25 Meter Reichweite}\n{Sofort} {20 sek. Abklingzeit}\n[q]Wirft einen Shuriken auf Euren Gegner, der Schaden in Höhe von 50% Eurer Angriffskraft verursacht und bis zu 4 weitere Gegner in der Nähe trifft. Gewährt 1 Combopunkt pro getroffenem Ziel."},
[400009] = {name = "Zwischen die Augen", additional_info = "{35 Energie} {20 Meter Reichweite}\n20 sek. Abklingzeit\nBenötigt Distanzwaffe\n[q]Finishing-Move für den Distanzkampf, der durch Angriffskraft erhöhten Schaden pro Combopunkt verursacht und das Ziel betäubt:\n\n 1 Punkt: [53 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60))] bis [81 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60))] Schaden, 1 Sek. Betäubung\n 2 Punkte: [53 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60) * 2)] bis [81 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60) * 2)] Schaden, 2 Sek. Betäubung\n 3 Punkte: [53 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60) * 3)] bis [81 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60) * 3)] Schaden, 3 Sek. Betäubung\n 4 Punkte: [53 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60) * 4)] bis [81 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60) * 4)] Schaden, 4 Sek. Betäubung\n 5 Punkte: [53 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60) * 5)] bis [81 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60) * 5)] Schaden, 5 Sek. Betäubung\n\n Teilt sich die Abklingzeit mit 'Nierenhieb'."},
[400012] = {name = "Klingentanz", additional_info = "{25 Energie} {100 Meter Reichweite}\nSofort\n[q]Finishing-Move, der Eure Parierchance um 10% erhöht und Euch 4 Angriffskraft pro Punkt Eurer Verteidigungsfähigkeit über ( 60 * 5) hinaus gewährt. Hält pro Combopunkt länger an:\n\n 1 Punkt: 14 Sek.\n 2 Punkte: 18 Sek.\n 3 Punkte: 22 Sek.\n 4 Punkte: 26 Sek.\n 5 Punkte: 30 Sek."},
[400014] = {name = "Nur eine Fleischwunde", additional_info = "[q]You take 20% reduced Physical damage while Blade Dance is active. Additionally, you have 6% reduced chance to be critically hit by melee attacks, you deal 20% less damage, the threat generated by all your actions is massively increased, and your Feint ability is replaced with Tease, which Taunts the target to attack you.\n\n\nVerspottet das Ziel, damit es Euch angreift. Hat keinen Effekt, wenn Ihr von dem Ziel bereits angegriffen werdet."},
[400015] = {name = "Schläge abschwächen", additional_info = nil},
[400016] = {name = "Schläge abschwächen", additional_info = "[q]Jedes Mal, wenn Ihr ausweicht oder pariert, erhaltet Ihr 6% mehr Gesundheit. Bis zu 5-mal stapelbar."},
[400024] = {name = "Von der Schippe springen", additional_info = "Sofort\n[q]Ein Angriff, der Euch töten würde, verringert Eure Gesundheit lediglich auf 10% Eurer maximalen Gesundheit. Außerdem wird sämtlicher erlittener Schaden 3 sec lang um bis zu 90% verringert. Dieser Effekt kann nicht öfter als einmal pro Minute auftreten."},
[400029] = {name = "Schattenschritt", additional_info = "25 Meter Reichweite\n{Sofort} {30 sek. Abklingzeit}\n[q]Versucht, in die Schatten zu tauchen, um hinter dem Gegner zu erscheinen. Erhöht 3 sec lang die Bewegungsgeschwindigkeit um 70%."},
[400031] = {name = "Schattenschlag", additional_info = "[q]Erhaltet die Fähigkeit 'Schattenschlag':\n\n\nTeleportiert Euch hinter Euer Ziel und schlägt zu, um ihm 150% Waffenschaden zuzufügen. Muss im Verstohlenheitsmodus sein. Gewährt 1 Combopunkt."},
