[400105] = {name = "Handschuhe prägen - Schattenschlag", additional_info = "Wirken in 3 sek.\nBenötigt Handschuhe\n[q]Prägt Eure Handschuhe mit der Rune 'Schattenschlag':\n\n\nTeleportiert Euch hinter Euer Ziel und schlägt zu, um ihm 150% Waffenschaden zuzufügen. Muss im Verstohlenheitsmodus sein. Gewährt 1 Combopunkt."},
[400573] = {name = "Arkanschlag", additional_info = "Sofort 3 min Abklingzeit\n[q]Überzieht einen Gegner mit Energie und verursacht Arkanschaden. Mit jedem Wirken von 'Arkanschlag' werden der verursachte Schaden und die hervorgerufene Heilung aller anderen Arkanzauber um 15% und die Manakosten von 'Arkanschlag' um 175% erhöht. Dieser Effekt ist bis zu 4-mal stapelbar und hält 6 sec lang an."},
