[401752] = {name = "Stiefel prägen - Hirnfrost", additional_info = "Wirken in 3 sek.\nBenötigt Stiefel\n[q]Prägt Eure Stiefel mit der Rune 'Hirnfrost':\n\n\nEure Frostzauber mit Kälteeffekten haben eine Chance von 20%, Euren nächsten Einsatz von 'Feuerball', 'Zauberfrostblitz', 'Qualfeuerblitz' oder 'Frostfeuerblitz' zu einem Spontanzauber werden zu lassen, der kein Mana kostet."},
[401754] = {name = "Helm prägen - Fortgeschrittener Schutzzauber", additional_info = "Wirken in 3 sek.\nBenötigt Helme\n[q]Prägt Euren Helm mit der Rune 'Fortgeschrittener Schutzzauber':\n\n\nEure Zauber 'Manaschild', 'Frostzauberschutz' und 'Feuerzauberschutz' können jetzt auf verbündete Ziele gewirkt werden und absorbieren 100% mehr Schaden. 'Manaschild' verbraucht 50% weniger Mana pro absorbiertem Schaden. Außerdem wird 'Geringen Fluch aufheben' durch 'Großen Fluch aufheben' ersetzt.\n\n\nEntfernt 1 Fluch und 1 schädlichen Magieeffekt von einem verbündeten Ziel."},
[401757] = {name = "Handschuhe prägen - Arkanschlag", additional_info = "Wirken in 3 sek.\nBenötigt Handschuhe\n[q]Prägt Eure Handschuhe mit der Rune 'Arkanschlag':\n\n\nÜberzieht das Ziel mit Energie und verursacht [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 453 / 100] bis [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 527 / 100] Arkanschaden. Mit jedem Wirken von 'Arkanschlag' werden der verursachte Schaden und die hervorgerufene Heilung aller anderen Arkanzauber um 15% und die Manakosten von 'Arkanschlag' um 175% erhöht. Dieser Effekt ist bis zu 4-mal stapelbar und hält 6 sec lang an oder bis ein anderer Arkanschadens- oder -heilzauber gewirkt wird."},
[401759] = {name = "Brustteil prägen - Feuerfontäne", additional_info = "Wirken in 3 sek.\nBenötigt Brust, Brust\n[q]Prägt Euer Brustteil mit der Rune 'Feuerfontäne':\n\n\nErhöht die kritische Trefferchance aller Eurer Zauber um 15%, aber die kritischen Treffer Eurer Zauber ohne regelmäßige Effekte kosten zusätzlich 1% eures Grundmanas."},
[401760] = {name = "Handschuhe prägen - Eislanze", additional_info = "Wirken in 3 sek.\nBenötigt Handschuhe\n[q]Prägt Eure Handschuhe mit der Rune 'Eislanze':\n\n\nFügt einem feindlichen Ziel [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 55 / 100 * ( 1 ) ] bis [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 65 / 100 * ( 1 ) ] Frostschaden zu. Verursacht dreifachen Schaden gegen gefrorene Ziele."},
[401761] = {name = "Armschienen prägen - Zeit zurückdrehen", additional_info = "Wirken in 3 sek.\nBenötigt Armschienen\n[q]Prägt Eure Armschienen mit der Rune 'Zeit zurückdrehen':\n\n\nEuer aktuelles mit Eurem 'Zeitenleuchtfeuer' belegtes Ziel wird sofort um sämtlichen Schaden geheilt, den es in den letzten 5 Sek. erlitten hat. Wirkungslos bei Zielen, die vor 5 Sek. nicht mit 'Zeitenleuchtfeuer' belegt waren."},
[401762] = {name = "Gürtel prägen - Frostfeuerblitz", additional_info = "Wirken in 3 sek.\nBenötigt Gürtel\n[q]Prägt Euren Gürtel mit der Rune 'Frostfeuerblitz':\n\n\nSchleudert einen Frostfeuerblitz auf den Gegner, der [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 325 / 100 * ( 1 ) ] bis [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 379 / 100 * ( 1 ) ] Frostfeuerschaden verursacht, seine Bewegungsgeschwindigkeit um 40% verringert sowie ihm zusätzlich im Verlauf von 9 sec [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 12 / 100 * 3 * ( 1 ) ] Frostfeuerschaden zufügt. Der Schaden dieses Zaubers wird gegen den jeweils geringeren Frost- oder Feuerwiderstandswert des Ziels gerechnet und zählt sowohl als Frost- als auch als Feuerschaden."},
[401763] = {name = "Gürtel prägen - Geschosssalve", additional_info = "Wirken in 3 sek.\nBenötigt Gürtel\n[q]Prägt Euren Gürtel mit der Rune 'Geschosssalve':\n\n\nVerleiht Eurem Zauber 'Arkanschlag' eine Chance von 40% sowie Euren Zaubern 'Feuerball' und 'Frostblitz' eine Chance von 20%, die Kanalisierungsdauer Eures nächsten Einsatzes von 'Arkane Geschosse' um 50% zu verringern, die Manakosten um 100% zu verringern und alle 0,5 Sek. Geschosse abzufeuern."},
[401764] = {name = "Umhang prägen - Überhitzen", additional_info = "Wirken in 3 sek.\nBenötigt Umhang\n[q]Prägt Euren Umhang mit der Rune 'Überhitzen':\n\n\n'Feuerschlag' trifft immer kritisch, kann gewirkt werden, während Ihr einen anderen Zauber wirkt, und ist nicht von der globalen Abklingzeit betroffen. Die Abklingzeit ist jedoch um 15 Sek. erhöht."},
[401765] = {name = "Brustteil prägen - Eisige Finger", additional_info = "Wirken in 3 sek.\nBenötigt Brust, Brust\n[q]Prägt Euer Brustteil oder Eure Robe mit der Rune 'Eisige Finger':\n\n\nVerleiht Euren Kälteeffekten eine Chance von 15%, den Effekt 'Eisige Finger' hervorzurufen. Die eisigen Finger bewirken, dass Eure nächsten 2 gewirkten Zauber einen Effekt haben, den sie auf ein gefrorenes Ziel hätten. Hält 15 sec lang an."},
[401767] = {name = "Brustteil prägen - Regeneration", additional_info = "Wirken in 3 sek.\nBenötigt Brust, Brust\n[q]Prägt Euer Brustteil oder Eure Robe mit der Rune 'Regeneration':\n\n\nHeilt das Ziel im Verlauf von 3 sec um [(38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) * 42 / 100 * 3] Gesundheit und belegt es für 30 Sek. mit 'Zeitenleuchtfeuer'.\n\n Zeitenleuchtfeuer\n\nErfasst die raumzeitliche Position des Subjekts. 80% sämtlichen Arkanschadens, den der Zaubernde verursacht hat, werden für alle aktuellen Ziele von 'Zeitenleuchtfeuer' des Zaubernden in chronomantische Heilung umgewandelt. Diese Heilung ist für den Zaubernden selbst um 50% verringert und wird zudem um 80% verringert, wenn durch arkane Zauber, die mehrere Ziele gleichzeitig treffen, Schaden verursacht wird."},
[401768] = {name = "Hosen prägen - Lebende Flamme", additional_info = "Wirken in 3 sek.\nBenötigt Hosen\n[q]Prägt Eure Hosen mit der Rune 'Lebende Flamme':\n\n\nBeschwört eine Zauberfeuerflamme, die sich auf das Ziel zubewegt und einen Pfad aus Zauberfeuer hinterlässt. Dieser Pfad fügt Gegnern in der Nähe pro Sekunde [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 100 / 100] Zauberfeuerschaden zu. Hält 10 sec lang an."},
