[401847] = {name = "Kartenstücke kombinieren", additional_info = "Wirken in 3 sek.\nReagenzien:\nRechtes oberes Kartenteil , Linkes oberes Kartenteil , Rechtes unteres Kartenteil , Linkes unteres Kartenteil\n[q]Kombiniert ein Stück mit 3 anderen, um die vollständige Karte zu erhalten."},
[401859] = {name = "Gebet der Besserung", additional_info = "{15% von Grundmana} {40 Meter Reichweite}\n{Sofort} {10 sek. Abklingzeit}\n[q]Belegt das Ziel mit einem Zauber, der es um [(38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) * 74 / 100] Gesundheit heilt, wenn es das nächste Mal Schaden erleidet oder geheilt wird. Wird die Heilung ausgelöst, springt 'Gebet der Besserung' zu einem Gruppen- oder Schlachtzugsmitglied innerhalb von 20 Metern über. Springt bis zu 5-mal und hält nach jedem Sprung 30 sec lang an. Dieser Zauber kann nur auf einem Ziel gleichzeitig platziert werden."},
