[402792] = {name = "Fluch der Elemente", additional_info = "{20% von Grundmana} {35 Meter Reichweite}\nSofort\n[q]Verflucht das Ziel und verringert 3 min lang seinen Feuer- und Frostwiderstand um 75. Erhöht außerdem den erlittenen Feuer- und Frostschaden um 10%. Es kann immer nur jeweils ein Fluch pro Hexenmeister auf einem beliebigen Ziel aktiv sein."},
[402794] = {name = "Fluch der Sprachen", additional_info = "{20% von Grundmana} {35 Meter Reichweite}\nSofort\n[q]Zwingt das Ziel, Dämonisch zu sprechen, und erhöht die Zauberzeit um 60%. Es kann immer nur jeweils ein Fluch pro Hexenmeister auf einem Ziel aktiv sein. Hält 3 min lang an."},
