[402838] = {name = "Geteilter Schmerz", additional_info = "[q]Erhaltet die Fähigkeit 'Geteilter Schmerz':\n\n\nEuer 'Schattenwort: Schmerz' wirkt jetzt zusätzlich auf bis zu 2 zusätzliche Ziele im Umkreis von 15 Metern."},
[402839] = {name = "Schmerzunterdrückung", additional_info = "[q]Erhaltet die Fähigkeit 'Schmerzunterdrückung':\n\n\nVerringert sofort sämtlichen Schaden, den ein verbündetes Ziel erleidet, um 40% und erhöht den Widerstand gegen Bannzauber 8 sec lang um 65%."},
[402841] = {name = "Vampirberührung", additional_info = "[q]Erhaltet die Fähigkeit 'Vampirberührung':\n\n\nBelegt Euer Ziel mit Eurer 'Vampirumarmung'. Fügt dem Ziel im Verlauf von 15 sec [(9.456667 + 0.635108 * 60 + 0.039063 * 60 * 60) * 65 / 100 * 5] Schattenschaden zu und gewährt allen Gruppenmitgliedern Mana in Höhe von 2% des Schattenzauberschadens, den Ihr dem Ziel zufügt."},
[402842] = {name = "Kreis der Heilung", additional_info = "[q]Erhaltet die Fähigkeit 'Kreis der Heilung':\n\n\nHeilt alle Gruppenmitglieder des anvisierten Spielercharakters innerhalb von 43.5 Metern um ihn herum um [(38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) * 130 / 100] bis [(38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) * 144 / 100] Gesundheit."},
[402843] = {name = "Schattengeist", additional_info = "[q]Erhaltet die Fähigkeit 'Schattengeist':\n\n\nErschafft einen schattenhaften Geist, der das Ziel angreift. Der Zaubernde erhält bei einem Angriff des Schattengeists 5% Mana. Hält 15 sec lang an."},
[402844] = {name = "Sühne", additional_info = "[q]Erhaltet die Fähigkeit 'Sühne':\n\n\nSchleudert eine Salve heiligen Lichts auf das Ziel, die einem Gegner [(9.456667 + 0.635108 * 60 + 0.039063 * 60 * 60) * 128 / 100] Heiligschaden zufügt oder ein verbündetes Ziel sofort sowie 2 sec lang alle 1 Sek. um [(38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) * 85 / 100] Gesundheit heilt."},
[402846] = {name = "Auge der Leere", additional_info = "[q]Erhaltet die Fähigkeit 'Auge der Leere':\n\n\nRuft ein Auge der Leere, das 30 sec lang für Euch kämpft. Das Auge kann verschiedene Flüche auf Euer Ziel wirken."},
[402848] = {name = "Hosen prägen - Gebet der Besserung", additional_info = "Wirken in 3 sek.\nBenötigt Hosen\n[q]Prägt Eure Hosen mit der Rune 'Gebet der Besserung':\n\n\nBelegt das Ziel mit einem Zauber, der es um [(38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) * 74 / 100] Gesundheit heilt, wenn es das nächste Mal Schaden erleidet oder geheilt wird. Wird die Heilung ausgelöst, springt 'Gebet der Besserung' zu einem Gruppen- oder Schlachtzugsmitglied innerhalb von 20 Metern über. Springt bis zu 5-mal und hält nach jedem Sprung 30 sec lang an. Dieser Zauber kann nur auf einem Ziel gleichzeitig platziert werden."},
[402849] = {name = "Handschuhe prägen - Schattenwort: Tod", additional_info = "Wirken in 3 sek.\nBenötigt Handschuhe\n[q]Prägt Eure Handschuhe mit der Rune 'Schattenwort: Tod':\n\n\nEin Wort der bindenden Dunkelheit, das dem Ziel [(9.456667 + 0.635108 * 60 + 0.039063 * 60 * 60) * 320 / 100] bis [(9.456667 + 0.635108 * 60 + 0.039063 * 60 * 60) * 372 / 100] Schattenschaden zufügt. Wenn das Ziel durch 'Schattenwort: Tod' nicht stirbt, erleidet der Zaubernde Schaden in Höhe von 50% des Schadens, der dem Ziel zugefügt wurde."},
[402850] = {name = "Umhang prägen - Seelenwehr", additional_info = "Wirken in 3 sek.\nBenötigt Umhang\n[q]Prägt Euren Umhang mit der Rune 'Seelenwehr':\n\n\nEuer 'Machtwort: Schild' hat keine Abklingzeit mehr, kostet 15% weniger Mana, gewährt 15% zusätzlichen Basiswert und erhöht Eure Heilkraft um 50%."},
[402852] = {name = "Hosen prägen - Homunculi", additional_info = "Wirken in 3 sek.\nBenötigt Hosen\n[q]Prägt Eure Hosen mit der Rune 'Homunculi':\n\n\nBricht Splitter aus Eurer Seele, um 3 Miniaturkopien von Euch zum Leben zu erwecken, die versuchen, Euer aktuelles Ziel mit einem Streitkolben, Schwert und einer Axt anzugreifen. Dadurch verringern sie das Angriffstempo, die Angriffskraft bzw. die Rüstung aller getroffenen Ziele."},
[402853] = {name = "Umhang prägen - Verbindende Heilung", additional_info = "Wirken in 3 sek.\nBenötigt Umhang\n[q]Prägt Euren Umhang mit der Rune 'Verbindende Heilung':\n\n\nHeilt ein verbündetes Ziel und den Zaubernden um [(38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) * 161 / 100] bis [(38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) * 197 / 100] Gesundheit. Niedrige Bedrohung. Dieser Zauber profitiert von allen Effekten, die mit 'Blitzheilung' verbunden sind, und löst diese aus."},
[402854] = {name = "Hosen prägen - Geteilter Schmerz", additional_info = "Wirken in 3 sek.\nBenötigt Hosen\n[q]Prägt Eure Hosen mit der Rune 'Geteilter Schmerz':\n\n\nEuer 'Schattenwort: Schmerz' wirkt jetzt zusätzlich auf bis zu 2 zusätzliche Ziele im Umkreis von 15 Metern."},
