[402864] = {name = "Helm prägen - Auge der Leere", additional_info = "Wirken in 3 sek.\nBenötigt Helme\n[q]Prägt Euren Helm mit der Rune 'Auge der Leere':\n\n\nRuft ein Auge der Leere, das 30 sec lang für Euch kämpft. Das Auge kann verschiedene Flüche auf Euer Ziel wirken."},
