[403689] = {name = "Blutsauger", additional_info = "{600 Mana} {20 Meter Reichweite}\n{Sofort} {15 sek. Abklingzeit}\n[q]Überträgt pro Sekunde 71 Gesundheit vom Ziel auf den Zaubernden. Hält 15 sec lang an."},
[403789] = {name = "Metamorphose", additional_info = "100% von Grundmana\nSofort\n[q]Verwandelt Euch in einen Dämon. Eure Rüstung wird um 500% erhöht und die Chance, kritische Treffer zu erleiden, um 6% verringert. Eure Bedrohung wird um 77% erhöht und 'Aderlass' gewährt 100% mehr Mana, doch Euer sämtlicher verursachter Schaden wird um 15% verringert. 'Metamorphose' verändert einige Fähigkeiten und gewährt neue:\n\n 'Sengender Schmerz': Wird zu einem Spontanzauber.\n\n 'Schattenblitz': Wird zu 'Schattenspalten', einem Nahkampfangriff, der bis zu 10 Gegner in der Nähe mit Schattenschaden trifft, aber eine Abklingzeit von 6 Sek. hat.\n\n 'Furcht': Wird durch 'Plagegeist' ersetzt.\n\n\nVerspottet das Ziel, damit es Euch angreift. Hat keinen Effekt, wenn Ihr von dem Ziel bereits angegriffen werdet.\n\n 'Dämonischer Ansturm'\n\n\nStürmt auf einen Gegner zu und betäubt ihn für 1 sec Kann nicht im Kampf verwendet werden.\n\n 'Dämonisches Heulen'\n\n\nZwingt alle Gegner in der Nähe 6 sec lang, ihre Angriffe auf Euch zu konzentrieren."},
[403816] = {name = "Metamorphose", additional_info = "[q]Verwandelt Euch in einen Dämon. Eure Rüstung wird um 500% erhöht, die Chance, kritische Treffer zu erleiden, um 6% verringert, Eure Bedrohung um 77% erhöht. Außerdem erhaltet Ihr 100% mehr Mana durch 'Aderlass', und einige Eurer Fähigkeiten werden verändert:\n\n 'Sengender Schmerz' wird zu einem Spontanzauber.\n\n 'Schattenblitz' wird zu 'Schattenspalten', einem Nahkampfangriff, der bis zu 500 Gegner in der Nähe mit Schattenschaden trifft.\n\n 'Fluch der Tollkühnheit' verspottet nun auch until cancelled lang Euer Ziel, sodass es Euch angreift.\n\n 'Schreckensgeheul' zwingt nun auch alle Gegner in der Nähe until cancelled lang, Euch anzugreifen, aber die Abklingzeit wird auf 10 Min. erhöht."},
[403828] = {name = "Plagegeist", additional_info = "Nahkampfreichweite\n{Sofort} {10 sek. Abklingzeit}\n[q]Verspottet das Ziel, damit es Euch angreift. Hat keinen Effekt, wenn Ihr von dem Ziel bereits angegriffen werdet."},
