[403868] = {name = "Meisterkanalisierer", additional_info = "[q]Erhaltet die Fähigkeit 'Meisterkanalisierer':\n\n\nEuer Zauber 'Blutsauger' wird nicht mehr kanalisiert, hält 15 sec lang an mit einer Abklingzeit von 15 sec, kostet 100% mehr Mana und heilt Euch jedes Mal, wenn er Schaden verursacht, um 50% mehr."},
[403871] = {name = "Schattenblitzsalve", additional_info = "[q]Erhaltet die Fähigkeit 'Schattenblitzsalve':\n\n\nEuer 'Schattenblitz' trifft jetzt bis zu 5 Ziele in einer Kette innerhalb von 10 Metern, aber mit um 5% verringertem Schaden."},
[403872] = {name = "See des Feuers", additional_info = "[q]Erhaltet die Fähigkeit 'See des Feuers':\n\n\nEuer 'Feuerregen' wird nicht mehr kanalisiert, aber erhält eine Abklingzeit von 8 Sek."},
[403873] = {name = "Metamorphose", additional_info = "[q]Erhaltet die Fähigkeit 'Metamorphose':\n\n\nVerwandelt Euch in einen Dämon. Eure Rüstung wird um 500% erhöht und die Chance, kritische Treffer zu erleiden, um 6% verringert. Eure Bedrohung wird um 77% erhöht und 'Aderlass' gewährt 100% mehr Mana, doch Euer sämtlicher verursachter Schaden wird um 15% verringert. 'Metamorphose' verändert einige Fähigkeiten und gewährt neue:\n\n 'Sengender Schmerz': Wird zu einem Spontanzauber.\n\n 'Schattenblitz': Wird zu 'Schattenspalten', einem Nahkampfangriff, der bis zu 10 Gegner in der Nähe mit Schattenschaden trifft, aber eine Abklingzeit von 6 Sek. hat.\n\n 'Furcht': Wird durch 'Plagegeist' ersetzt.\n\n\nVerspottet das Ziel, damit es Euch angreift. Hat keinen Effekt, wenn Ihr von dem Ziel bereits angegriffen werdet.\n\n 'Dämonischer Ansturm'\n\n\nStürmt auf einen Gegner zu und betäubt ihn für 1 sec Kann nicht im Kampf verwendet werden.\n\n 'Dämonisches Heulen'\n\n\nZwingt alle Gegner in der Nähe 6 sec lang, ihre Angriffe auf Euch zu konzentrieren."},
[403919] = {name = "Handschuhe prägen - Heimsuchung", additional_info = "Wirken in 3 sek.\nBenötigt Handschuhe\n[q]Prägt Eure Handschuhe mit der Rune 'Heimsuchung':\n\n\nJagt eine geisterhafte Seele auf den Gegner, die [(6.568597 + 0.672028 * 60 + 0.031721 * 60 * 60) * 251 / 100] bis [(6.568597 + 0.672028 * 60 + 0.031721 * 60 * 60) * 295 / 100] Schaden verursacht und sämtlichen regelmäßigen Schattenschaden, den Ihr dem Ziel zufügt, um 20% erhöht. Wenn 'Heimsuchung' endet oder gebannt wird, werdet Ihr in Höhe des Schadens geheilt, die der Zauber dem Ziel zugefügt hat."},
