[403932] = {name = "Kiste prägen - Meisterkanalisierer", additional_info = "Wirken in 3 sek.\nBenötigt Brust, Brust\n[q]Prägt Euer Brustteil oder Eure Robe mit der Rune 'Meisterkanalisierer':\n\n\nEuer Zauber 'Blutsauger' wird nicht mehr kanalisiert, hält 15 sec lang an mit einer Abklingzeit von 15 sec, kostet 100% mehr Mana und heilt Euch jedes Mal, wenn er Schaden verursacht, um 50% mehr."},
[403936] = {name = "Handschuhe prägen - Schattenblitzsalve", additional_info = "Wirken in 3 sek.\nBenötigt Handschuhe\n[q]Prägt Eure Handschuhe mit der Rune 'Schattenblitzsalve':\n\n\nEuer 'Schattenblitz' trifft jetzt bis zu 5 Ziele in einer Kette innerhalb von 10 Metern, aber mit um 5% verringertem Schaden."},
