[407613] = {name = "Flamme des Glaubens", additional_info = "{7% von Grundmana} {40 Meter Reichweite}\nSofort\n[q]Das Ziel wird für alle Gruppen- und Schlachtzugsmitglieder in einem Radius von 40 Metern zu einer Flamme des Glaubens. Alle auf diese Mitglieder gewirkten Heilungen heilen auch die Flamme um 100% der gewirkten Heilung. Es kann immer nur ein Ziel zur gleichen Zeit eine Flamme des Glaubens sein. Hält 1 hour lang an."},
[407614] = {name = "Glaubensflamme", additional_info = "60 Meter Reichweite\nSofort\n[q]Das Ziel wird für alle Ziele in einem Radius von 60 Metern zu einer Flamme des Glaubens. Alle auf diese Ziele gewirkten Heilungen heilen auch die Flamme um 100% der gewirkten Heilung."},
[407615] = {name = "Flamme des Glaubens", additional_info = "40 Meter Reichweite\nSofort\n[q]Das Ziel wird für alle Ziele in einem Radius von 40 Metern zu einer Flamme des Glaubens. Alle auf diese Ziele gewirkten Heilungen heilen auch die Flamme um 1% der gewirkten Heilung. Es kann immer nur ein Ziel zur gleichen Zeit eine Flamme des Glaubens sein. Hält until cancelled lang an."},
[407624] = {name = "Aurenmeisterschaft", additional_info = "Sofort 2 min Abklingzeit\n[q]Verleiht allen durch Eure Fähigkeit 'Aura der Konzentration' gestärkten Zielen Immunität gegen Unterbrechungs- und Stilleeffekte. Die Effekte aller anderen Auren werden um 100% erhöht. Hält 6 sec lang an."},
[407627] = {name = "Zorn der Gerechtigkeit", additional_info = "Sofort\n[q]Erhöht die durch Eure Heiligzauber verursachte Bedrohung um 80%. Wenn Ihr von einem anderen verbündeten Ziel geheilt werdet, erhaltet Ihr Mana in Höhe von 25% der hervorgerufenen Heilung. Zusätzlich wird Schaden, der Eure Gesundheit unter 35% senkt, um 20% verringert. Hält until cancelled lang an."},
[407628] = {name = "Zorn der Gerechtigkeit", additional_info = "Sofort\n[q]Gewinnt Mana durch erhaltene Heilung."},
[407631] = {name = "Hand der Abrechnung", additional_info = "Nahkampfreichweite\n{Sofort} {10 sek. Abklingzeit}\n[q]Verspottet das Ziel, damit es Euch angreift. Hat keinen Effekt, wenn Ihr von dem Ziel bereits angegriffen werdet.\n\n Während Ihr diese Fähigkeit kennt, ist der Bedrohungsbonus von 'Zorn der Gerechtigkeit' auf 80% erhöht. Wenn Ihr von anderen Charakteren geheilt werdet, sorgt 'Zorn der Gerechtigkeit' dafür, dass Ihr Mana in Höhe von 25% der hervorgerufenen Heilung erhaltet. Zusätzlich wird Schaden, der Eure Gesundheit unter 35% senkt, um 20% verringert, während 'Zorn der Gerechtigkeit' aktiv ist. 'Zorn der Gerechtigkeit' bleibt aktiv, bis er abgebrochen wird."},
[407632] = {name = "Hammer der Rechtschaffenen", additional_info = "{6% von Grundmana} {Nahkampfreichweite}\n{Sofort} {6 sek. Abklingzeit}\n[q]Trifft das aktuelle Ziel sowie bis zu 2 zusätzliche Ziele in der Nähe und verursacht pro Sekunde den 3-fachen Schaden Eurer Waffenhandwaffe als Heiligschaden."},
[407653] = {name = "Gabelblitzschlag", additional_info = "30 Meter Reichweite\nSofort\n[q]Trifft einen Gegner mit einem Blitzschlag, der auf einen Gegner in der Nähe überspringt. Der Zauber wirkt sich auf bis zu 0 Ziele aus und fügt jedem Naturschaden zu."},
[407667] = {name = "Gabelblitzschlag", additional_info = "30 Meter Reichweite\nSofort\n[q]Trifft einen Feind mit einem Blitzschlag, der auf alle Ziele in der Nähe überspringt und ihnen Naturschaden zufügt."},
[407669] = {name = "Schild des Rächers", additional_info = "{26% von Grundmana} {30 Meter Reichweite}\n{Sofort} {15 sek. Abklingzeit}\n[q]Schleudert einen heiligen Schild auf den Gegner, der [366 * (9.046514 + 0.676562 * 60 + 0.019349 * 60 * 60) / 100 + 0.091 * Spell power + 0.091 * Attack power] bis [448 * (9.046514 + 0.676562 * 60 + 0.019349 * 60 * 60) / 100 + 0.091 * Spell power + 0.091 * Attack power] Heiligschaden verursacht, ihn benommen macht und dann auf weitere Gegner in der Nähe überspringt. Wirkt auf insgesamt 3 Ziele. Hält 5 sec lang an."},
[407676] = {name = "Kreuzfahrerstoß", additional_info = "Nahkampfreichweite\n{Sofort} {6 sek. Abklingzeit}\nBenötigt Nahkampfwaffe\n[q]Ein sofortiger Stoß, der 75% Waffenschaden als Heiligschaden verursacht und 5% Eures maximalen Manas regeneriert. Die Dauer aller Richturteilseffekte auf dem Ziel wird auf 30 Sek. zurückgesetzt."},
[407720] = {name = "Gabelblitzschlag", additional_info = "30 Meter Reichweite\nSofort\n[q]Trifft einen Gegner mit einem Blitzschlag, der auf einen Gegner in der Nähe überspringt. Der Zauber wirkt sich auf bis zu 0 Ziele aus und fügt jedem Naturschaden zu."},
