[407800] = {name = "Siegel des Märtyrertums", additional_info = "Sofort\n[q]Der Schaden von 'Siegel des Märtyrertums' fügt auch dem Paladin Schaden zu."},
[407802] = {name = "Siegel des Märtyrertums", additional_info = "40 Meter Reichweite\nSofort\n[q]Gewinnt Mana aus dem Schaden, den der Paladin erleidet."},
[407803] = {name = "Richturteil des Märtyrertums", additional_info = nil},
[407804] = {name = "Heilige Opferung", additional_info = "Sofort 2 min Abklingzeit\n[q]30% jeglichen von Gruppenmitgliedern im Umkreis von 30 Metern erlittenen Schadens werden 10 sec lang auf den Paladin umgelenkt. Schaden, der die Gesundheit des Paladins auf unter 20% senkt, bricht den Effekt ab und erhöht 10 sec lang den Schaden und die Heilung des Paladins um 10%. 'Heilige Opferung' kann unter dem Einfluss von 'Segen des Schutzes', 'Gottesschild' oder 'Göttlicher Schutz' nicht verwendet werden und verhindert, dass Ihr mit diesen Fähigkeiten anvisiert werden könnt, während 'Heilige Opferung' aktiv ist."},
[407805] = {name = "Opferung eingelöst", additional_info = "Sofort 3 min Abklingzeit\n[q]Nach Eurer Opferung sind Euer Schaden und Eure Heilung erhöht."},
[407811] = {name = "Spalten", additional_info = "Nahkampfreichweite\nNächster Nahkampf\n[q]Fügt einem Gegner und seinem nächsten Verbündeten Waffenschaden plus 23 to 27 zu, wirkt auf bis zu 3 Ziele."},
[407812] = {name = "Immunität gegen 'Eiskältepfeil'", additional_info = nil},
[407813] = {name = "Frostpfeil", additional_info = "5 - 30 Meter Reichweite\nWirken in 1 sek.\nBenötigt Distanzwaffe\n[q]Schießt auf den Gegner und verursacht körperlichen Schaden."},
[407819] = {name = "Frostpfeil", additional_info = "50 Meter Reichweite\nWirken in 1.5 sek.\nBenötigt Distanzwaffe\n[q]Schießt auf den Gegner und verursacht körperlichen Schaden."},
[407821] = {name = "Frostpfeil", additional_info = "50 Meter Reichweite\nSofort\nBenötigt Distanzwaffe\n[q]Schießt auf den Gegner und verursacht körperlichen Schaden."},
[407822] = {name = "Frostpfeil", additional_info = nil},
[407880] = {name = "Inspirationsvorbild", additional_info = "2% von Grundmana\nSofort\n[q]Eure inspirierende Präsenz bannt regelmäßig Furcht- und Schlafeffekte von Gruppenmitgliedern in der Nähe."},
[407881] = {name = "Inspirationsvorbild", additional_info = "Sofort\n[q]Eure inspirierende Präsenz bannt regelmäßig Furcht- und Schlafeffekte von Gruppenmitgliedern in der Nähe."},
[407957] = {name = "Zornige Vergeltung", additional_info = nil},
[407973] = {name = "Wilder Stoß", additional_info = "100 Meter Reichweite\nSofort\n[q]Zusatzangriff."},
[407975] = {name = "Wilde Stöße", additional_info = "Sofort\n[q]Gruppenmitglieder im Umkreis von 20 Metern erlangen erhöhte Kampfwildheit. Bei jedem Nahkampftreffer besteht eine Chance von 20%, dem Angreifer einen Zusatzangriff mit 20% höherer Angriffskraft zu gewähren. Kein Effekt, wenn das Gruppenmitglied bereits vom Totem des Windzorns profitiert.\n(Procchance: 20%, 1.5s Abklingzeit)"},
[407977] = {name = "Wilde Stöße", additional_info = "[q]Während Ihr in Katzengestalt, Bärengestalt oder Terrorbärengestalt seid, erlangen Gruppen- oder Schlachtzugsmitglieder im Umkreis von 100 Metern erhöhte Kampfwildheit. Bei jedem Nahkampftreffer besteht eine Chance von 20%, dem Angreifer einen Zusatzangriff mit 20% höherer Angriffskraft zu gewähren. Kein Effekt, wenn das Ziel bereits vom Totem des Windzorns profitiert."},
[407988] = {name = "Wildes Brüllen", additional_info = "{25 Energie} {100 Meter Reichweite}\nSofort\n[q]Finishing-Move, der den verursachten körperlichen Schaden in Katzengestalt um 30% erhöht. Hält pro Combopunkt länger an:\n 1 Punkt: 14 Sek.\n 2 Punkte: 19 Sek.\n 3 Punkte: 24 Sek.\n 4 Punkte: 29 Sek.\n 5 Punkte: 34 Sek."},
[407989] = {name = "Wildes Brüllen", additional_info = "Sofort\nBenötigt Katzengestalt\n[q]Finishing-Move, der den verursachten körperlichen Schaden um 30% erhöht. Hält pro Combopunkt länger an:\n 1 Punkt: 14 Sek.\n 2 Punkte: 19 Sek.\n 3 Punkte: 24 Sek.\n 4 Punkte: 29 Sek.\n 5 Punkte: 34 Sek."},
[407993] = {name = "Zerfleischen", additional_info = "{40 Energie} {Nahkampfreichweite}\nSofort\nBenötigt Katzengestalt\n[q]Zerfleischt das Ziel, fügt ihm 270% des normalen Schadens zu und lässt es 1 min lang 30% zusätzlichen Schaden durch Blutungseffekte und 'Schreddern' erleiden. Gewährt 1 Combopunkt. Diese Fähigkeit profitiert von allen Effekten von 'Klaue' und 'Zermalmen' und löst diese aus."},
[407995] = {name = "Zerfleischen", additional_info = "{15 Wut} {Nahkampfreichweite}\n{Spontanzauber} {6 sek. Abklingzeit}\nBenötigt Bärengestalt, Terrorbärengestalt\n[q]Zerfleischt das Ziel, fügt ihm 160% des normalen Schadens zu und lässt es 1 min lang 30% zusätzlichen Schaden durch Blutungseffekte und 'Schreddern' erleiden. Diese Fähigkeit profitiert von allen Effekten von 'Klaue' und 'Zermalmen' und löst diese aus.\n\n Wenn Ihr ein Ziel mit 'Zerfleischen (Bär)' trefft, erhaltet Ihr zudem 4 Angriffskraft für jeden Punkt Eurer Verteidigungsfertigkeit über ( 60 * 5). Hält 15 sec lang an."},
[408013] = {name = "Blackfathom-Elitenspawner", additional_info = nil},
[408014] = {name = "Blackfathom-Elite erschaffen", additional_info = nil},
[408024] = {name = "Überlebensinstinkte", additional_info = "Sofort 3 min Abklingzeit\n[q]Nach Aktivierung erhaltet Ihr 20 sec lang 30% Eurer maximalen Gesundheit. Während dieser Zeit wird zudem sämtliche von Euch hervorgerufene nichtkörperliche Heilung um 20% erhöht. Nachdem der Effekt abgelaufen ist, geht die Gesundheit verloren. Kann in jeder Gestalt eingesetzt werden.\n\n Zusätzlich regeneriert Ihr bei jedem Ausweichen in Bärengestalt oder Terrorbärengestalt 5 Wut, in Katzengestalt 10 Energie oder in jeder anderen Gestalt 1% Eures maximalen Manas."},
[408025] = {name = "Überlebensinstinkte", additional_info = nil},
[408030] = {name = "Runenschnitzen: Prägen von 'Seelenentzug' erlernen", additional_info = nil},
[408035] = {name = "Damien Kane - Seelen gegen Rune eintauschen", additional_info = nil},
[408120] = {name = "Wildwuchs", additional_info = "{45% von Grundmana} {40 Meter Reichweite}\n{Sofort} {6 sek. Abklingzeit}\n[q]Heilt alle Gruppenmitglieder des anvisierten Spielercharakters innerhalb von 43.5 Metern um ihn herum im Verlauf von 7 sec um [17 / 100 * 7 * (38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60)] Gesundheit. Die Heilung wird zunächst schnell und mit zunehmender Dauer von 'Wildwuchs' langsamer angewendet."},
[408124] = {name = "Blühendes Leben", additional_info = "{14% von Grundmana} {40 Meter Reichweite}\nSofort\n[q]Heilt das Ziel im Verlauf von 7 sec um [4 / 100 * 7 * (38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60)] Gesundheit. Wenn 'Blühendes Leben' endet oder gebannt wird, wird das Ziel sofort um [57 / 100 * (38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60)] Gesundheit geheilt und der Druide erhält die Hälfte der Zauberkosten erstattet. Dieser Effekt ist bis zu 3-mal auf einem Ziel stapelbar."},
[408245] = {name = "Blühendes Leben", additional_info = "40 Meter Reichweite\nSofort\n[q]Heilt das Ziel im Verlauf von 7 Sek. Wenn 'Blühendes Leben' endet oder gebannt wird, wird das Ziel sofort geheilt. Dieser Effekt ist bis zu 3-mal auf einem Ziel stapelbar."},
[408246] = {name = "Blühendes Leben", additional_info = "Sofort\n[q]Gewährt Mana, wenn 'Blühendes Leben' abläuft."},
[408247] = {name = "Pflege", additional_info = "{26% von Grundmana} {40 Meter Reichweite}\nWirken in 2 sek.\n[q]Heilt ein verbündetes Ziel um [161 / 100 * (38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60)] bis [189 / 100 * (38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60)] Gesundheit. Wenn ein durch Euch gewirkter Effekt von 'Verjüngung', 'Nachwachsen', 'Wildwuchs' oder 'Blühendes Leben' auf dem Ziel aktiv ist, erhöht sich die Heilung um zusätzliche 20%. Dieser Zauber profitiert von allen Effekten von 'Heilende Berührung' oder 'Nachwachsen' und löst diese aus."},
[408248] = {name = "Finsternis", additional_info = "[q]'Sternenfeuer' erhöht die Chance auf kritische Treffer bei Euren nächsten beiden Einsätzen von 'Zorn' um 30%, und 'Zorn' verringert die Zauberzeit Eures nächsten Einsatzes von 'Sternenfeuer' um 1.0 Sek. Beide Effekte lassen sich bis zu 4-mal stapeln. Bei beiden Zaubern besteht außerdem jederzeit eine Chance von 70%, dass Ihr keine Zauberzeit verliert, wenn Ihr Schaden erleidet."},
[408250] = {name = "Sonnenfinsternis", additional_info = "Sofort\n[q]Erhöht die Chance auf kritische Treffer mit 'Zorn'."},
[408255] = {name = "Mondfinsternis", additional_info = nil},
[408258] = {name = "Traumzustand", additional_info = "[q]Kritische Treffer Eurer nicht regelmäßigen Schadenszauber und jeglicher Schaden von Eurem 'Sternensog' gewähren Euch 8 sec lang 50% Manaregeneration, während Ihr Zauber wirkt. Der Eurem Ziel zugefügte Arkan- und Naturschaden wird außerdem 12 sec lang um 20% erhöht."},
[408261] = {name = "Traumzustand", additional_info = "Sofort\n[q]Ermöglicht, dass 50% Eurer Manaregeneration während des Zauberwirkens weiterlaufen."},
[408307] = {name = "Zorn der Natur", additional_info = "Sofort 2 min Abklingzeit\n[q]Erhöht Eure Heilkraft 30 sec lang um 90% Eures Naturzauberschadens."},
[408309] = {name = "Anmut der Elune", additional_info = "Sofort 2 min Abklingzeit\n[q]Erhöht Euren Zauberschaden um 55% der Differenz zwischen Eurer Heilkraft und Eurem Zauberschaden. Hält 30 sec lang an."},
[408339] = {name = "Feuernova", additional_info = "[q]Euer Totem der Feuernova wird durch 'Feuernova' ersetzt. Dadurch verursacht Euer derzeitiges Feuertotem Schaden an seinem Standort."},
[408341] = {name = "Feuernova", additional_info = "22% von Grundmana\n{Sofort} {10 sek. Abklingzeit}\nTools: Feuertotem\n[q]Fügt Gegnern im Umkreis von 10 Metern um Euer aktives Feuertotem sofort 53 to 62 Feuerschaden zu."},
[408342] = {name = "Feuernova", additional_info = "22% von Grundmana\n{Sofort} {10 sek. Abklingzeit}\nTools: Feuertotem\n[q]Fügt Gegnern im Umkreis von 10 Metern um Euer aktives Feuertotem sofort 110 to 124 Feuerschaden zu."},
[408343] = {name = "Feuernova", additional_info = "22% von Grundmana\n{Sofort} {10 sek. Abklingzeit}\nTools: Feuertotem\n[q]Fügt Gegnern im Umkreis von 10 Metern um Euer aktives Feuertotem sofort 195 to 219 Feuerschaden zu."},
[408344] = {name = "Feuernova", additional_info = "22% von Grundmana\n{Sofort} {10 sek. Abklingzeit}\nTools: Feuertotem\n[q]Fügt Gegnern im Umkreis von 10 Metern um Euer aktives Feuertotem sofort 295 to 331 Feuerschaden zu."},
[408345] = {name = "Feuernova", additional_info = "22% von Grundmana\n{Sofort} {10 sek. Abklingzeit}\nTools: Feuertotem\n[q]Fügt Gegnern im Umkreis von 10 Metern um Euer aktives Feuertotem sofort 413 to 459 Feuerschaden zu."},
