[408428] = {name = "Feuernova", additional_info = "30 Meter Reichweite\nSofort\nTools: Feuertotem"},
[408438] = {name = "Überladung", additional_info = "[q]Verleiht Euren Zaubern 'Blitzschlag', 'Kettenblitzschlag', 'Kettenheilung', 'Welle der Heilung' und 'Lavaeruption' eine Chance von 50%, kostenlos einen zweiten, ähnlichen Zauber auf das gleiche Ziel auszulösen. Dieser verursacht nur halben Schaden bzw. halbe Heilung und erzeugt keine Bedrohung.\n(Procchance: 50%)"},
[408439] = {name = "Blitzschlag", additional_info = "30 Meter Reichweite\nSofort\n[q]Schleudert einen Blitz auf das Ziel und fügt ihm 7 to 9 Naturschaden zu."},
[408440] = {name = "Blitzschlag", additional_info = "30 Meter Reichweite\nSofort\n[q]Schleudert einen Blitz auf das Ziel und fügt ihm 14 to 17 Naturschaden zu."},
[408441] = {name = "Blitzschlag", additional_info = "30 Meter Reichweite\nSofort\n[q]Schleudert einen Blitz auf das Ziel und fügt ihm 23 to 29 Naturschaden zu."},
[408442] = {name = "Blitzschlag", additional_info = "30 Meter Reichweite\nSofort\n[q]Schleudert einen Blitz auf das Ziel und fügt ihm 43 to 51 Naturschaden zu."},
[408443] = {name = "Blitzschlag", additional_info = "30 Meter Reichweite\nSofort\n[q]Schleudert einen Blitz auf das Ziel und fügt ihm 65 to 75 Naturschaden zu."},
[408472] = {name = "Blitzschlag", additional_info = "30 Meter Reichweite\nSofort\n[q]Schleudert einen Blitz auf das Ziel und fügt ihm 89 to 101 Naturschaden zu."},
[408473] = {name = "Blitzschlag", additional_info = "30 Meter Reichweite\nSofort\n[q]Schleudert einen Blitz auf das Ziel und fügt ihm 117 to 133 Naturschaden zu."},
[408474] = {name = "Blitzschlag", additional_info = "30 Meter Reichweite\nWirken in 3 sek.\n[q]Schleudert einen Blitz auf das Ziel und fügt ihm 145 to 163 Naturschaden zu."},
[408475] = {name = "Blitzschlag", additional_info = "30 Meter Reichweite\nSofort\n[q]Schleudert einen Blitz auf das Ziel und fügt ihm 178 to 201 Naturschaden zu."},
[408477] = {name = "Blitzschlag", additional_info = "30 Meter Reichweite\nSofort\n[q]Schleudert einen Blitz auf das Ziel und fügt ihm 213 to 239 Naturschaden zu."},
[408479] = {name = "Kettenblitzschlag", additional_info = "30 Meter Reichweite\nSofort\n[q]Schleudert einen Blitzschlag auf den Gegner, der 99 to 114 Naturschaden verursacht und auf Gegner in der Nähe überspringt. Jeder Sprung verringert den Schaden um 30%. Wirkt auf insgesamt 3 Ziele."},
[408481] = {name = "Kettenblitzschlag", additional_info = "30 Meter Reichweite\nSofort\n[q]Schleudert einen Blitzschlag auf den Gegner, der 143 to 162 Naturschaden verursacht und auf Gegner in der Nähe überspringt. Jeder Sprung verringert den Schaden um 30%. Wirkt auf insgesamt 3 Ziele."},
[408482] = {name = "Kettenblitzschlag", additional_info = "30 Meter Reichweite\nSofort\n[q]Schleudert einen Blitzschlag auf den Gegner, der 195 to 219 Naturschaden verursacht und auf Gegner in der Nähe überspringt. Jeder Sprung verringert den Schaden um 30%. Wirkt auf insgesamt 3 Ziele."},
[408484] = {name = "Kettenblitzschlag", additional_info = "30 Meter Reichweite\nSofort\n[q]Schleudert einen Blitzschlag auf den Gegner, der 252 to 283 Naturschaden verursacht und auf Gegner in der Nähe überspringt. Jeder Sprung verringert den Schaden um 30%. Wirkt auf insgesamt 3 Ziele."},
[408490] = {name = "Lavaeruption", additional_info = "{10% von Grundmana} {30 Meter Reichweite}\n{Wirken in} {2 sek. 8 sek. Abklingzeit}\n[q]Ihr schleudert flüssige Lava auf das Ziel, die [469 / 100 * (7.583798 + 0.471881 * 60 + 0.036599 * 60 * 60)] bis [605 / 100 * (7.583798 + 0.471881 * 60 + 0.036599 * 60 * 60)] Feuerschaden verursacht. Wenn das Ziel von 'Flammenschock' betroffen ist, wird 'Lavaeruption' einen kritischen Treffer erzielen."},
[408491] = {name = "Lavaeruption", additional_info = "30 Meter Reichweite\nSofort\n[q]Ihr schleudert flüssige Lava auf das Ziel, die [234 / 100 * (7.583798 + 0.471881 * 60 + 0.036599 * 60 * 60)] bis [303 / 100 * (7.583798 + 0.471881 * 60 + 0.036599 * 60 * 60)] Feuerschaden verursacht. Wenn das Ziel von 'Flammenschock' betroffen ist, wird 'Lavaeruption' einen kritischen Treffer erzielen."},
[408496] = {name = "Beidhändigkeitsspezialisierung", additional_info = "[q]Erhöht beim beidhändigen Führen Eure Chance, mit Zaubern und Nahkampfangriffen Treffer zu landen, um 5%. Außerdem trifft Eure Fähigkeit 'Sturmschlag' jetzt mit beiden Waffen, wenn Ihr beidhändig führt, und erhöht den verursachten Schaden Eurer Schildhandwaffe um 50%."},
[408498] = {name = "Waffe des Mahlstroms", additional_info = "[q]Wenn Ihr mit einem Nahkampfangriff Schaden verursacht, besteht eine Chance, dass die Zauberzeit und Manakosten Eures nächsten Wirkens von 'Blitzschlag', 'Kettenblitzschlag', 'Geringe Welle der Heilung' oder 'Lavaeruption' um 20% verringert werden. Diese Chance ist um 50% erhöht, während Eure Waffenhandwaffe mit 'Waffe des Windzorns' belegt ist, und um weitere 50% erhöht, wenn Ihr eine Zweihandwaffe führt. Bis zu 5-mal stapelbar. Hält 30 sec lang an."},
[408501] = {name = "Mahlstrom bereit!", additional_info = nil},
[408505] = {name = "Waffe des Mahlstroms", additional_info = "Sofort\n[q]Verringert die Zauberzeit und Manakosten Eures nächsten Wirkens von 'Blitzschlag', 'Kettenblitzschlag', 'Geringe Welle der Heilung' oder 'Lavaeruption' um 20%."},
[408507] = {name = "Lavapeitsche", additional_info = "{1% von Grundmana} {Nahkampfreichweite}\n{Sofort} {6 sek. Abklingzeit}\nBenötigt Nahkampfwaffe\n[q]Lädt Eure Schildhandwaffe mit Lava auf, verursacht sofort 100% Waffenschaden der Schildhandwaffe. Der Schaden ist um 125% erhöht, wenn Eure Schildhandwaffe mit 'Flammenzunge' verzaubert ist."},
[408510] = {name = "Wasserschild", additional_info = "Sofort\n[q]Der Zaubernde wird von 3 Wasserkugeln umgeben, die alle 5 Sek. 1% Eures maximalen Manas gewähren. Trifft ein Zauber-, Nahkampf- oder Distanzangriff den Zaubernden, werden 4% seines maximalen Manas wiederhergestellt und eine Wasserkugel wird aufgelöst. Alle paar Sekunden kann nur eine Wasserkugel aktiviert werden. Hält 10 min lang an. Es kann immer nur ein Elementarschild auf dem Schamanen aktiv sein.\n(3.5s Abklingzeit)"},
[408511] = {name = "Wasserschild", additional_info = "Sofort\n[q]Erhält Mana durch erlittene Treffer, solange 'Wasserschild' aktiv ist."},
[408514] = {name = "Erdschild", additional_info = "{5% von Grundmana} {40 Meter Reichweite}\nSofort\n[q]Schützt das Ziel mit einem Erdschild, der die Erhöhung der Zauberzeit oder Verringerung der Kanalisierungsdauer durch erlittenen Schaden um 30% verringert und Angriffe das geschützte Ziel um [55 * (29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60) / 100] Gesundheit heilen lässt. Dieser Effekt tritt nur einmal alle paar Sekunden auf. 9 Aufladungen. Hält 10 min lang an. Der Erdschild kann immer nur auf jeweils einem Ziel aktiv sein.\n(3.5s Abklingzeit)"},
[408519] = {name = "Erdschild", additional_info = "Unbegrenzte Reichweite\nSofort\n[q]Wird durch 'Erdschild' geheilt."},
[408521] = {name = "Springflut", additional_info = "{18% von Grundmana} {40 Meter Reichweite}\n{Sofort} {6 sek. Abklingzeit}\n[q]Heilt ein verbündetes Ziel um [113 / 100 * (29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60)] bis [123 / 100 * (29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60)] Gesundheit und im Verlauf von 15 sec um weitere [5 * 24 / 100 * (29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60)] Gesundheit. Euer nächstes Wirken von 'Kettenheilung' innerhalb von 15 sec auf dieses Hauptziel zehrt den regelmäßigen Heileffekt auf und erhöht den von 'Kettenheilung' geheilten Wert um 25%. Dieser Zauber löst außerdem 'Erwachen der Ahnen' aus."},
[408524] = {name = "Schildmeisterschaft", additional_info = "[q]Jedes Mal, wenn Ihr blockt, regeneriert Ihr Mana in Höhe von 8% Eures maximalen Manas und erhaltet Rüstung in der Höhe von 30% des Rüstungswertes Eures Schildes. Bis zu 5-mal stapelbar. Ihr erhaltet außerdem immer eine um 10% erhöhte Blockchance und einen um 15% erhöhten Blockwert.\n\n Außerdem erhaltet Ihr immer, wenn Ihr eine Schockfähigkeit einsetzt, 2 Zauberschaden pro Punkt Eurer Verteidigungsfertigkeit, der über ( 60 * 5) hinausgeht. Hält 15 sec lang an."},
[408525] = {name = "Schildmeisterschaft", additional_info = "Sofort\n[q]Erhöht die Rüstung 15 sec lang um 30% des Rüstungswertes Eures Schildes. Bis zu 5-mal stapelbar."},
[408531] = {name = "Weg der Erde", additional_info = "[q]Während 'Waffe des Felsbeißers' auf Eurer Waffenhand aktiv ist und Ihr einen Schild ausgerüstet habt, erzeugt Ihr 65% mehr Bedrohung, erhaltet 30% mehr Gesundheit, erleidet 10% weniger Schaden. Eure Chance, von Nahkampfangriffen kritisch getroffen zu werden, ist um 6% verringert. Euer 'Erdschock' verspottet Ziele, damit sie Euch angreifen, und hat eine von anderen Schockzaubern getrennte Abklingzeit, aber seine Reichweite wird auf Nahkampfreichweite verringert. Die Reichweite Eurer Zauber 'Blitzschlag', 'Kettenblitzschlag', 'Kettenheilung', 'Welle der Heilung' und 'Lavaeruption' ist jedoch um 20 Meter verringert."},
[408680] = {name = "Weg der Erde", additional_info = "Sofort\n[q]Während 'Waffe des Felsbeißers' auf Eurer Waffenhand aktiv ist, verursacht Ihr 65% mehr Bedrohung, erhaltet 30% mehr Gesundheit, erleidet 10% weniger Schaden. Eure Chance, von Nahkampfangriffen kritisch getroffen zu werden, ist um 6% verringert. Euer 'Erdschock' verspottet Ziele, damit sie Euch angreifen, und hat eine von anderen Schockzaubern getrennte Abklingzeit."},
[408681] = {name = "Erdschock", additional_info = "{30 Mana} {Nahkampfreichweite}\n{Sofort} {6 sek. Abklingzeit}\n[q]Schockt das Ziel unmittelbar mit erschütternder Kraft und verursacht 19 to 22 Naturschaden. Unterbricht außerdem das Wirken von Zaubern und verhindert 2 sec lang, dass Zauber dieser Art gewirkt werden können. Verursacht ein hohes Maß an Bedrohung und verspottet das Ziel."},
[408683] = {name = "Erdschock", additional_info = "{50 Mana} {Nahkampfreichweite}\n{Sofort} {6 sek. Abklingzeit}\n[q]Schockt das Ziel unmittelbar mit erschütternder Kraft und verursacht 35 to 38 Naturschaden. Unterbricht außerdem das Wirken von Zaubern und verhindert 2 sec lang, dass Zauber dieser Art gewirkt werden können. Verursacht ein hohes Maß an Bedrohung und verspottet das Ziel."},
[408685] = {name = "Erdschock", additional_info = "{85 Mana} {Nahkampfreichweite}\n{Sofort} {6 sek. Abklingzeit}\n[q]Schockt das Ziel unmittelbar mit erschütternder Kraft und verursacht 65 to 69 Naturschaden. Unterbricht außerdem das Wirken von Zaubern und verhindert 2 sec lang, dass Zauber dieser Art gewirkt werden können. Verursacht ein hohes Maß an Bedrohung und verspottet das Ziel."},
[408687] = {name = "Erdschock", additional_info = "{145 Mana} {Nahkampfreichweite}\n{Sofort} {6 sek. Abklingzeit}\n[q]Schockt das Ziel unmittelbar mit erschütternder Kraft und verursacht 126 to 134 Naturschaden. Unterbricht außerdem das Wirken von Zaubern und verhindert 2 sec lang, dass Zauber dieser Art gewirkt werden können. Verursacht ein hohes Maß an Bedrohung und verspottet das Ziel."},
[408688] = {name = "Erdschock", additional_info = "{240 Mana} {Nahkampfreichweite}\n{Sofort} {6 sek. Abklingzeit}\n[q]Schockt das Ziel unmittelbar mit erschütternder Kraft und verursacht 235 to 249 Naturschaden. Unterbricht außerdem das Wirken von Zaubern und verhindert 2 sec lang, dass Zauber dieser Art gewirkt werden können. Verursacht ein hohes Maß an Bedrohung und verspottet das Ziel."},
[408689] = {name = "Erdschock", additional_info = "{345 Mana} {Nahkampfreichweite}\n{Sofort} {6 sek. Abklingzeit}\n[q]Schockt das Ziel unmittelbar mit erschütternder Kraft und verursacht 372 to 394 Naturschaden. Unterbricht außerdem das Wirken von Zaubern und verhindert 2 sec lang, dass Zauber dieser Art gewirkt werden können. Verursacht ein hohes Maß an Bedrohung und verspottet das Ziel."},
[408690] = {name = "Erdschock", additional_info = "{450 Mana} {Nahkampfreichweite}\n{Sofort} {6 sek. Abklingzeit}\n[q]Schockt das Ziel unmittelbar mit erschütternder Kraft und verursacht 517 to 545 Naturschaden. Unterbricht außerdem das Wirken von Zaubern und verhindert 2 sec lang, dass Zauber dieser Art gewirkt werden können. Verursacht ein hohes Maß an Bedrohung und verspottet das Ziel."},
[408693] = {name = "Erdschock", additional_info = "Nahkampfreichweite\nSofort\n[q]Verspottet das Ziel, damit es Euch angreift. Hat keinen Effekt, wenn Ihr von dem Ziel bereits angegriffen werdet."},
[408696] = {name = "Geist des Alphas", additional_info = "{8% von Grundmana} {30 Meter Reichweite}\nSofort\n[q]Erfüllt das Ziel mit dem Geist eines Alphawolfes, was die generierte Bedrohung des Ziels 30 min lang um 45% erhöht. Maximal 1 Ziel. Wenn der Schamane diesen Zauber nicht auf sich selbst wirkt, erhält er 'Treuer Beta', was 30 min lang seinen verursachten körperlichen Schaden um 5% erhöht und jegliche erzeugte Bedrohung um 30% verringert. Ein Ziel kann nicht gleichzeitig mit 'Geist des Alphas' und 'Treuer Beta' belegt sein."},
[408699] = {name = "Auflauern", additional_info = "100 Meter Reichweite\nSofort\n[q]Die Treffer Eurer Fähigkeiten 'Hinterhalt' und 'Meucheln' bringen Euer Ziel aus dem Gleichgewicht, was die Zeit zwischen seinen Nahkampfangriffen um 10% erhöht sowie seine Bewegungsgeschwindigkeit um 50% verringert. Hält 8 sec lang an."},
[408700] = {name = "Auflauern", additional_info = "[q]Die Treffer Eurer Fähigkeiten 'Hinterhalt' und 'Meucheln' bringen Euer Ziel aus dem Gleichgewicht, was die Zeit zwischen seinen Nahkampfangriffen um 10% erhöht sowie seine Bewegungsgeschwindigkeit um 50% verringert. Hält 8 sec lang an."},
