[409064] = {name = "Runenlegen", additional_info = "15 Meter Reichweite\nKanalisiert (Wirken in 0 sek.)\n[q]Greift die Gedanken des Ziels mit Schattenenergie an, verursacht until cancelled lang 0.0 Schattenschaden und verringert das Bewegungstempo des Ziels um 0%."},
