[409163] = {name = "Gürtel prägen - Fokussierte Wut", additional_info = "Wirken in 3 sek.\nBenötigt Gürtel\n[q]Prägt Euren Gürtel mit der Rune 'Fokussierte Wut':\n\n\nVerringert die Wutkosten aller Angriffsfähigkeiten um 3."},
