[409239] = {name = "Dolchfächer", additional_info = "Nahkampfreichweite\nSofort\nBenötigt Nahkampfwaffe\n[q]Wirft sofort beide Waffen auf alle Ziele innerhalb von 8 Metern und verursacht 50% Waffenschaden."},
[409240] = {name = "Dolchfächer", additional_info = "50 Energie\nSofort\nBenötigt Nahkampfwaffe\n[q]Wirft sofort beide Waffen auf alle Ziele innerhalb von 8 Metern und verursacht 75% Waffenschaden durch Dolche und 50% Waffenschaden durch alle anderen Waffenarten."},
[409317] = {name = "Kraftvolle Seele", additional_info = nil},
[409324] = {name = "Führung der Ahnen", additional_info = "Sofort 1 min Abklingzeit\n[q]Für die nächsten 10 sec werden 25% Eures Schadens in Heilung für bis zu 3 Gruppenmitglieder in der Nähe umgewandelt. 100% Eurer Heilung werden in Schaden umgewandelt und dem letzten Ziel von Eurem 'Flammenschock' zugefügt."},
[409333] = {name = "Führung der Ahnen", additional_info = "40 Meter Reichweite\nSofort\n[q]Für die nächsten 10 sec werden 25% Eures Schadens in Heilung für bis zu 3 Gruppenmitglieder in der Nähe umgewandelt. 100% Eurer Heilung wird in Schaden umgewandelt und dem letzten Ziel von Eurem 'Flammenschock' zugefügt."},
[409337] = {name = "Führung der Ahnen", additional_info = "40 Meter Reichweite\nSofort\n[q]Für die nächsten 10 sec werden 25% Eures Schadens in Heilung für bis zu 3 Gruppenmitglieder in der Nähe umgewandelt. 100% Eurer Heilung wird in Schaden umgewandelt und dem letzten Ziel von Eurem 'Flammenschock' zugefügt."},
[409368] = {name = "Meister der Tiere", additional_info = "[q]Erhöht Schaden und Gesundheit Eures Tiers um 10% und seine Fokusregeneration um 50%. Außerdem verspottet das 'Knurren' Eures Tiers das Ziel 3 sec lang."},
[409372] = {name = "Knurren", additional_info = "Nahkampfreichweite\nSofort\n[q]Verspottet das Ziel, damit es Euch angreift. Hat keinen Effekt, wenn Ihr von dem Ziel bereits angegriffen werdet."},
[409379] = {name = "Tötungsbefehl", additional_info = "{1.5% von Grundmana} {45 Meter Reichweite}\nSofort 1 min Abklingzeit\n[q]Gibt Eurem Tier den Befehl zu töten. Erhöht den Schaden, den Euer Tier mit 'Klaue' und 'Beißen' verursacht, 30 sec lang um 60%. Mit jedem Einsatz von 'Klaue' oder 'Beißen' des Tieres sinkt der Schadensbonus um 20%."},
[409396] = {name = "Tötungsbefehl", additional_info = "45 Meter Reichweite\nSofort\n[q]Gibt Eurem Tier den Befehl zu töten. Erhöht den Schaden, den Euer Tier mit 'Klaue' und 'Beißen' verursacht, 30 sec lang um 60%. Mit jedem Einsatz von 'Klaue' oder 'Beißen' des Tieres sinkt der Schadensbonus um 20%."},
[409418] = {name = "Tötungsbefehl", additional_info = "Unbegrenzte Reichweite\nSofort 1 min Abklingzeit\n[q]Gibt Eurem Tier den Befehl zu töten. Erhöht den Schaden, den Euer Tier mit 'Klaue' und 'Beißen' verursacht, 30 sec lang um 60%. Mit jedem Einsatz von 'Klaue' oder 'Beißen' des Tieres sinkt der Schadensbonus um 20%."},
[409423] = {name = "Leichenexplosion", additional_info = nil},
[409428] = {name = "Meister der Treffsicherheit", additional_info = "[q]Erhöht Eure kritische Trefferchance um 5% und verringert die Manakosten aller Eurer Schussfähigkeiten um 25%."},
[409433] = {name = "Schimärenschuss", additional_info = "{6% von Grundmana} {8 - 35 Meter Reichweite}\n6 sek. Abklingzeit\nBenötigt Distanzwaffe\n[q]Verursacht 135% Waffenschaden, erneuert die Dauer des auf das Ziel wirkenden Stiches oder Bisses und löst einen Effekt aus:\n\n Schlangenbiss - Verursacht sofort 48% des von Eurem Schlangenbiss verursachten Schadens.\n\n Vipernbiss - Stellt sofort 60% des von Eurem Vipernbiss abgezogenen Manas bei Euch wieder her.\n\n Skorpidstich - Versucht, das Ziel 10 sec lang zu entwaffnen. Dieser Effekt kann nur einmal pro Minute auftreten."},
[409493] = {name = "Schimärenschuss - Schlange", additional_info = "100 Meter Reichweite\n[q]Verursacht 135% Waffenschaden, erneuert die Dauer des auf das Ziel wirkenden Stiches oder Bisses und löst einen Effekt aus:\n\n Schlangenbiss - Verursacht sofort 48% des von Eurem 'Schlangenbiss' verursachten Schadens.\n\n Vipernbiss - Stellt sofort 60% des von Eurem 'Vipernbiss' aufgebrauchten Manas bei Euch wieder her.\n\n Skorpidstich - Versucht, das Ziel 10 sec lang zu entwaffnen. Dieser Effekt kann nur einmal pro Minute auftreten."},
[409494] = {name = "Schimärenschuss - Viper", additional_info = "100 Meter Reichweite\n[q]Verursacht 135% Waffenschaden, erneuert die Dauer des auf das Ziel wirkenden Stiches oder Bisses und löst einen Effekt aus:\n\n Schlangenbiss - Verursacht sofort 48% des von Eurem 'Schlangenbiss' verursachten Schadens.\n\n Vipernbiss - Stellt sofort 60% des von Eurem 'Vipernbiss' aufgebrauchten Manas bei Euch wieder her.\n\n Skorpidstich - Versucht, das Ziel 10 sec lang zu entwaffnen. Dieser Effekt kann nur einmal pro Minute auftreten."},
[409495] = {name = "Schimärenschuss - Skorpid", additional_info = "100 Meter Reichweite\n[q]Verursacht 135% Waffenschaden, erneuert die Dauer des auf das Ziel wirkenden Stiches oder Bisses und löst einen Effekt aus:\n\n Schlangenbiss - Verursacht sofort 48% des von Eurem 'Schlangenbiss' verursachten Schadens.\n\n Vipernbiss - Stellt sofort 60% des von Eurem 'Vipernbiss' aufgebrauchten Manas bei Euch wieder her.\n\n Skorpidstich - Versucht, das Ziel 10 sec lang zu entwaffnen. Dieser Effekt kann nur einmal pro Minute auftreten."},
[409504] = {name = "Schwäche aufdecken", additional_info = "[q]Eure kritischen Treffer mit Nahkampf- und Distanzangriffen erhöhen 7 sec lang Eure Angriffskraft um 40% Eurer aktuellen Beweglichkeit."},
[409507] = {name = "Schwäche aufdecken", additional_info = "Sofort\n[q]Eure kritischen Treffer mit Distanzangriffen erhöhen 7 sec lang Eure Angriffskraft um 40% Eurer Beweglichkeit."},
[409510] = {name = "Eiskältefalle", additional_info = "{50 Mana} {35 Meter Reichweite}\n15 sek. Abklingzeit\n[q]Platziert eine Frostfalle in der Nähe, die den ersten sich nähernden Gegner einfriert und bis zu 10 sec lang alle Aktionen verhindert. Jeglicher verursachte Schaden wird das Eis brechen. Die Falle bleibt 1 min lang bestehen. Es kann immer nur eine Falle aktiv sein."},
[409512] = {name = "Eiskältefalle", additional_info = "{75 Mana} {35 Meter Reichweite}\n15 sek. Abklingzeit\n[q]Platziert eine Frostfalle in der Nähe, die den ersten sich nähernden Gegner einfriert und bis zu 15 sec lang alle Aktionen verhindert. Jeglicher verursachte Schaden wird das Eis brechen. Die Falle bleibt 1 min lang bestehen. Es kann immer nur eine Falle aktiv sein."},
[409519] = {name = "Eiskältefalle", additional_info = "{100 Mana} {35 Meter Reichweite}\n15 sek. Abklingzeit\n[q]Platziert eine Frostfalle in der Nähe, die den ersten sich nähernden Gegner einfriert und bis zu 20 sec lang alle Aktionen verhindert. Jeglicher verursachte Schaden wird das Eis brechen. Die Falle bleibt 1 min lang bestehen. Es kann immer nur eine Falle aktiv sein."},
[409520] = {name = "Frostfalle", additional_info = "60 Mana\n{Sofort} {15 sek. Abklingzeit}\n[q]Platziert eine Frostfalle in der Nähe, die 30 sec lang um sich herum eine Eisfläche bildet, sobald der erste Gegner sich ihr nähert. Die Bewegungsgeschwindigkeit aller Gegner in einem Umkreis von 10 Metern wird um 60% verringert, solange sie sich im Wirkungsbereich befinden. Die Falle bleibt 1 min lang bestehen. Es kann immer nur jeweils eine Falle aktiv sein."},
[409521] = {name = "Feuerbrandfalle", additional_info = "{50 Mana} {35 Meter Reichweite}\n15 sek. Abklingzeit\n[q]Platziert eine Feuerfalle in der Nähe, die dem ersten sich nähernden Gegner im Verlauf von 15 sec 105 Feuerschaden zufügt. Die Falle bleibt 1 min lang bestehen. Es kann immer nur jeweils eine Falle aktiv sein."},
[409524] = {name = "Feuerbrandfalle", additional_info = "{90 Mana} {35 Meter Reichweite}\n15 sek. Abklingzeit\n[q]Platziert eine Feuerfalle in der Nähe, die dem ersten sich nähernden Gegner im Verlauf von 15 sec 215 Feuerschaden zufügt. Die Falle bleibt 1 min lang bestehen. Es kann immer nur jeweils eine Falle aktiv sein."},
[409526] = {name = "Feuerbrandfalle", additional_info = "{135 Mana} {35 Meter Reichweite}\n15 sek. Abklingzeit\n[q]Platziert eine Feuerfalle in der Nähe, die dem ersten sich nähernden Gegner im Verlauf von 15 sec 340 Feuerschaden zufügt. Die Falle bleibt 1 min lang bestehen. Es kann immer nur jeweils eine Falle aktiv sein."},
[409528] = {name = "Feuerbrandfalle", additional_info = "{190 Mana} {35 Meter Reichweite}\n15 sek. Abklingzeit\n[q]Platziert eine Feuerfalle in der Nähe, die dem ersten sich nähernden Gegner im Verlauf von 15 sec 510 Feuerschaden zufügt. Die Falle bleibt 1 min lang bestehen. Es kann immer nur jeweils eine Falle aktiv sein."},
[409530] = {name = "Feuerbrandfalle", additional_info = "{245 Mana} {35 Meter Reichweite}\n15 sek. Abklingzeit\n[q]Platziert eine Feuerfalle in der Nähe, die dem ersten sich nähernden Gegner im Verlauf von 15 sec 690 Feuerschaden zufügt. Die Falle bleibt 1 min lang bestehen. Es kann immer nur jeweils eine Falle aktiv sein."},
[409532] = {name = "Sprengfalle", additional_info = "{275 Mana} {35 Meter Reichweite}\n15 sek. Abklingzeit\n[q]Platziert eine Feuerfalle in der Nähe, die explodiert, wenn sich ein Gegner nähert. Die Falle verursacht 104 to 135 Feuerschaden und fügt allen Zielen in einem Umkreis von 10 Metern im Verlauf von 20 sec zusätzlich 150 Feuerschaden zu. Die Falle bleibt 1 min lang bestehen. Es kann immer nur jeweils eine Falle aktiv sein."},
[409534] = {name = "Sprengfalle", additional_info = "{395 Mana} {35 Meter Reichweite}\n15 sek. Abklingzeit\n[q]Platziert eine Feuerfalle in der Nähe, die explodiert, wenn sich ein Gegner nähert. Die Falle verursacht 145 to 193 Feuerschaden und fügt allen Zielen in einem Umkreis von 10 Metern im Verlauf von 20 sec zusätzlich 240 Feuerschaden zu. Die Falle bleibt 1 min lang bestehen. Es kann immer nur jeweils eine Falle aktiv sein."},
[409535] = {name = "Sprengfalle", additional_info = "{520 Mana} {35 Meter Reichweite}\n15 sek. Abklingzeit\n[q]Platziert eine Feuerfalle in der Nähe, die explodiert, wenn sich ein Gegner nähert. Die Falle verursacht 208 to 265 Feuerschaden und fügt allen Zielen in einem Umkreis von 10 Metern im Verlauf von 20 sec zusätzlich 330 Feuerschaden zu. Die Falle bleibt 1 min lang bestehen. Es kann immer nur jeweils eine Falle aktiv sein."},
[409541] = {name = "Fallenschleuder", additional_info = "[q]Eure Eiskältefallen, Feuerbrandfallen und Sprengfallen können jetzt an jedem Ort innerhalb von 35 Metern ausgelegt werden. Außerdem haben Eure feuer- und frostbasierten Fallen jetzt getrennte gemeinsame Abklingzeiten."},
[409552] = {name = "Explosivschuss", additional_info = "{3.5% von Grundmana} {8 - 35 Meter Reichweite}\n6 sek. Abklingzeit\nBenötigt Distanzwaffe\n[q]Feuert ein Explosivgeschoss in das gegnerische Ziel, das allen Gegnern innerhalb von 8 Metern [Ranged attack power * 0.039 + 62 / 100 * (2.976264 + 0.641066 * 60 + 0.022519 * 60 * 60)] bis [Ranged attack power * 0.039 + 94 / 100 * (2.976264 + 0.641066 * 60 + 0.022519 * 60 * 60)] Feuerschaden zufügt. Die Sprengladung verursacht 2 sec lang pro Sekunde weiteren Schaden."},
[409554] = {name = "Explosivschuss", additional_info = "Unbegrenzte Reichweite\n[q]Feuert ein Explosivgeschoss, das dem gegnerischen Ziel (Ranged attack power * 0.14 + 10) bis (Ranged attack power * 0.14 + 10) Feuerschaden zufügt. Die Sprengladungen verursachen until cancelled lang pro Sekunde weiteren Schaden. Teilt sich die Abklingzeit mit 'Arkaner Schuss'."},
[409580] = {name = "Löwenherz", additional_info = "8% von Grundmana\nSofort\n[q]Der Jäger beschwört das Herz eines Löwen, was alle Werte aller Verbündeten in der Nähe um 10% und deren Angriffskraft um 200 und alle Werte des Jägers um zusätzlich 10% erhöht."},
[409583] = {name = "Löwenherz", additional_info = "100 Meter Reichweite\nSofort\n[q]Der Jäger beschwört das Herz eines Löwen, was alle Werte aller Verbündeten in der Nähe um 10% und alle Werte des Jägers um zusätzlich 10% erhöht."},
[409593] = {name = "Tödlicher Schuss", additional_info = "{3% von Grundmana} {35 Meter Reichweite}\n15 sek. Abklingzeit\nBenötigt Distanzwaffe\n[q]Ihr versucht, ein verletztes Ziel mit einem Distanzangriff zu töten, der 100% Waffenschaden plus [113 / 100 * 100 / 100 * (2.976264 + 0.641066 * 60 + 0.022519 * 60 * 60)] verursacht. 'Tödlicher Schuss' hat keine Minimaldistanz, und seine Abklingzeit wird zurückgesetzt, wenn er gegen einen Gegner mit 20% oder weniger Gesundheit eingesetzt wird."},
[409687] = {name = "Beidhändigkeitsspezialisierung", additional_info = "[q]Erhöht den von Eurer Schildhandwaffe verursachten Schaden um 50% und führt dazu, dass Euer 'Raptorstoß' mit beiden Waffen trifft, wenn Ihr beidhändig kämpft."},
[409691] = {name = "Raptorstoß", additional_info = "Nahkampfreichweite\nSofort\nBenötigt Nahkampfwaffe\n[q]Ein heftiger Angriff, der den Nahkampfschaden um 2 to 3 erhöht."},
[409693] = {name = "Raptorstoß", additional_info = "Nahkampfreichweite\nSofort\nBenötigt Nahkampfwaffe\n[q]Ein heftiger Angriff, der den Nahkampfschaden um 5 erhöht."},
[409748] = {name = "Raptorstoß", additional_info = "Nahkampfreichweite\nSofort\nBenötigt Nahkampfwaffe\n[q]Ein heftiger Angriff, der den Nahkampfschaden um 10 to 11 erhöht."},
[409750] = {name = "Raptorstoß", additional_info = "Nahkampfreichweite\nSofort\nBenötigt Nahkampfwaffe\n[q]Ein heftiger Angriff, der den Nahkampfschaden um 17 erhöht."},
[409751] = {name = "Raptorstoß", additional_info = "Nahkampfreichweite\nSofort\nBenötigt Nahkampfwaffe\n[q]Ein heftiger Angriff, der den Nahkampfschaden um 25 erhöht."},
[409752] = {name = "Raptorstoß", additional_info = "Nahkampfreichweite\nSofort\nBenötigt Nahkampfwaffe\n[q]Ein heftiger Angriff, der den Nahkampfschaden um 40 erhöht."},
[409754] = {name = "Raptorstoß", additional_info = "Nahkampfreichweite\nSofort\nBenötigt Nahkampfwaffe\n[q]Ein heftiger Angriff, der den Nahkampfschaden um 55 erhöht."},
[409755] = {name = "Raptorstoß", additional_info = "Nahkampfreichweite\nSofort\nBenötigt Nahkampfwaffe\n[q]Ein heftiger Angriff, der den Nahkampfschaden um 70 erhöht."},
[409805] = {name = "Wilde Stöße", additional_info = "[q]Erhaltet die Fähigkeit 'Wilde Stöße':\n\n\nWährend Ihr in Katzengestalt, Bärengestalt oder Terrorbärengestalt seid, erlangen Gruppen- oder Schlachtzugsmitglieder im Umkreis von 100 Metern erhöhte Kampfwildheit. Bei jedem Nahkampftreffer besteht eine Chance von 20%, dem Angreifer einen Zusatzangriff mit 20% höherer Angriffskraft zu gewähren. Kein Effekt, wenn das Ziel bereits vom Totem des Windzorns profitiert."},
[409809] = {name = "Überlebensinstinkte", additional_info = "[q]Erhaltet die Fähigkeit 'Überlebensinstinkte':\n\n\nNach Aktivierung erhaltet Ihr 20 sec lang 30% Eurer maximalen Gesundheit. Während dieser Zeit wird zudem sämtliche von Euch hervorgerufene nichtkörperliche Heilung um 20% erhöht. Nachdem der Effekt abgelaufen ist, geht die Gesundheit verloren. Kann in jeder Gestalt eingesetzt werden.\n\n Zusätzlich regeneriert Ihr bei jedem Ausweichen in Bärengestalt oder Terrorbärengestalt 5 Wut, in Katzengestalt 10 Energie oder in jeder anderen Gestalt 1% Eures maximalen Manas."},
[409810] = {name = "Wildwuchs", additional_info = "[q]Erhaltet die Fähigkeit 'Wildwuchs':\n\n\nHeilt alle Gruppenmitglieder des anvisierten Spielercharakters innerhalb von 43.5 Metern um ihn herum im Verlauf von 7 sec um [17 / 100 * 7 * (38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60)] Gesundheit. Die Heilung wird zunächst schnell und mit zunehmender Dauer von 'Wildwuchs' langsamer angewendet."},
[409813] = {name = "Finsternis", additional_info = "[q]Erhaltet die Fähigkeit 'Finsternis':\n\n\n'Sternenfeuer' erhöht die Chance auf kritische Treffer bei Euren nächsten beiden Einsätzen von 'Zorn' um 30%, und 'Zorn' verringert die Zauberzeit Eures nächsten Einsatzes von 'Sternenfeuer' um 1.0 Sek. Beide Effekte lassen sich bis zu 4-mal stapeln. Bei beiden Zaubern besteht außerdem jederzeit eine Chance von 70%, dass Ihr keine Zauberzeit verliert, wenn Ihr Schaden erleidet."},
[409819] = {name = "Wildes Brüllen", additional_info = "[q]Erhaltet die Fähigkeit 'Wildes Brüllen':\n\n\nFinishing-Move, der den verursachten körperlichen Schaden in Katzengestalt um 30% erhöht. Hält pro Combopunkt länger an:\n 1 Punkt: 14 Sek.\n 2 Punkte: 19 Sek.\n 3 Punkte: 24 Sek.\n 4 Punkte: 29 Sek.\n 5 Punkte: 34 Sek."},
[409824] = {name = "Blühendes Leben", additional_info = "[q]Verringert die globale Abklingzeit Eurer Fähigkeiten 'Verjüngung' und 'Blühendes Leben' um 0.5 Sek. und Ihr erhaltet die Fähigkeit 'Blühendes Leben':\n\n\nHeilt das Ziel im Verlauf von 7 sec um [4 / 100 * 7 * (38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60)] Gesundheit. Wenn 'Blühendes Leben' endet oder gebannt wird, wird das Ziel sofort um [57 / 100 * (38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60)] Gesundheit geheilt und der Druide erhält die Hälfte der Zauberkosten erstattet. Dieser Effekt ist bis zu 3-mal auf einem Ziel stapelbar."},
[409826] = {name = "Zorn der Natur", additional_info = "[q]Erhaltet die Fähigkeit 'Zorn der Natur':\n\n\nErhöht Eure Heilkraft 30 sec lang um 90% Eures Naturzauberschadens."},
[409828] = {name = "Zerfleischen", additional_info = "[q]Erhaltet die Fähigkeit 'Zerfleischen (Bär)' und ersetzt Eure Fähigkeit 'Klaue' mit 'Zerfleischen (Katze). Diese Fähigkeit profitiert von allen Effekten von 'Klaue' und 'Zermalmen' und löst diese aus.\n\n\nZerfleischt das Ziel, fügt ihm 160% des normalen Schadens zu und lässt es 1 min lang 30% zusätzlichen Schaden durch Blutungseffekte und 'Schreddern' erleiden. Diese Fähigkeit profitiert von allen Effekten von 'Klaue' und 'Zermalmen' und löst diese aus.\n\n Wenn Ihr ein Ziel mit 'Zerfleischen (Bär)' trefft, erhaltet Ihr zudem 4 Angriffskraft für jeden Punkt Eurer Verteidigungsfertigkeit über ( 60 * 5). Hält 15 sec lang an.\n\n\nZerfleischt das Ziel, fügt ihm 270% des normalen Schadens zu und lässt es 1 min lang 30% zusätzlichen Schaden durch Blutungseffekte und 'Schreddern' erleiden. Gewährt 1 Combopunkt. Diese Fähigkeit profitiert von allen Effekten von 'Klaue' und 'Zermalmen' und löst diese aus."},
[409830] = {name = "Pflege", additional_info = "[q]Erhaltet die Fähigkeit 'Pflege':\n\n\nHeilt ein verbündetes Ziel um [161 / 100 * (38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60)] bis [189 / 100 * (38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60)] Gesundheit. Wenn ein durch Euch gewirkter Effekt von 'Verjüngung', 'Nachwachsen', 'Wildwuchs' oder 'Blühendes Leben' auf dem Ziel aktiv ist, erhöht sich die Heilung um zusätzliche 20%. Dieser Zauber profitiert von allen Effekten von 'Heilende Berührung' oder 'Nachwachsen' und löst diese aus."},
[409831] = {name = "Traumzustand", additional_info = "[q]Erhaltet die Fähigkeit 'Traumzustand':\n\n\nKritische Treffer Eurer nicht regelmäßigen Schadenszauber und jeglicher Schaden von Eurem 'Sternensog' gewähren Euch 8 sec lang 50% Manaregeneration, während Ihr Zauber wirkt. Der Eurem Ziel zugefügte Arkan- und Naturschaden wird außerdem 12 sec lang um 20% erhöht."},
[409832] = {name = "Furor von Sturmgrimm", additional_info = "[q]Erhaltet die Fähigkeit 'Furor von Sturmgrimm':\n\n\nVerringert die Manakosten von 'Zorn' um 100%. Jedes Mal, wenn Ihr Schaden mit 'Zorn' verursacht, besteht eine Chance von 12%, dass Eure nächste 'Heilende Berührung' innerhalb von 15 sec ein Spontanzauber ist und in allen Gestaltwandelgestalten einsetzbar ist. Erlaubt in Baum-des-Lebens-Gestalt 'Zorn' zu zaubern."},
[409856] = {name = "Geisterritual", additional_info = "30 Meter Reichweite\nKanalisiert (Wirken in 10 min)\n[q]Beginnt ein Ritual, um den Geist eines gefallenen Abenteurers zu befreien."},
[409858] = {name = "Dummy Trigger", additional_info = nil},
[409906] = {name = "Flamme des Glaubens", additional_info = "[q]Erhaltet die Fähigkeit 'Flamme des Glaubens':\n\n\nDas Ziel wird für alle Gruppen- und Schlachtzugsmitglieder in einem Radius von 40 Metern zu einer Flamme des Glaubens. Alle auf diese Mitglieder gewirkten Heilungen heilen auch die Flamme um 100% der gewirkten Heilung. Es kann immer nur ein Ziel zur gleichen Zeit eine Flamme des Glaubens sein. Hält 1 hour lang an."},
[409911] = {name = "Hand der Abrechnung", additional_info = "[q]Erhaltet die Fähigkeit 'Hand der Abrechnung':\n\n\nVerspottet das Ziel, damit es Euch angreift. Hat keinen Effekt, wenn Ihr von dem Ziel bereits angegriffen werdet.\n\n Während Ihr diese Fähigkeit kennt, ist der Bedrohungsbonus von 'Zorn der Gerechtigkeit' auf 80% erhöht. Wenn Ihr von anderen Charakteren geheilt werdet, sorgt 'Zorn der Gerechtigkeit' dafür, dass Ihr Mana in Höhe von 25% der hervorgerufenen Heilung erhaltet. Zusätzlich wird Schaden, der Eure Gesundheit unter 35% senkt, um 20% verringert, während 'Zorn der Gerechtigkeit' aktiv ist. 'Zorn der Gerechtigkeit' bleibt aktiv, bis er abgebrochen wird."},
[409914] = {name = "Kreuzfahrerstoß", additional_info = "[q]Erhaltet die Fähigkeit 'Kreuzfahrerstoß':\n\n\nEin sofortiger Stoß, der 75% Waffenschaden als Heiligschaden verursacht und 5% Eures maximalen Manas regeneriert. Die Dauer aller Richturteilseffekte auf dem Ziel wird auf 30 Sek. zurückgesetzt."},
[409918] = {name = "Inspiration (Richturteil)", additional_info = nil},
[409920] = {name = "Relikt erlernen (Richturteil)", additional_info = nil},
[409922] = {name = "Hammer der Rechtschaffenen", additional_info = "[q]Erhaltet die Fähigkeit 'Hammer der Rechtschaffenen':\n\n\nTrifft das aktuelle Ziel sowie bis zu 2 zusätzliche Ziele in der Nähe und verursacht pro Sekunde den 3-fachen Schaden Eurer Waffenhandwaffe als Heiligschaden."},
[409924] = {name = "Göttlicher Sturm", additional_info = "[q]Erhaltet die Fähigkeit 'Göttlicher Sturm':\n\n\nEin sofortiger Waffenangriff, der bis zu 4 Gegnern innerhalb von 8 Metern 110% Waffenschaden zufügt. 'Göttlicher Sturm' heilt bis zu 3 Gruppen- oder Schlachtzugsmitglieder in Höhe von 25% des verursachten Schadens."},
[409925] = {name = "Göttliches Licht", additional_info = nil},
[409930] = {name = "Buchband des Richturteils", additional_info = nil},
[409932] = {name = "Aurenmeisterschaft", additional_info = "[q]Erhaltet die Fähigkeit 'Aurenmeisterschaft':\n\n\nVerleiht allen durch Eure Fähigkeit 'Aura der Konzentration' gestärkten Zielen Immunität gegen Unterbrechungs- und Stilleeffekte. Die Effekte aller anderen Auren werden um 100% erhöht. Hält 6 sec lang an."},
[409933] = {name = "Schild des Rächers", additional_info = "[q]Erhaltet die Fähigkeit 'Schild des Rächers':\n\n\nSchleudert einen heiligen Schild auf den Gegner, der [366 * (9.046514 + 0.676562 * 60 + 0.019349 * 60 * 60) / 100 + 0.091 * Spell power + 0.091 * Attack power] bis [448 * (9.046514 + 0.676562 * 60 + 0.019349 * 60 * 60) / 100 + 0.091 * Spell power + 0.091 * Attack power] Heiligschaden verursacht, ihn benommen macht und dann auf weitere Gegner in der Nähe überspringt. Wirkt auf insgesamt 3 Ziele. Hält 5 sec lang an."},
[409934] = {name = "Zornige Vergeltung", additional_info = "[q]Erhaltet die Fähigkeit 'Zornige Vergeltung':\n\n\nErhöht 20 sec lang jeglichen verursachten Schaden und Heilung um 20%. Verursacht 'Vorahnung' und kann nicht eingesetzt werden, während 'Vorahnung' aktiv ist."},
[409935] = {name = "Hand der Aufopferung", additional_info = "[q]Erhaltet die Fähigkeit 'Hand der Aufopferung':\n\n\nLässt das anvisierte Gruppen- oder Schlachtzugsmitglied pro Treffer 30% des erlittenen Schadens auf den Zaubernden übertragen. Hält 12 sec lang an oder bis Schaden in Höhe von 100% der maximalen Gesundheit des Zaubernden übertragen wurde."},
[409936] = {name = "Inspirationsvorbild", additional_info = "[q]Erhaltet die Fähigkeit 'Inspirationsvorbild':\n\n\nEure inspirierende Präsenz bannt regelmäßig Furcht- und Schlafeffekte von Gruppenmitgliedern in der Nähe."},
[409938] = {name = "Feuernova", additional_info = "[q]Erhaltet die Fähigkeit 'Feuernova'. Ersetzt Euer Totem der Feuernova:\n\n\nEuer Totem der Feuernova wird durch 'Feuernova' ersetzt. Dadurch verursacht Euer derzeitiges Feuertotem Schaden an seinem Standort."},
[409940] = {name = "Beidhändigkeitsspezialisierung", additional_info = "[q]Erhaltet die Fähigkeit 'Beidhändigkeitsspezialisierung':\n\n\nErhöht beim beidhändigen Führen Eure Chance, mit Zaubern und Nahkampfangriffen Treffer zu landen, um 5%. Außerdem trifft Eure Fähigkeit 'Sturmschlag' jetzt mit beiden Waffen, wenn Ihr beidhändig führt, und erhöht den verursachten Schaden Eurer Schildhandwaffe um 50%."},
[409941] = {name = "Wasserschild", additional_info = "[q]Erhaltet die Fähigkeit 'Wasserschild':\n\n\nDer Zaubernde wird von 3 Wasserkugeln umgeben, die alle 5 Sek. 1% Eures maximalen Manas gewähren. Trifft ein Zauber-, Nahkampf- oder Distanzangriff den Zaubernden, werden 4% seines maximalen Manas wiederhergestellt und eine Wasserkugel wird aufgelöst. Alle paar Sekunden kann nur eine Wasserkugel aktiviert werden. Hält 10 min lang an. Es kann immer nur ein Elementarschild auf dem Schamanen aktiv sein."},
[409943] = {name = "Schildmeisterschaft", additional_info = "[q]Erhaltet die Fähigkeit 'Schildmeisterschaft':\n\n\nJedes Mal, wenn Ihr blockt, regeneriert Ihr Mana in Höhe von 8% Eures maximalen Manas und erhaltet Rüstung in der Höhe von 30% des Rüstungswertes Eures Schildes. Bis zu 5-mal stapelbar. Ihr erhaltet außerdem immer eine um 10% erhöhte Blockchance und einen um 15% erhöhten Blockwert.\n\n Außerdem erhaltet Ihr immer, wenn Ihr eine Schockfähigkeit einsetzt, 2 Zauberschaden pro Punkt Eurer Verteidigungsfertigkeit, der über ( 60 * 5) hinausgeht. Hält 15 sec lang an."},
[409944] = {name = "Führung der Ahnen", additional_info = "[q]Erhaltet die Fähigkeit 'Führung der Ahnen':\n\n\nFür die nächsten 10 sec werden 25% Eures Schadens in Heilung für bis zu 3 Gruppenmitglieder in der Nähe umgewandelt. 100% Eurer Heilung werden in Schaden umgewandelt und dem letzten Ziel von Eurem 'Flammenschock' zugefügt."},
[409945] = {name = "Überladung", additional_info = "[q]Erhaltet die Fähigkeit 'Überladung!':\n\n\nVerleiht Euren Zaubern 'Blitzschlag', 'Kettenblitzschlag', 'Kettenheilung', 'Welle der Heilung' und 'Lavaeruption' eine Chance von 50%, kostenlos einen zweiten, ähnlichen Zauber auf das gleiche Ziel auszulösen. Dieser verursacht nur halben Schaden bzw. halbe Heilung und erzeugt keine Bedrohung."},
[409946] = {name = "Waffe des Mahlstroms", additional_info = "[q]Erhaltet die Fähigkeit 'Waffe des Mahlstroms':\n\n\nWenn Ihr mit einem Nahkampfangriff Schaden verursacht, besteht eine Chance, dass die Zauberzeit und Manakosten Eures nächsten Wirkens von 'Blitzschlag', 'Kettenblitzschlag', 'Geringe Welle der Heilung' oder 'Lavaeruption' um 20% verringert werden. Diese Chance ist um 50% erhöht, während Eure Waffenhandwaffe mit 'Waffe des Windzorns' belegt ist, und um weitere 50% erhöht, wenn Ihr eine Zweihandwaffe führt. Bis zu 5-mal stapelbar. Hält 30 sec lang an."},
[409947] = {name = "Erdschild", additional_info = "[q]Erhaltet die Fähigkeit 'Erdschild':\n\n\nSchützt das Ziel mit einem Erdschild, der die Erhöhung der Zauberzeit oder Verringerung der Kanalisierungsdauer durch erlittenen Schaden um 30% verringert und Angriffe das geschützte Ziel um [55 * (29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60) / 100] Gesundheit heilen lässt. Dieser Effekt tritt nur einmal alle paar Sekunden auf. 9 Aufladungen. Hält 10 min lang an. Der Erdschild kann immer nur auf jeweils einem Ziel aktiv sein."},
[409951] = {name = "Geist des Alphas", additional_info = "[q]Erhaltet die Fähigkeit 'Geist des Alphas':\n\n\nErfüllt das Ziel mit dem Geist eines Alphawolfes, was die generierte Bedrohung des Ziels 30 min lang um 45% erhöht. Maximal 1 Ziel. Wenn der Schamane diesen Zauber nicht auf sich selbst wirkt, erhält er 'Treuer Beta', was 30 min lang seinen verursachten körperlichen Schaden um 5% erhöht und jegliche erzeugte Bedrohung um 30% verringert. Ein Ziel kann nicht gleichzeitig mit 'Geist des Alphas' und 'Treuer Beta' belegt sein."},
[409952] = {name = "Lavaeruption", additional_info = "[q]Erhaltet die Fähigkeit 'Lavaeruption':\n\n\nIhr schleudert flüssige Lava auf das Ziel, die [469 / 100 * (7.583798 + 0.471881 * 60 + 0.036599 * 60 * 60)] bis [605 / 100 * (7.583798 + 0.471881 * 60 + 0.036599 * 60 * 60)] Feuerschaden verursacht. Wenn das Ziel von 'Flammenschock' betroffen ist, wird 'Lavaeruption' einen kritischen Treffer erzielen."},
[409953] = {name = "Lavapeitsche", additional_info = "[q]Erhaltet die Fähigkeit 'Lavapeitsche':\n\n\nLädt Eure Schildhandwaffe mit Lava auf, verursacht sofort 100% Waffenschaden der Schildhandwaffe. Der Schaden ist um 125% erhöht, wenn Eure Schildhandwaffe mit 'Flammenzunge' verzaubert ist."},
[409954] = {name = "Springflut", additional_info = "[q]Erhaltet die Fähigkeit 'Springflut':\n\n\nHeilt ein verbündetes Ziel um [113 / 100 * (29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60)] bis [123 / 100 * (29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60)] Gesundheit und im Verlauf von 15 sec um weitere [5 * 24 / 100 * (29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60)] Gesundheit. Euer nächstes Wirken von 'Kettenheilung' innerhalb von 15 sec auf dieses Hauptziel zehrt den regelmäßigen Heileffekt auf und erhöht den von 'Kettenheilung' geheilten Wert um 25%. Dieser Zauber löst außerdem 'Erwachen der Ahnen' aus."},
[409955] = {name = "Weg der Erde", additional_info = "[q]Erhaltet die Fähigkeit 'Weg der Erde':\n\n\nWährend 'Waffe des Felsbeißers' auf Eurer Waffenhand aktiv ist und Ihr einen Schild ausgerüstet habt, erzeugt Ihr 65% mehr Bedrohung, erhaltet 30% mehr Gesundheit, erleidet 10% weniger Schaden. Eure Chance, von Nahkampfangriffen kritisch getroffen zu werden, ist um 6% verringert. Euer 'Erdschock' verspottet Ziele, damit sie Euch angreifen, und hat eine von anderen Schockzaubern getrennte Abklingzeit, aber seine Reichweite wird auf Nahkampfreichweite verringert. Die Reichweite Eurer Zauber 'Blitzschlag', 'Kettenblitzschlag', 'Kettenheilung', 'Welle der Heilung' und 'Lavaeruption' ist jedoch um 20 Meter verringert."},
[409957] = {name = "Zuverlässiger Schuss", additional_info = "[q]Erhaltet die Fähigkeit 'Zuverlässiger Schuss':\n\n\nEin zuverlässiger Schuss, der 100% Schaden mit Distanzwaffen verursacht."},
[409958] = {name = "Meister der Treffsicherheit", additional_info = "[q]Erhaltet die Fähigkeit 'Meister der Treffsicherheit':\n\n\nErhöht Eure kritische Trefferchance um 5% und verringert die Manakosten aller Eurer Schussfähigkeiten um 25%."},
[409959] = {name = "Schwäche aufdecken", additional_info = "[q]Erhaltet die Fähigkeit 'Schwäche aufdecken':\n\n\nEure kritischen Treffer mit Nahkampf- und Distanzangriffen erhöhen 7 sec lang Eure Angriffskraft um 40% Eurer aktuellen Beweglichkeit."},
[409960] = {name = "Kobraschlächter", additional_info = "[q]Erhaltet die Fähigkeit 'Kobraschlächter':\n\n\n'Mungobiss' hat bei jedem Eurer Nahkampfangriffe eine Chance von 5%, aktiviert zu werden, sowie eine Chance von 100%, wenn der Gegner ausweicht. Diese Chance sammelt sich an und steigt durch jeden Angriff in Folge, bei dem sie nicht zurückgesetzt wird, um 5%. 'Mungobiss' verursacht zusätzlichen Schaden in Höhe von 40% Eurer Angriffskraft."},
[409961] = {name = "Beidhändigkeitsspezialisierung", additional_info = "[q]Erhaltet die Fähigkeit 'Beidhändigkeitsspezialisierung':\n\n\nErhöht den von Eurer Schildhandwaffe verursachten Schaden um 50% und führt dazu, dass Euer 'Raptorstoß' mit beiden Waffen trifft, wenn Ihr beidhändig kämpft."},
[409962] = {name = "Meister der Tiere", additional_info = "[q]Erhaltet die Fähigkeit 'Meister der Tiere':\n\n\nErhöht Schaden und Gesundheit Eures Tiers um 10% und seine Fokusregeneration um 50%. Außerdem verspottet das 'Knurren' Eures Tiers das Ziel 3 sec lang."},
[409963] = {name = "Geist beschwören", additional_info = nil},
[409968] = {name = "Fallenschleuder", additional_info = "[q]Erhaltet die Fähigkeit 'Fallenschleuder':\n\n\nEure Eiskältefallen, Feuerbrandfallen und Sprengfallen können jetzt an jedem Ort innerhalb von 35 Metern ausgelegt werden. Außerdem haben Eure feuer- und frostbasierten Fallen jetzt getrennte gemeinsame Abklingzeiten."},
[409974] = {name = "Tödlicher Schuss", additional_info = "[q]Erhaltet die Fähigkeit 'Tödlicher Schuss':\n\n\nIhr versucht, ein verletztes Ziel mit einem Distanzangriff zu töten, der 100% Waffenschaden plus [113 / 100 * 100 / 100 * (2.976264 + 0.641066 * 60 + 0.022519 * 60 * 60)] verursacht. 'Tödlicher Schuss' hat keine Minimaldistanz, und seine Abklingzeit wird zurückgesetzt, wenn er gegen einen Gegner mit 20% oder weniger Gesundheit eingesetzt wird."},
[409976] = {name = "Schimärenschuss", additional_info = "[q]Erhaltet die Fähigkeit 'Schimärenschuss':\n\n\nVerursacht 135% Waffenschaden, erneuert die Dauer des auf das Ziel wirkenden Stiches oder Bisses und löst einen Effekt aus:\n\n Schlangenbiss - Verursacht sofort 48% des von Eurem Schlangenbiss verursachten Schadens.\n\n Vipernbiss - Stellt sofort 60% des von Eurem Vipernbiss abgezogenen Manas bei Euch wieder her.\n\n Skorpidstich - Versucht, das Ziel 10 sec lang zu entwaffnen. Dieser Effekt kann nur einmal pro Minute auftreten."},
[409978] = {name = "Explosivschuss", additional_info = "[q]Erhaltet die Fähigkeit 'Explosivschuss':\n\n\nFeuert ein Explosivgeschoss in das gegnerische Ziel, das allen Gegnern innerhalb von 8 Metern [Ranged attack power * 0.039 + 62 / 100 * (2.976264 + 0.641066 * 60 + 0.022519 * 60 * 60)] bis [Ranged attack power * 0.039 + 94 / 100 * (2.976264 + 0.641066 * 60 + 0.022519 * 60 * 60)] Feuerschaden zufügt. Die Sprengladung verursacht 2 sec lang pro Sekunde weiteren Schaden."},
[409979] = {name = "Einsamer Wolf", additional_info = "[q]Erhaltet die Fähigkeit 'Einsamer Wolf':\n\n\nIhr verursacht mit allen Angriffen 30% mehr Schaden, während Ihr kein Tier aktiviert habt."},
[409988] = {name = "Spielercharakter zum Wirken von 'Verzögerte Verbannung' zwingen", additional_info = nil},
[409999] = {name = "Handschuhe prägen - Flamme des Glaubens", additional_info = "Wirken in 3 sek.\nBenötigt Handschuhe\n[q]Prägt Eure Handschuhe mit der Rune 'Flamme des Glaubens':\n\n\nDas Ziel wird für alle Gruppen- und Schlachtzugsmitglieder in einem Radius von 40 Metern zu einer Flamme des Glaubens. Alle auf diese Mitglieder gewirkten Heilungen heilen auch die Flamme um 100% der gewirkten Heilung. Es kann immer nur ein Ziel zur gleichen Zeit eine Flamme des Glaubens sein. Hält 1 hour lang an."},
[410001] = {name = "Handschuhe prägen - Hand der Abrechnung", additional_info = "Wirken in 3 sek.\nBenötigt Handschuhe\n[q]Prägt Eure Handschuhe mit der Rune 'Hand der Abrechnung':\n\n\nVerspottet das Ziel, damit es Euch angreift. Hat keinen Effekt, wenn Ihr von dem Ziel bereits angegriffen werdet.\n\n Während Ihr diese Fähigkeit kennt, ist der Bedrohungsbonus von 'Zorn der Gerechtigkeit' auf 80% erhöht. Wenn Ihr von anderen Charakteren geheilt werdet, sorgt 'Zorn der Gerechtigkeit' dafür, dass Ihr Mana in Höhe von 25% der hervorgerufenen Heilung erhaltet. Zusätzlich wird Schaden, der Eure Gesundheit unter 35% senkt, um 20% verringert, während 'Zorn der Gerechtigkeit' aktiv ist. 'Zorn der Gerechtigkeit' bleibt aktiv, bis er abgebrochen wird."},
[410002] = {name = "Handschuhe prägen - Kreuzfahrerstoß", additional_info = "Wirken in 3 sek.\nBenötigt Handschuhe\n[q]Prägt Eure Handschuhe mit der Rune 'Kreuzfahrerstoß':\n\n\nEin sofortiger Stoß, der 75% Waffenschaden als Heiligschaden verursacht und 5% Eures maximalen Manas regeneriert. Die Dauer aller Richturteilseffekte auf dem Ziel wird auf 30 Sek. zurückgesetzt."},
[410005] = {name = "Hosen prägen - Aurenmeisterschaft", additional_info = "Wirken in 3 sek.\nBenötigt Hosen\n[q]Prägt Eure Hosen mit der Rune 'Aurenmeisterschaft':\n\n\nVerleiht allen durch Eure Fähigkeit 'Aura der Konzentration' gestärkten Zielen Immunität gegen Unterbrechungs- und Stilleeffekte. Die Effekte aller anderen Auren werden um 100% erhöht. Hält 6 sec lang an."},
[410008] = {name = "Hosen prägen - Schild des Rächers", additional_info = "Wirken in 3 sek.\nBenötigt Hosen\n[q]Prägt Eure Hosen mit der Rune 'Schild des Rächers':\n\n\nSchleudert einen heiligen Schild auf den Gegner, der [366 * (9.046514 + 0.676562 * 60 + 0.019349 * 60 * 60) / 100 + 0.091 * Spell power + 0.091 * Attack power] bis [448 * (9.046514 + 0.676562 * 60 + 0.019349 * 60 * 60) / 100 + 0.091 * Spell power + 0.091 * Attack power] Heiligschaden verursacht, ihn benommen macht und dann auf weitere Gegner in der Nähe überspringt. Wirkt auf insgesamt 3 Ziele. Hält 5 sec lang an."},
[410010] = {name = "Hosen prägen - Hand der Aufopferung", additional_info = "Wirken in 3 sek.\nBenötigt Hosen\n[q]Prägt Eure Hosen mit der Rune 'Hand der Aufopferung':\n\n\nLässt das anvisierte Gruppen- oder Schlachtzugsmitglied pro Treffer 30% des erlittenen Schadens auf den Zaubernden übertragen. Hält 12 sec lang an oder bis Schaden in Höhe von 100% der maximalen Gesundheit des Zaubernden übertragen wurde."},
[410011] = {name = "Hosen prägen - Inspirationsvorbild", additional_info = "Wirken in 3 sek.\nBenötigt Hosen\n[q]Prägt Eure Hosen mit der Rune 'Inspirationsvorbild':\n\n\nEure inspirierende Präsenz bannt regelmäßig Furcht- und Schlafeffekte von Gruppenmitgliedern in der Nähe."},
[410013] = {name = "Armschienen prägen - Hammer der Rechtschaffenen", additional_info = "Wirken in 3 sek.\nBenötigt Armschienen\n[q]Prägt Eure Armschienen mit der Rune 'Hammer der Rechtschaffenen':\n\n\nTrifft das aktuelle Ziel sowie bis zu 2 zusätzliche Ziele in der Nähe und verursacht pro Sekunde den 3-fachen Schaden Eurer Waffenhandwaffe als Heiligschaden."},
[410014] = {name = "Brustteil prägen - Göttlicher Sturm", additional_info = "Wirken in 3 sek.\nBenötigt Brust, Brust\n[q]Prägt Euer Brustteil mit der Rune 'Göttlicher Sturm':\n\n\nEin sofortiger Waffenangriff, der bis zu 4 Gegnern innerhalb von 8 Metern 110% Waffenschaden zufügt. 'Göttlicher Sturm' heilt bis zu 3 Gruppen- oder Schlachtzugsmitglieder in Höhe von 25% des verursachten Schadens."},
[410015] = {name = "Umhang prägen - Göttliches Licht", additional_info = "Wirken in 3 sek.\nBenötigt Umhang"},
[410021] = {name = "Brustteil prägen - Wilde Stöße", additional_info = "Wirken in 3 sek.\nBenötigt Brust, Brust\n[q]Prägt Euer Brustteil oder Eure Robe mit der Rune 'Wilde Stöße':\n\n\nWährend Ihr in Katzengestalt, Bärengestalt oder Terrorbärengestalt seid, erlangen Gruppen- oder Schlachtzugsmitglieder im Umkreis von 100 Metern erhöhte Kampfwildheit. Bei jedem Nahkampftreffer besteht eine Chance von 20%, dem Angreifer einen Zusatzangriff mit 20% höherer Angriffskraft zu gewähren. Kein Effekt, wenn das Ziel bereits vom Totem des Windzorns profitiert."},
[410023] = {name = "Hosen prägen - Wildes Brüllen", additional_info = "Wirken in 3 sek.\nBenötigt Hosen\n[q]Prägt Eure Hosen mit der Rune 'Wildes Brüllen':\n\n\nFinishing-Move, der den verursachten körperlichen Schaden in Katzengestalt um 30% erhöht. Hält pro Combopunkt länger an:\n 1 Punkt: 14 Sek.\n 2 Punkte: 19 Sek.\n 3 Punkte: 24 Sek.\n 4 Punkte: 29 Sek.\n 5 Punkte: 34 Sek."},
[410025] = {name = "Handschuhe prägen - Zerfleischen", additional_info = "Wirken in 3 sek.\nBenötigt Handschuhe\n[q]Prägt Eure Handschuhe mit der Rune 'Zerfleischen':\n\n\nZerfleischt das Ziel, fügt ihm 160% des normalen Schadens zu und lässt es 1 min lang 30% zusätzlichen Schaden durch Blutungseffekte und 'Schreddern' erleiden. Diese Fähigkeit profitiert von allen Effekten von 'Klaue' und 'Zermalmen' und löst diese aus.\n\n Wenn Ihr ein Ziel mit 'Zerfleischen (Bär)' trefft, erhaltet Ihr zudem 4 Angriffskraft für jeden Punkt Eurer Verteidigungsfertigkeit über ( 60 * 5). Hält 15 sec lang an."},
[410027] = {name = "Stiefel prägen - Überlebensinstinkte", additional_info = "Wirken in 3 sek.\nBenötigt Stiefel\n[q]Prägt Eure Stiefel mit der Rune 'Überlebensinstinkte':\n\n\nNach Aktivierung erhaltet Ihr 20 sec lang 30% Eurer maximalen Gesundheit. Während dieser Zeit wird zudem sämtliche von Euch hervorgerufene nichtkörperliche Heilung um 20% erhöht. Nachdem der Effekt abgelaufen ist, geht die Gesundheit verloren. Kann in jeder Gestalt eingesetzt werden.\n\n Zusätzlich regeneriert Ihr bei jedem Ausweichen in Bärengestalt oder Terrorbärengestalt 5 Wut, in Katzengestalt 10 Energie oder in jeder anderen Gestalt 1% Eures maximalen Manas."},
[410028] = {name = "Handschuhe prägen - Wildwuchs", additional_info = "Wirken in 3 sek.\nBenötigt Handschuhe\n[q]Prägt Eure Handschuhe mit der Rune 'Wildwuchs':\n\n\nHeilt alle Gruppenmitglieder des anvisierten Spielercharakters innerhalb von 43.5 Metern um ihn herum im Verlauf von 7 sec um [17 / 100 * 7 * (38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60)] Gesundheit. Die Heilung wird zunächst schnell und mit zunehmender Dauer von 'Wildwuchs' langsamer angewendet."},
[410029] = {name = "Gürtel prägen - Finsternis", additional_info = "Wirken in 3 sek.\nBenötigt Gürtel\n[q]Prägt Euren Gürtel mit der Rune 'Finsternis':\n\n\n'Sternenfeuer' erhöht die Chance auf kritische Treffer bei Euren nächsten beiden Einsätzen von 'Zorn' um 30%, und 'Zorn' verringert die Zauberzeit Eures nächsten Einsatzes von 'Sternenfeuer' um 1.0 Sek. Beide Effekte lassen sich bis zu 4-mal stapeln. Bei beiden Zaubern besteht außerdem jederzeit eine Chance von 70%, dass Ihr keine Zauberzeit verliert, wenn Ihr Schaden erleidet."},
[410033] = {name = "Hosen prägen - Blühendes Leben", additional_info = "Wirken in 3 sek.\nBenötigt Hosen\n[q]Prägt Eure Hosen mit der Rune 'Blühendes Leben':\n\nVerringert die globale Abklingzeit Eurer Fähigkeiten 'Verjüngung' und 'Blühendes Leben' um 0.5 Sek. und Ihr erhaltet die Fähigkeit 'Blühendes Leben':\n\n\nHeilt das Ziel im Verlauf von 7 sec um [4 / 100 * 7 * (38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60)] Gesundheit. Wenn 'Blühendes Leben' endet oder gebannt wird, wird das Ziel sofort um [57 / 100 * (38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60)] Gesundheit geheilt und der Druide erhält die Hälfte der Zauberkosten erstattet. Dieser Effekt ist bis zu 3-mal auf einem Ziel stapelbar."},
[410059] = {name = "Gürtel prägen - Pflege", additional_info = "Wirken in 3 sek.\nBenötigt Gürtel\n[q]Prägt Euren Gürtel mit der Rune 'Pflege':\n\n\nHeilt ein verbündetes Ziel um [161 / 100 * (38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60)] bis [189 / 100 * (38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60)] Gesundheit. Wenn ein durch Euch gewirkter Effekt von 'Verjüngung', 'Nachwachsen', 'Wildwuchs' oder 'Blühendes Leben' auf dem Ziel aktiv ist, erhöht sich die Heilung um zusätzliche 20%. Dieser Zauber profitiert von allen Effekten von 'Heilende Berührung' oder 'Nachwachsen' und löst diese aus."},
[410060] = {name = "Stiefel prägen - Traumzustand", additional_info = "Wirken in 3 sek.\nBenötigt Stiefel\n[q]Prägt Eure Stiefel mit der Rune 'Traumzustand':\n\n\nKritische Treffer Eurer nicht regelmäßigen Schadenszauber und jeglicher Schaden von Eurem 'Sternensog' gewähren Euch 8 sec lang 50% Manaregeneration, während Ihr Zauber wirkt. Der Eurem Ziel zugefügte Arkan- und Naturschaden wird außerdem 12 sec lang um 20% erhöht."},
[410061] = {name = "Brustteil prägen - Furor von Sturmgrimm", additional_info = "Wirken in 3 sek.\nBenötigt Brust, Brust\n[q]Prägt Euer Brustteil oder Eure Robe mit der Rune 'Furor von Sturmgrimm':\n\n\nVerringert die Manakosten von 'Zorn' um 100%. Jedes Mal, wenn Ihr Schaden mit 'Zorn' verursacht, besteht eine Chance von 12%, dass Eure nächste 'Heilende Berührung' innerhalb von 15 sec ein Spontanzauber ist und in allen Gestaltwandelgestalten einsetzbar ist. Erlaubt in Baum-des-Lebens-Gestalt 'Zorn' zu zaubern."},
[410093] = {name = "Gürtel prägen - Feuernova", additional_info = "Wirken in 3 sek.\nBenötigt Gürtel\n[q]Prägt Euren Gürtel mit der Rune 'Feuernova':\n\n\nEuer Totem der Feuernova wird durch 'Feuernova' ersetzt. Dadurch verursacht Euer derzeitiges Feuertotem Schaden an seinem Standort."},
[410094] = {name = "Brustteil prägen - Überladung", additional_info = "Wirken in 3 sek.\nBenötigt Brust, Brust\n[q]Prägt Euer Brustteil oder Eure Robe mit der Rune 'Überladung':\n\n\nVerleiht Euren Zaubern 'Blitzschlag', 'Kettenblitzschlag', 'Kettenheilung', 'Welle der Heilung' und 'Lavaeruption' eine Chance von 50%, kostenlos einen zweiten, ähnlichen Zauber auf das gleiche Ziel auszulösen. Dieser verursacht nur halben Schaden bzw. halbe Heilung und erzeugt keine Bedrohung."},
[410095] = {name = "Handschuhe prägen - Lavaeruption", additional_info = "Wirken in 3 sek.\nBenötigt Handschuhe\n[q]Prägt Eure Handschuhe mit der Rune 'Lavaeruption':\n\n\nIhr schleudert flüssige Lava auf das Ziel, die [469 / 100 * (7.583798 + 0.471881 * 60 + 0.036599 * 60 * 60)] bis [605 / 100 * (7.583798 + 0.471881 * 60 + 0.036599 * 60 * 60)] Feuerschaden verursacht. Wenn das Ziel von 'Flammenschock' betroffen ist, wird 'Lavaeruption' einen kritischen Treffer erzielen."},
[410096] = {name = "Brustteil prägen - Beidhändigkeitsspezialisierung", additional_info = "Wirken in 3 sek.\nBenötigt Brust, Brust\n[q]Prägt Euer Brustteil oder Eure Robe mit der Rune 'Beidhändigkeitsspezialisierung':\n\n\nErhöht beim beidhändigen Führen Eure Chance, mit Zaubern und Nahkampfangriffen Treffer zu landen, um 5%. Außerdem trifft Eure Fähigkeit 'Sturmschlag' jetzt mit beiden Waffen, wenn Ihr beidhändig führt, und erhöht den verursachten Schaden Eurer Schildhandwaffe um 50%."},
[410097] = {name = "Handschuhe prägen - Wasserschild", additional_info = "Wirken in 3 sek.\nBenötigt Handschuhe\n[q]Prägt Eure Handschuhe mit der Rune 'Wasserschild':\n\n\nDer Zaubernde wird von 3 Wasserkugeln umgeben, die alle 5 Sek. 1% Eures maximalen Manas gewähren. Trifft ein Zauber-, Nahkampf- oder Distanzangriff den Zaubernden, werden 4% seines maximalen Manas wiederhergestellt und eine Wasserkugel wird aufgelöst. Alle paar Sekunden kann nur eine Wasserkugel aktiviert werden. Hält 10 min lang an. Es kann immer nur ein Elementarschild auf dem Schamanen aktiv sein."},
[410098] = {name = "Brustteil prägen - Schildmeisterschaft", additional_info = "Wirken in 3 sek.\nBenötigt Brust, Brust\n[q]Prägt Euer Brustteil oder Eure Robe mit der Rune 'Schildmeisterschaft':\n\n\nJedes Mal, wenn Ihr blockt, regeneriert Ihr Mana in Höhe von 8% Eures maximalen Manas und erhaltet Rüstung in der Höhe von 30% des Rüstungswertes Eures Schildes. Bis zu 5-mal stapelbar. Ihr erhaltet außerdem immer eine um 10% erhöhte Blockchance und einen um 15% erhöhten Blockwert.\n\n Außerdem erhaltet Ihr immer, wenn Ihr eine Schockfähigkeit einsetzt, 2 Zauberschaden pro Punkt Eurer Verteidigungsfertigkeit, der über ( 60 * 5) hinausgeht. Hält 15 sec lang an."},
[410099] = {name = "Hosen prägen - Führung der Ahnen", additional_info = "Wirken in 3 sek.\nBenötigt Hosen\n[q]Prägt Eure Hosen mit der Rune 'Führung der Ahnen':\n\n\nFür die nächsten 10 sec werden 25% Eures Schadens in Heilung für bis zu 3 Gruppenmitglieder in der Nähe umgewandelt. 100% Eurer Heilung werden in Schaden umgewandelt und dem letzten Ziel von Eurem 'Flammenschock' zugefügt."},
[410100] = {name = "Gürtel prägen - Waffe des Mahlstroms", additional_info = "Wirken in 3 sek.\nBenötigt Gürtel\n[q]Prägt Euren Gürtel mit der Rune 'Waffe des Mahlstroms':\n\n\nWenn Ihr mit einem Nahkampfangriff Schaden verursacht, besteht eine Chance, dass die Zauberzeit und Manakosten Eures nächsten Wirkens von 'Blitzschlag', 'Kettenblitzschlag', 'Geringe Welle der Heilung' oder 'Lavaeruption' um 20% verringert werden. Diese Chance ist um 50% erhöht, während Eure Waffenhandwaffe mit 'Waffe des Windzorns' belegt ist, und um weitere 50% erhöht, wenn Ihr eine Zweihandwaffe führt. Bis zu 5-mal stapelbar. Hält 30 sec lang an."},
[410101] = {name = "Hosen prägen - Erdschild", additional_info = "Wirken in 3 sek.\nBenötigt Hosen\n[q]Prägt Eure Hosen mit der Rune 'Erdschild':\n\n\nSchützt das Ziel mit einem Erdschild, der die Erhöhung der Zauberzeit oder Verringerung der Kanalisierungsdauer durch erlittenen Schaden um 30% verringert und Angriffe das geschützte Ziel um [55 * (29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60) / 100] Gesundheit heilen lässt. Dieser Effekt tritt nur einmal alle paar Sekunden auf. 9 Aufladungen. Hält 10 min lang an. Der Erdschild kann immer nur auf jeweils einem Ziel aktiv sein."},
[410103] = {name = "Stiefel prägen - Geist des Alphas", additional_info = "Wirken in 3 sek.\nBenötigt Stiefel\n[q]Prägt Eure Stiefel mit der Rune 'Geist des Alphas':\n\n\nErfüllt das Ziel mit dem Geist eines Alphawolfes, was die generierte Bedrohung des Ziels 30 min lang um 45% erhöht. Maximal 1 Ziel. Wenn der Schamane diesen Zauber nicht auf sich selbst wirkt, erhält er 'Treuer Beta', was 30 min lang seinen verursachten körperlichen Schaden um 5% erhöht und jegliche erzeugte Bedrohung um 30% verringert. Ein Ziel kann nicht gleichzeitig mit 'Geist des Alphas' und 'Treuer Beta' belegt sein."},
[410104] = {name = "Handschuhe prägen - Lavapeitsche", additional_info = "Wirken in 3 sek.\nBenötigt Handschuhe\n[q]Prägt Eure Handschuhe mit der Rune 'Lavapeitsche':\n\n\nLädt Eure Schildhandwaffe mit Lava auf, verursacht sofort 100% Waffenschaden der Schildhandwaffe. Der Schaden ist um 125% erhöht, wenn Eure Schildhandwaffe mit 'Flammenzunge' verzaubert ist."},
[410105] = {name = "Armschienen prägen - Springflut", additional_info = "Wirken in 3 sek.\nBenötigt Armschienen\n[q]Prägt Eure Armschienen mit der Rune 'Springflut':\n\n\nHeilt ein verbündetes Ziel um [113 / 100 * (29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60)] bis [123 / 100 * (29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60)] Gesundheit und im Verlauf von 15 sec um weitere [5 * 24 / 100 * (29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60)] Gesundheit. Euer nächstes Wirken von 'Kettenheilung' innerhalb von 15 sec auf dieses Hauptziel zehrt den regelmäßigen Heileffekt auf und erhöht den von 'Kettenheilung' geheilten Wert um 25%. Dieser Zauber löst außerdem 'Erwachen der Ahnen' aus."},
[410107] = {name = "Hosen prägen - Weg der Erde", additional_info = "Wirken in 3 sek.\nBenötigt Hosen\n[q]Prägt Eure Hosen mit der Rune 'Weg der Erde':\n\n\nWährend 'Waffe des Felsbeißers' auf Eurer Waffenhand aktiv ist und Ihr einen Schild ausgerüstet habt, erzeugt Ihr 65% mehr Bedrohung, erhaltet 30% mehr Gesundheit, erleidet 10% weniger Schaden. Eure Chance, von Nahkampfangriffen kritisch getroffen zu werden, ist um 6% verringert. Euer 'Erdschock' verspottet Ziele, damit sie Euch angreifen, und hat eine von anderen Schockzaubern getrennte Abklingzeit, aber seine Reichweite wird auf Nahkampfreichweite verringert. Die Reichweite Eurer Zauber 'Blitzschlag', 'Kettenblitzschlag', 'Kettenheilung', 'Welle der Heilung' und 'Lavaeruption' ist jedoch um 20 Meter verringert."},
[410109] = {name = "Gürtel prägen - Zuverlässiger Schuss", additional_info = "Wirken in 3 sek.\nBenötigt Gürtel\n[q]Prägt Euren Gürtel mit der Rune 'Zuverlässiger Schuss':\n\n\nEin zuverlässiger Schuss, der 100% Schaden mit Distanzwaffen verursacht."},
[410110] = {name = "Brustteil prägen - Meister der Tiere", additional_info = "Wirken in 3 sek.\nBenötigt Brust, Brust\n[q]Prägt Euer Brustteil oder Eure Robe mit der Rune 'Meister der Tiere':\n\n\nErhöht Schaden und Gesundheit Eures Tiers um 10% und seine Fokusregeneration um 50%. Außerdem verspottet das 'Knurren' Eures Tiers das Ziel 3 sec lang."},
[410111] = {name = "Hosen prägen - Tödlicher Schuss", additional_info = "Wirken in 3 sek.\nBenötigt Hosen\n[q]Prägt Eure Hosen mit der Rune 'Tödlicher Schuss':\n\n\nIhr versucht, ein verletztes Ziel mit einem Distanzangriff zu töten, der 100% Waffenschaden plus [113 / 100 * 100 / 100 * (2.976264 + 0.641066 * 60 + 0.022519 * 60 * 60)] verursacht. 'Tödlicher Schuss' hat keine Minimaldistanz, und seine Abklingzeit wird zurückgesetzt, wenn er gegen einen Gegner mit 20% oder weniger Gesundheit eingesetzt wird."},
[410113] = {name = "Brustteil prägen - Meister der Treffsicherheit", additional_info = "Wirken in 3 sek.\nBenötigt Brust, Brust\n[q]Prägt Euer Brustteil oder Eure Robe mit der Rune 'Meister der Treffsicherheit':\n\n\nErhöht Eure kritische Trefferchance um 5% und verringert die Manakosten aller Eurer Schussfähigkeiten um 25%."},
[410114] = {name = "Gürtel prägen - Schwäche aufdecken", additional_info = "Wirken in 3 sek.\nBenötigt Gürtel\n[q]Prägt Euren Gürtel mit der Rune 'Schwäche aufdecken':\n\n\nEure kritischen Treffer mit Nahkampf- und Distanzangriffen erhöhen 7 sec lang Eure Angriffskraft um 40% Eurer aktuellen Beweglichkeit."},
[410115] = {name = "Kobraschlächter", additional_info = "Wirken in 3 sek.\nBenötigt Handschuhe\n[q]Prägt Eure Handschuhe mit der Rune 'Kobraschlächter':\n\n\n'Mungobiss' hat bei jedem Eurer Nahkampfangriffe eine Chance von 5%, aktiviert zu werden, sowie eine Chance von 100%, wenn der Gegner ausweicht. Diese Chance sammelt sich an und steigt durch jeden Angriff in Folge, bei dem sie nicht zurückgesetzt wird, um 5%. 'Mungobiss' verursacht zusätzlichen Schaden in Höhe von 40% Eurer Angriffskraft."},
[410116] = {name = "Stiefel prägen - Beidhändigkeitsspezialisierung", additional_info = "Wirken in 3 sek.\nBenötigt Stiefel\n[q]Prägt Eure Stiefel mit der Rune 'Beidhändigkeitsspezialisierung':\n\n\nErhöht den von Eurer Schildhandwaffe verursachten Schaden um 50% und führt dazu, dass Euer 'Raptorstoß' mit beiden Waffen trifft, wenn Ihr beidhändig kämpft."},
[410118] = {name = "Stiefel prägen - Fallenschleuder", additional_info = "Wirken in 3 sek.\nBenötigt Stiefel\n[q]Prägt Eure Stiefel mit der Rune 'Fallenschleuder':\n\n\nEure Eiskältefallen, Feuerbrandfallen und Sprengfallen können jetzt an jedem Ort innerhalb von 35 Metern ausgelegt werden. Außerdem haben Eure feuer- und frostbasierten Fallen jetzt getrennte gemeinsame Abklingzeiten."},
[410121] = {name = "Handschuhe prägen - Schimärenschuss", additional_info = "Wirken in 3 sek.\nBenötigt Handschuhe\n[q]Prägt Eure Handschuhe mit der Rune 'Schimärenschuss':\n\n\nVerursacht 135% Waffenschaden, erneuert die Dauer des auf das Ziel wirkenden Stiches oder Bisses und löst einen Effekt aus:\n\n Schlangenbiss - Verursacht sofort 48% des von Eurem Schlangenbiss verursachten Schadens.\n\n Vipernbiss - Stellt sofort 60% des von Eurem Vipernbiss abgezogenen Manas bei Euch wieder her.\n\n Skorpidstich - Versucht, das Ziel 10 sec lang zu entwaffnen. Dieser Effekt kann nur einmal pro Minute auftreten."},
[410122] = {name = "Brustteil prägen - Einsamer Wolf", additional_info = "Wirken in 3 sek.\nBenötigt Brust, Brust\n[q]Prägt Euer Brustteil oder Eure Robe mit der Rune 'Einsamer Wolf':\n\n\nIhr verursacht mit allen Angriffen 30% mehr Schaden, während Ihr kein Tier aktiviert habt."},
[410123] = {name = "Handschuhe prägen - Explosivschuss", additional_info = "Wirken in 3 sek.\nBenötigt Handschuhe\n[q]Prägt Eure Handschuhe mit der Rune 'Explosivschuss':\n\n\nFeuert ein Explosivgeschoss in das gegnerische Ziel, das allen Gegnern innerhalb von 8 Metern [Ranged attack power * 0.039 + 62 / 100 * (2.976264 + 0.641066 * 60 + 0.022519 * 60 * 60)] bis [Ranged attack power * 0.039 + 94 / 100 * (2.976264 + 0.641066 * 60 + 0.022519 * 60 * 60)] Feuerschaden zufügt. Die Sprengladung verursacht 2 sec lang pro Sekunde weiteren Schaden."},
[410140] = {name = "Spinnengift", additional_info = nil},
[410156] = {name = "Sturmschlag", additional_info = "Unbegrenzte Reichweite\nSofort\n[q]Gewährt Euch einen zusätzlichen Angriff. Zusätzlich werden die nächsten 2 Quellen des Naturschadens, der dem Ziel zugefügt wird, um 20% erhöht. Hält 12 sec lang an."},
