[411624] = {name = "Wildtier zähmen", additional_info = "30 Meter Reichweite\nSofort\n[q]Beginnt mit dem Zähmen eines Wildtiers, damit es Euer Begleiter wird. Eure Rüstung ist um 100% verringert, während Ihr Euch 20 sec lang auf das Zähmen des Wildtiers fokussiert. Falls Ihr die Aufmerksamkeit des Wildtiers aus irgendeinem Grund verlieren solltet, schlägt der Vorgang der Zähmung fehl. Nachdem das Wildtier gezähmt ist, wird es sehr unzufrieden und nicht loyal sein. Füttert das Tier sofort, um es zufriedenzustellen."},
[411631] = {name = "Wildtier zähmen", additional_info = "{60% von Grundmana} {30 Meter Reichweite}\nKanalisiert (Wirken in 20 sek.)\n[q]Beginnt mit dem Zähmen eines Wildtiers, damit es Euer Begleiter wird. Eure Rüstung ist um 100% verringert, während Ihr Euch 20 sec lang auf das Zähmen des Wildtiers fokussiert. Falls Ihr die Aufmerksamkeit des Wildtiers aus irgendeinem Grund verlieren solltet, schlägt der Vorgang der Zähmung fehl. Nachdem das Wildtier gezähmt ist, wird es sehr unzufrieden und nicht loyal sein. Füttert das Tier sofort, um es zufriedenzustellen."},
