[412018] = {name = "Geheiligter Schild", additional_info = "Unbegrenzte Reichweite\nSofort\n[q]Jedes Mal, wenn das Ziel Schaden erleidet, wird es von einem geheiligten Schild umhüllt, der 36 Schaden absorbiert und die Chance des Paladins, mit 'Lichtblitz' einen kritischen Treffer zu erzielen, 6 sec lang um 50% erhöht. Dieser Effekt kann nur einmal alle 6 Sek. auftreten. Hält 6 sec lang an."},
[412019] = {name = "Geheiligter Schild", additional_info = "{12% von Grundmana} {40 Meter Reichweite}\nSofort\n[q]Jedes Mal, wenn das Ziel Schaden erleidet, wird es von einem geheiligten Schild umhüllt, der [36 * (38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) / 100] Schaden absorbiert und die Chance des Paladins, mit 'Lichtblitz' einen kritischen Treffer zu erzielen, bis zu 6 sec lang um 50% erhöht. Zusätzlich heilen Eure Einsätze von 'Lichtblitz' Ziele mit 'Geheiligter Schild' im Verlauf von 12 sec um weitere 100% Gesundheit. Dieser Effekt kann nur einmal alle 6 Sek. auftreten. Hält 1 min lang an. Es kann immer nur jeweils ein Ziel mit diesem Zauber belegt sein."},
