[412115] = {name = "Fortgeschrittener Schutzzauber", additional_info = "[q]Eure Zauber 'Manaschild', 'Frostzauberschutz' und 'Feuerzauberschutz' können jetzt auf verbündete Ziele gewirkt werden und absorbieren 100% mehr Schaden. 'Manaschild' verbraucht 50% weniger Mana pro absorbiertem Schaden. Außerdem wird 'Geringen Fluch aufheben' durch 'Großen Fluch aufheben' ersetzt.\n\n\nEntfernt 1 Fluch und 1 schädlichen Magieeffekt von einem verbündeten Ziel."},
[412116] = {name = "Manaschild", additional_info = "{40 Mana} {40 Meter Reichweite}\nSofort\n[q]Absorbiert 240 körperlichen Schaden bei einem verbündeten Ziel und entzieht stattdessen Mana. Entzieht dem Zaubernden 1 Mana pro absorbiertem Schaden. Hält 1 min lang an."},
