[412437] = {name = "Wasserblitz", additional_info = "{1% von Grundmana} {45 Meter Reichweite}\nWirken in 2.5 sek.\n[q]Schleudert einen Frostblitz auf den Gegner, der [208 / 100 * (13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60)] bis [268 / 100 * (13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60)] Frostschaden verursacht."},
