[412507] = {name = "Blutraserei", additional_info = "[q]'Verwunden' kann jetzt in der Berserker-Stellung eingesetzt werden. Der Schaden von 'Verwunden' wird um 100% erhöht, und 'Verwunden' verursacht jedes Mal, wenn es Schaden verursacht, zusätzlichen Schaden in Höhe von 3% Eurer Angriffskraft."},
[412510] = {name = "Massenregeneration", additional_info = "{45% von Grundmana} {40 Meter Reichweite}\n{Kanalisiert (Wirken in} {3 sek.) 6 sek. Abklingzeit}\n[q]Heilt alle verbündeten Gruppenmitglieder des anvisierten Spielercharakters innerhalb von 43.5 Metern um den anvisierten Spielercharakter im Verlauf von 3 sec um [(38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) * 42 / 100 * 3] Gesundheit und belegt jedes Ziel für 15 Sek. mit 'Zeitenleuchtfeuer'.\n\n Zeitenleuchtfeuer\n\nErfasst die raumzeitliche Position des Subjekts. 80% sämtlichen Arkanschadens, den der Zaubernde verursacht hat, werden für alle aktuellen Ziele von 'Zeitenleuchtfeuer' des Zaubernden in chronomantische Heilung umgewandelt. Diese Heilung ist für den Zaubernden selbst um 50% verringert und wird zudem um 80% verringert, wenn durch arkane Zauber, die mehrere Ziele gleichzeitig treffen, Schaden verursacht wird."},
[412513] = {name = "Gladiatorhaltung", additional_info = "{Sofort} {1 sek. Abklingzeit}\n[q]Eine aggressive Haltung, die beim Tragen eines Schildes den Schaden um 10% und die Blockchance um 10% erhöht, dabei jedoch die Rüstung um 30% und die erzeugte Bedrohung um 30% verringert. Zusätzlich erhaltet Ihr 50% mehr Wut, wenn Eure Nahkampfangriffe einem Gegner Schaden zufügen, der Euch nicht als Ziel hat.\n\n Während Ihr in der 'Gladiatorhaltung' einen Schild tragt, könnt Ihr sämtliche Fähigkeiten einsetzen, die auf andere Haltungen beschränkt sind."},
[412526] = {name = "Gedankenschinden", additional_info = "Unbegrenzte Reichweite\nKanalisiert (Wirken in 10 sek.)\n[q]Fügt einem Gegner Schattenschaden zu und verringert 10 sec lang seine Bewegungsgeschwindigkeit."},
