[412532] = {name = "Zauberfrostblitz", additional_info = "{12% von Grundmana} {30 Meter Reichweite}\nWirken in 2.5 sek.\n[q]Schleudert einen Zauberfrostblitz auf den Gegner, der [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 305 / 100 * ( 1 ) ] bis [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 355 / 100 * ( 1 ) ] Zauberfrostschaden verursacht und seine Bewegungsgeschwindigkeit 9 sec lang um 40% verringert. Der Schaden dieses Zaubers wird gegen den jeweils geringeren Frost- oder Arkanwiderstandswert des Ziels gerechnet und zählt sowohl als Frost- als auch als Arkanschaden."},
