[412727] = {name = "Dämonische Taktiken", additional_info = "[q]Erhöht die Chance für einen kritischen Nahkampf- oder Zaubertreffer von Euch und Eurem Dämon um 10%."},
[412732] = {name = "Dämonisches Wissen", additional_info = "[q]Erhöht Zauberschaden und -heilung um einen Wert, der 3% der maximalen Ausdauer plus der Intelligenz Eures Dämons entspricht."},
[412735] = {name = "Dämonisches Wissen", additional_info = nil},
[412758] = {name = "Verbrennen", additional_info = "{14% von Grundmana} {30 Meter Reichweite}\nWirken in 2.25 sek.\n[q]Verbrennt Euren Gegner, fügt ihm [222 / 100 * (6.568597 + 0.672028 * 60 + 0.031721 * 60 * 60)] bis [258 / 100 * (6.568597 + 0.672028 * 60 + 0.031721 * 60 * 60)] Schaden zu und erhöht jeglichen von Euch verursachten Feuerschaden 15 sec lang um 25%."},
