[412787] = {name = "Unterbrechen", additional_info = "{5% von Grundmana} {Nahkampfreichweite}\n{Sofort} {10 sek. Abklingzeit}\n[q]Erstickt Euren Gegner mit einer Welle schattenhafter Energie, die 10 Schaden verursacht, das Wirken von Zaubern unterbricht und 5 sec lang verhindert, dass Zauber dieser Art gewirkt werden können."},
[412788] = {name = "Dämonischer Ansturm", additional_info = "{5% von Grundmana} {8 - 25 Meter Reichweite}\n{Sofort} {15 sek. Abklingzeit}\n[q]Stürmt auf einen Gegner zu und betäubt ihn für 1 sec Kann nicht im Kampf verwendet werden."},
[412789] = {name = "Dämonisches Heulen", additional_info = "5% von Grundmana\nSofort 10 min Abklingzeit\n[q]Zwingt alle Gegner in der Nähe 6 sec lang, ihre Angriffe auf Euch zu konzentrieren."},
[412790] = {name = "Infernalischer Schlag", additional_info = "8 - 25 Meter Reichweite\n{Sofort} {45 sek. Abklingzeit}\n[q]Springt durch die Luft und schmettert auf alle Gegner im Umkreis von 8 Metern um das Zielgebiet hinab, verursacht 100 Schattenschaden und betäubt sie für 2 sec"},
[412798] = {name = "Tanz des Tückischen", additional_info = "[q]Ihr und Euer Dämon erhaltet jedes Mal, wenn Ihr einem Gegner einen kritischen Treffer zufügt, eine Ausweichchance entsprechend Eurer kritischen Zaubertrefferchance. Ihr beide gewinnt außerdem 2% Eures maximalen Manas zurück."},
