[415352] = {name = "Nahkampfspezialist", additional_info = "[q]'Mungobiss' und 'Raptorstoß' haben bei jedem Angriff eine Chance von 30%, die Abklingzeiten von 'Mungobiss' und 'Raptorstoß' abzuschließen."},
[415358] = {name = "Raptorenfuror", additional_info = "[q]'Raptorstoß' erhöht den durch 'Raptorstoß' und 'Mungobiss' verursachten Schaden 30 sec lang um 15%. Bis zu 5-mal stapelbar. Nachfolgende Einsätze verlängern nicht die Dauer des Effekts."},
[415362] = {name = "Raptorenfuror", additional_info = "Sofort\n[q]Modifies Damage/Healing Done +16%:\nMungobiss , Mungobiss , Mungobiss , Mungobiss , Raptorstoß , Raptorstoß , Raptorstoß , Raptorstoß , Raptorstoß , Raptorstoß , Raptorstoß , Raptorstoß , Raptorstoß , Raptorstoß , Raptorstoß , Raptorstoß , Raptorstoß , Raptorstoß , Raptorstoß , Raptorstoß , Raptorstoß , Raptorstoß , Raptorstoß , Raptorstoß , Raptorstoß , Raptorstoß , Raptorstoß , Raptorstoß"},
[415370] = {name = "Einsamer Wolf", additional_info = "[q]Ihr verursacht mit allen Angriffen 30% mehr Schaden, während Ihr kein Tier aktiviert habt."},
[415372] = {name = "Einsamer Wolf", additional_info = nil},
[415399] = {name = "Scharfschützentraining", additional_info = "[q]Die kritische Trefferchance Eurer Schussfähigkeiten ist um 2% erhöht, wenn Ihr Euch in den letzten 2 Sek. nicht bewegt habt. Dieser Effekt stapelt sich pro Sekunde bis auf maximal 5 Stapel. Bei 5 Stapeln kann 'Gezielter Schuss' sofort gewirkt werden. Während Ihr Euch bewegt, verliert Ihr 1 Stapel pro Sekunde."},
[415401] = {name = "Scharfschützentraining", additional_info = "Sofort\n[q]Modifies Critical Strike Chance +3:\nAblenkender Schuss , Ablenkender Schuss , Ablenkender Schuss , Ablenkender Schuss , Ablenkender Schuss , Ablenkender Schuss , Arkaner Schuss , Arkaner Schuss , Arkaner Schuss , Arkaner Schuss , Arkaner Schuss , Arkaner Schuss , Arkaner Schuss , Arkaner Schuss , Erschütternder Schuss , Explosivschuss , Explosivschuss , Gezielter Schuss , Gezielter Schuss , Gezielter Schuss , Gezielter Schuss , Gezielter Schuss , Gezielter Schuss , Mehrfachschuss , Mehrfachschuss , Mehrfachschuss , Mehrfachschuss , Mehrfachschuss , Schimärenschuss , Schimärenschuss - Schlange , Streuschuss"},
[415405] = {name = "Schneller Tod", additional_info = "[q]Verringert die Abklingzeit von 'Schnellfeuer' um 80%, 'Schnellfeuer' erhöht zusätzlich das Nahkampfangriffstempo um 40% und Eure nächste Schussfähigkeit innerhalb von 20 sec, nachdem Ihr einen Gegner getötet habt, der Erfahrung oder Ehre gewährt, verursacht 20% mehr Schaden."},
[415407] = {name = "Schneller Tod", additional_info = "Sofort\n[q]Modifies Damage/Healing Done +21%:\nAblenkender Schuss , Ablenkender Schuss , Ablenkender Schuss , Ablenkender Schuss , Ablenkender Schuss , Ablenkender Schuss , Arkaner Schuss , Arkaner Schuss , Arkaner Schuss , Arkaner Schuss , Arkaner Schuss , Arkaner Schuss , Arkaner Schuss , Arkaner Schuss , Erschütternder Schuss , Explosivschuss , Gezielter Schuss , Gezielter Schuss , Gezielter Schuss , Gezielter Schuss , Gezielter Schuss , Gezielter Schuss , Mehrfachschuss , Mehrfachschuss , Mehrfachschuss , Mehrfachschuss , Mehrfachschuss , Schimärenschuss , Schimärenschuss - Schlange , Streuschuss"},
[415413] = {name = "Sichern und Laden", additional_info = "[q]Each time one of your traps is triggered, your next Shot (except Scatter Shot) ability within 20 sec costs no mana and does not incur a cooldown."},
[415414] = {name = "Sichern und Laden", additional_info = "Sofort\n[q]Modifies Cooldown -99%:\nAblenkender Schuss , Ablenkender Schuss , Ablenkender Schuss , Ablenkender Schuss , Ablenkender Schuss , Ablenkender Schuss , Arkaner Schuss , Arkaner Schuss , Arkaner Schuss , Arkaner Schuss , Arkaner Schuss , Arkaner Schuss , Arkaner Schuss , Arkaner Schuss , Erschütternder Schuss , Explosivschuss , Gezielter Schuss , Gezielter Schuss , Gezielter Schuss , Gezielter Schuss , Gezielter Schuss , Gezielter Schuss , Mehrfachschuss , Mehrfachschuss , Mehrfachschuss , Mehrfachschuss , Mehrfachschuss , Schimärenschuss , Schimärenschuss - Schlange\n\nModifies Power Cost -99%:\nAblenkender Schuss , Ablenkender Schuss , Ablenkender Schuss , Ablenkender Schuss , Ablenkender Schuss , Ablenkender Schuss , Arkaner Schuss , Arkaner Schuss , Arkaner Schuss , Arkaner Schuss , Arkaner Schuss , Arkaner Schuss , Arkaner Schuss , Arkaner Schuss , Erschütternder Schuss , Explosivschuss , Explosivschuss , Gezielter Schuss , Gezielter Schuss , Gezielter Schuss , Gezielter Schuss , Gezielter Schuss , Gezielter Schuss , Mehrfachschuss , Mehrfachschuss , Mehrfachschuss , Mehrfachschuss , Mehrfachschuss , Schimärenschuss , Schimärenschuss - Schlange"},
[415423] = {name = "Aspekt der Viper", additional_info = "Sofort\n[q]Der Jäger nimmt die Aspekte einer Viper an. Jeder Eurer automatischen Distanz- und Nahkampfangriffe regeneriert Mana, der gesamte verursachte Schaden wird jedoch um 10% verringert. Zusätzlich erhaltet Ihr alle 3 Sek. 10% Eures maximalen Manas. Das gewonnene Mana basiert auf dem Tempo Eurer Waffe. Es kann immer nur jeweils ein Aspekt aktiv sein."},
[415424] = {name = "Aspekt der Viper", additional_info = nil},
[415428] = {name = "Katzenhafte Reflexe", additional_info = "[q]Erhöht Eure Ausweichchance um 20% und die Eures Begleiters um 9%. Außerdem wird die Abklingzeit Eurer Fähigkeit 'Flankenangriff' um 50% verringert."},
[415429] = {name = "Tierskalierung", additional_info = nil},
[415431] = {name = "Vermeidung", additional_info = nil},
[415449] = {name = "Taillenrunenfähigkeit", additional_info = "Sofort\n[q]Legt einen Gegenstand mit eingeprägter Rune für den Taillenplatz an, um eine Fähigkeit in diesem Ausrüstungsplatz zu aktivieren."},
[415450] = {name = "Fußrunenfähigkeit", additional_info = "Sofort\n[q]Legt einen Gegenstand mit eingeprägter Rune für den Fußplatz an, um eine Fähigkeit in diesem Ausrüstungsplatz zu aktivieren."},
[415452] = {name = "Verbesserter Prankenhieb", additional_info = "[q]Erhaltet die Fähigkeit 'Verbesserter Prankenhieb':\n\n\nIn Katzengestalt wird Eure Fähigkeit 'Prankenhieb' zu 'Prankenhieb (Katze)', in Bärengestalt trifft Eure Fähigkeit 'Prankenhieb' bis zu 7 zusätzliche Gegner.\n\n Prankenhieb (Katze)\n\nSchlägt Gegner in der Nähe, verursacht 250% Waffenschaden und generiert 1 Combopunkt auf Eurem aktiven Ziel."},
[415457] = {name = "Dolchfächer", additional_info = "[q]Erhaltet die Fähigkeit 'Dolchfächer':\n\n\nWirft sofort beide Waffen auf alle Ziele innerhalb von 8 Metern und verursacht 75% Waffenschaden durch Dolche und 50% Waffenschaden durch alle anderen Waffenarten."},
[415459] = {name = "Zaubermacht", additional_info = "[q]Erhaltet die Fähigkeit 'Zaubermacht':\n\n\nErhöht den Schadensbonus bei kritischen Treffern aller Zauber um 50%."},
[415460] = {name = "Feuerfontäne", additional_info = "[q]Erhaltet die Fähigkeit 'Feuerfontäne':\n\n\nErhöht die kritische Trefferchance aller Eurer Zauber um 15%, aber die kritischen Treffer Eurer Zauber ohne regelmäßige Effekte kosten zusätzlich 1% eures Grundmanas."},
[415467] = {name = "Massenregeneration", additional_info = "[q]Erhaltet die Fähigkeit 'Massenregeneration':\n\n\nHeilt alle verbündeten Gruppenmitglieder des anvisierten Spielercharakters innerhalb von 43.5 Metern um den anvisierten Spielercharakter im Verlauf von 3 sec um [(38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) * 42 / 100 * 3] Gesundheit und belegt jedes Ziel für 15 Sek. mit 'Zeitenleuchtfeuer'.\n\n Zeitenleuchtfeuer\n\nErfasst die raumzeitliche Position des Subjekts. 80% sämtlichen Arkanschadens, den der Zaubernde verursacht hat, werden für alle aktuellen Ziele von 'Zeitenleuchtfeuer' des Zaubernden in chronomantische Heilung umgewandelt. Diese Heilung ist für den Zaubernden selbst um 50% verringert und wird zudem um 80% verringert, wenn durch arkane Zauber, die mehrere Ziele gleichzeitig treffen, Schaden verursacht wird."},
[415481] = {name = "Schmerz und Leid", additional_info = "[q]Erhaltet die Fähigkeit 'Schmerz und Leid':\n\n\n'Gedankenschlag', 'Gedankenstachel' und 'Gedankenschinden' setzen die Dauer von 'Schattenwort: Schmerz', 'Pest der Leere' oder 'Vampirberührung' auf Eurem Ziel auf das Maximum zurück. Es wird immer die Fähigkeit mit der geringsten verbleibenden Dauer aufgefrischt."},
[415596] = {name = "Schildmeisterschaft", additional_info = "[q]Erhaltet die Fähigkeit 'Schildmeisterschaft':"},
[415598] = {name = "Gladiatorhaltung", additional_info = "[q]Erhaltet die Fähigkeit 'Gladiatorhaltung':\n\n\nEine aggressive Haltung, die beim Tragen eines Schildes den Schaden um 10% und die Blockchance um 10% erhöht, dabei jedoch die Rüstung um 30% und die erzeugte Bedrohung um 30% verringert. Zusätzlich erhaltet Ihr 50% mehr Wut, wenn Eure Nahkampfangriffe einem Gegner Schaden zufügen, der Euch nicht als Ziel hat.\n\n Während Ihr in der 'Gladiatorhaltung' einen Schild tragt, könnt Ihr sämtliche Fähigkeiten einsetzen, die auf andere Haltungen beschränkt sind."},
[415599] = {name = "Zielstrebiger Furor", additional_info = "[q]Erhaltet die Fähigkeit 'Zielstrebiger Furor':\n\n\nWenn Ihr mit zwei Waffen kämpft, wird Eure Bewegungsgeschwindigkeit um 10% erhöht und Ihr erhaltet immer, wenn Euer automatischer Angriff das selbe Ziel wie Euer vorheriger automatischer Angriff trifft, 2% Angriffstempo, bis zu einem Maximum von 5 Stapeln. Hält 10 sec lang an oder bis Eure automatischen Angriffe ein anderes Ziel treffen."},
[415604] = {name = "Immerwährende Gebrechen", additional_info = "[q]Erhaltet die Fähigkeit 'Immerwährende Gebrechen':\n\n\n'Blutsauger', 'Seelendieb', 'Schattenblitz', 'Schattenspalten', 'Sengender Schmerz', 'Einäschern' und 'Heimsuchung' setzen die Dauer Eurer 'Verderbnis' auf dem Ziel auf das Maximum zurück."},
[415605] = {name = "Dämonische Taktiken", additional_info = "[q]Erhaltet die Fähigkeit 'Dämonische Taktiken':\n\n\nErhöht die Chance für einen kritischen Nahkampf- oder Zaubertreffer von Euch und Eurem Dämon um 10%."},
[415703] = {name = "Geheiligter Schild", additional_info = "[q]Erhaltet die Fähigkeit 'Geheiligter Schild':\n\n\nJedes Mal, wenn das Ziel Schaden erleidet, wird es von einem geheiligten Schild umhüllt, der [36 * (38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) / 100] Schaden absorbiert und die Chance des Paladins, mit 'Lichtblitz' einen kritischen Treffer zu erzielen, bis zu 6 sec lang um 50% erhöht. Zusätzlich heilen Eure Einsätze von 'Lichtblitz' Ziele mit 'Geheiligter Schild' im Verlauf von 12 sec um weitere 100% Gesundheit. Dieser Effekt kann nur einmal alle 6 Sek. auftreten. Hält 1 min lang an. Es kann immer nur jeweils ein Ziel mit diesem Zauber belegt sein."},
[415706] = {name = "Die Kunst des Krieges", additional_info = "[q]Erhaltet die Fähigkeit 'Die Kunst des Krieges':\n\n\nEure kritischen Nahkampftreffer verringern die verbleibende Abklingzeit von 'Exorzismus' um 2 Sek., und die Manakosten von 'Exorzismus' werden um 80% verringert."},
[415709] = {name = "Überleben des Stärkeren", additional_info = "[q]Erhaltet die Fähigkeit 'Überleben des Stärkeren':\n\n\nVerringert die Chance, dass Ihr einen kritischen Treffer durch Nahkampfangriffe erleidet, um 6% und verringert jeglichen erlittenen Schaden um 10%. Verringert den erlittenen Schaden zusätzlich um 10%, während Ihr in Bärengestalt oder Terrorbärengestalt seid."},
[415712] = {name = "Kraftwoge", additional_info = "[q]Erhaltet die Fähigkeit 'Kraftwoge':\n\n\nJedes Mal, wenn Euer 'Flammenschock' Schaden verursacht, besteht eine Chance von 5%, dass die Abklingzeiten von 'Lavaeruption' und 'Kettenblitzschlag' abgeschlossen werden und Euer nächster Einsatz von 'Lavaeruption' oder 'Kettenblitzschlag' innerhalb von 10 sec ein Spontanzauber ist. Jedes Mal, wenn Eure 'Springflut' heilt, besteht eine Chance von 5%, dass Euer nächster Einsatz von 'Kettenheilung' innerhalb von 10 sec ein Spontanzauber ist. Zusätzlich erhaltet Ihr alle 5 Sek. Mana in Höhe von 15% Eurer Intelligenz."},
[415713] = {name = "Geistige Gewandtheit", additional_info = "[q]Erhaltet die Fähigkeit 'Geistige Gewandtheit':\n\n\nSchaden mit 'Lavapeitsche' oder 'Sturmschlag' zu verursachen, erhöht 30 sec lang Eure Angriffskraft um 65% Eurer Intelligenz und Euren Zauberschaden um 20% Eurer gesamten Angriffskraft."},
[415714] = {name = "Heilender Regen", additional_info = "[q]Erhaltet die Fähigkeit 'Heilender Regen':\n\n\nWählt einen Bereich von 15 Metern um den anvisierten Spielercharakter aus und heilt alle Gruppenmitglieder des anvisierten Spielercharakters im Bereich pro Sekunde um [(29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60) * 15 / 100] Gesundheit."},
[415717] = {name = "Katzenhafte Reflexe", additional_info = "[q]Erhaltet die Fähigkeit 'Katzenhafte Reflexe':\n\n\nErhöht Eure Ausweichchance um 20% und die Eures Begleiters um 9%. Außerdem wird die Abklingzeit Eurer Fähigkeit 'Flankenangriff' um 50% verringert."},
[415718] = {name = "Aspekt der Viper", additional_info = "[q]Erhaltet die Fähigkeit 'Aspekt der Viper':\n\n\nDer Jäger nimmt die Aspekte einer Viper an. Jeder Eurer automatischen Distanz- und Nahkampfangriffe regeneriert Mana, der gesamte verursachte Schaden wird jedoch um 10% verringert. Zusätzlich erhaltet Ihr alle 3 Sek. 10% Eures maximalen Manas. Das gewonnene Mana basiert auf dem Tempo Eurer Waffe. Es kann immer nur jeweils ein Aspekt aktiv sein."},
[415719] = {name = "Sichern und Laden", additional_info = "[q]Erhaltet die Fähigkeit 'Sichern und Laden':\n\n\nEach time one of your traps is triggered, your next Shot (except Scatter Shot) ability within 20 sec costs no mana and does not incur a cooldown."},
[415720] = {name = "Tödlicher Schuss", additional_info = "[q]Erhaltet die Fähigkeit 'Tödlicher Schuss':\n\n\nIhr versucht, ein verletztes Ziel mit einem Distanzangriff zu töten, der 100% Waffenschaden plus [113 / 100 * 100 / 100 * (2.976264 + 0.641066 * 60 + 0.022519 * 60 * 60)] verursacht. 'Tödlicher Schuss' hat keine Minimaldistanz, und seine Abklingzeit wird zurückgesetzt, wenn er gegen einen Gegner mit 20% oder weniger Gesundheit eingesetzt wird."},
[415723] = {name = "Nahkampfspezialist", additional_info = "[q]Erhaltet die Fähigkeit 'Nahkampfspezialist':\n\n\n'Mungobiss' und 'Raptorstoß' haben bei jedem Angriff eine Chance von 30%, die Abklingzeiten von 'Mungobiss' und 'Raptorstoß' abzuschließen."},
[415725] = {name = "Auflauern", additional_info = "[q]Erhaltet die Fähigkeit 'Auflauern':\n\n\nDie Treffer Eurer Fähigkeiten 'Hinterhalt' und 'Meucheln' bringen Euer Ziel aus dem Gleichgewicht, was die Zeit zwischen seinen Nahkampfangriffen um 10% erhöht sowie seine Bewegungsgeschwindigkeit um 50% verringert. Hält 8 sec lang an."},
[415729] = {name = "Erleuchtung", additional_info = "[q]Erhaltet die Fähigkeit 'Erleuchtung':\n\n\nIhr verursacht 10% mehr Schaden, solange Ihr mehr als 70% Mana habt. Während Ihr weniger als 30% Mana habt, beträgt Eure Manaregeneration während des Zauberwirkens 10%."},
[415734] = {name = "Zauberfrostblitz", additional_info = "[q]Erhaltet die Fähigkeit 'Zauberfrostblitz':\n\n\nSchleudert einen Zauberfrostblitz auf den Gegner, der [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 305 / 100 * ( 1 ) ] bis [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 355 / 100 * ( 1 ) ] Zauberfrostschaden verursacht und seine Bewegungsgeschwindigkeit 9 sec lang um 40% verringert. Der Schaden dieses Zaubers wird gegen den jeweils geringeren Frost- oder Arkanwiderstandswert des Ziels gerechnet und zählt sowohl als Frost- als auch als Arkanschaden."},
[415737] = {name = "Glücksfall", additional_info = "[q]Erhaltet die Fähigkeit 'Glücksfall':\n\n\nEure Heilung mit 'Blitzheilung' verringert die Zauberzeit Eures nächsten Einsatzes von 'Geringe Heilung', 'Heilung', 'Große Heilung' oder 'Gebet der Heilung' 20 sec lang um 20%. Bis zu 3-mal stapelbar."},
[415738] = {name = "Gedankenbrand", additional_info = "[q]Erhaltet die Fähigkeit 'Gedankenbrand':\n\n\nLöst eine Explosion von Schattenmagie aus, die dem Ziel und Gegnern innerhalb von 10 Metern um das Ziel herum 5 sec lang alle 1 Sek. [70 / 100 * (9.456667 + 0.635108 * 60 + 0.039063 * 60 * 60)] bis [78 / 100 * (9.456667 + 0.635108 * 60 + 0.039063 * 60 * 60)] Schattenschaden zufügt."},
[415739] = {name = "Kraftvolle Seele", additional_info = "[q]'Geringe Heilung', 'Heilung', 'Große Heilung' und 'Blitzheilung' verringern die verbleibende Dauer von 'Geschwächte Seele' auf den geheilten Zielen um 4 Sek. Zusätzlich erhalten Ziele Eures Zaubers 'Machtwort: Schild' 'Wut', wenn sie trotz absorbierten Schadens Schaden erleiden, und 'Zorn der Gerechtigkeit' wird durch von 'Machtwort: Schild' absorbiertem Schaden ausgelöst, als wäre es eine Heilung."},
[415740] = {name = "Kraftvolle Seele", additional_info = "[q]Erhaltet die Fähigkeit 'Kraftvolle Seele':\n\n\n'Geringe Heilung', 'Heilung', 'Große Heilung' und 'Blitzheilung' verringern die verbleibende Dauer von 'Geschwächte Seele' auf den geheilten Zielen um 4 Sek. Zusätzlich erhalten Ziele Eures Zaubers 'Machtwort: Schild' 'Wut', wenn sie trotz absorbierten Schadens Schaden erleiden, und 'Zorn der Gerechtigkeit' wird durch von 'Machtwort: Schild' absorbiertem Schaden ausgelöst, als wäre es eine Heilung."},
[415743] = {name = "Blutwoge", additional_info = "[q]Erhaltet die Fähigkeit 'Blutwoge':\n\n\nBeim Einsatz von 'Heldenhafter Stoß', 'Blutdurst' und 'Wirbelwind' besteht eine Chance von 30%, dass Euer nächster Einsatz von 'Zerschmettern' innerhalb von 15 sec sofort eingesetzt wird, mit beiden Nahkampfwaffen zuschlägt und keine Wut kostet."},
[415744] = {name = "Präzises Timing", additional_info = "[q]Erhaltet die Fähigkeit 'Genau zur rechten Zeit':\n\n\n'Zerschmettern' wird jetzt sofort eingesetzt, hat allerdings eine Abklingzeit von 6 Sek."},
[415745] = {name = "Fokussierte Wut", additional_info = "[q]Erhaltet die Fähigkeit 'Fokussierte Wut':\n\n\nVerringert die Wutkosten aller Angriffsfähigkeiten um 3."},
[415749] = {name = "Dämonisches Wissen", additional_info = "[q]Erhaltet die Fähigkeit 'Dämonisches Wissen':\n\n\nErhöht Zauberschaden und -heilung um einen Wert, der 3% der maximalen Ausdauer plus der Intelligenz Eures Dämons entspricht."},
[415750] = {name = "Verbrennen", additional_info = "[q]Erhaltet die Fähigkeit 'Verbrennen':\n\n\nVerbrennt Euren Gegner, fügt ihm [222 / 100 * (6.568597 + 0.672028 * 60 + 0.031721 * 60 * 60)] bis [258 / 100 * (6.568597 + 0.672028 * 60 + 0.031721 * 60 * 60)] Schaden zu und erhöht jeglichen von Euch verursachten Feuerschaden 15 sec lang um 25%."},
[415751] = {name = "Tanz des Tückischen", additional_info = "[q]Erhaltet die Fähigkeit 'Tanz des Tückischen':\n\n\nIhr und Euer Dämon erhaltet jedes Mal, wenn Ihr einem Gegner einen kritischen Treffer zufügt, eine Ausweichchance entsprechend Eurer kritischen Zaubertrefferchance. Ihr beide gewinnt außerdem 2% Eures maximalen Manas zurück."},
[415755] = {name = "Vom Licht behütet", additional_info = "[q]Erhaltet die Fähigkeit 'Vom Licht behütet':\n\n\nJedes Mal, wenn Ihr ein Ziel mit Eurer Nahkampfwaffe trefft, gewinnt Ihr 15 sec lang alle 3 Sek. 5% Eures maximalen Manas. Während dieser Manaregeneration ist der durch Eure Heilzauber geheilte Wert jedoch um 50% verringert."},
[415756] = {name = "Aurenmeisterschaft", additional_info = "[q]Erhaltet die Fähigkeit 'Aurenmeisterschaft':\n\n\nVerleiht allen durch Eure Fähigkeit 'Aura der Konzentration' gestärkten Zielen Immunität gegen Unterbrechungs- und Stilleeffekte. Die Effekte aller anderen Auren werden um 100% erhöht. Hält 6 sec lang an."},
[415759] = {name = "Schädelstoß", additional_info = "[q]Erhaltet die Fähigkeit 'Schädelstoß':\n\n\nStürmt auf ein Ziel innerhalb von 13 Metern zu und schlagt ihm gegen den Schädel, was das Wirken von Zaubern unterbricht und 2 sec lang verhindert, dass Zauber dieser Art gewirkt werden können. Gemeinsame Abklingzeit mit 'Wilde Attacke'."},
[415760] = {name = "Aufschlitzen", additional_info = "[q]Erhaltet die Fähigkeit 'Aufschlitzen':\n\n\nSchlitzt ein gegnerisches Ziel auf, was im Verlauf von 15 sec [(9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) * 20 / 100 * 5] Blutungsschaden und pro existierender Anwendung von 'Aufschlitzen' auf dem Ziel 20% Waffenschaden verursacht. Generiert hohe Bedrohung. Dieser Effekt ist bis zu 5-mal auf demselben Ziel stapelbar."},
[415761] = {name = "Samenkorn des Lebens", additional_info = "[q]Erhaltet die Fähigkeit 'Samenkorn des Lebens':\n\n\nWenn Ihr mit Euren nicht regelmäßigen Heilzaubern einen kritischen Treffer erzielt, pflanzt Ihr dem Ziel für 50% des geheilten Wertes ein 'Samenkorn des Lebens' ein. Das Samenkorn wird erblühen, wenn das Ziel das nächste Mal Schaden erleidet oder nicht regelmäßige Heilung erhält. Hält 15 sec lang an."},
[415762] = {name = "Feuer Elunes", additional_info = "[q]Erhaltet die Fähigkeit 'Feuer Elunes':\n\n\nEinige Eurer Zauber und Fähigkeiten verlängern die Dauer Eurer regelmäßigen Schadens- und Heileffekte auf ihrem Ziel:\n\n 'Sternenfeuer' verlängert 'Mondfeuer' um 6 Sek.\n 'Zorn' verlängert 'Sonnenfeuer' um 3 Sek.\n 'Nachwachsen' verlängert 'Verjüngung' um 6 Sek.\n 'Schreddern' verlängert 'Zerfetzen' um 2 Sek.\n\n Jeder Effekt kann nur bis zur ursprünglichen Dauer verlängert werden."},
[415768] = {name = "Brennen", additional_info = "[q]Erhaltet die Fähigkeit 'Brennen':\n\n\nEuer 'Flammenschock' trifft jetzt bis zu 5 Ziele, hat eine 6 Sek. längere Effektdauer und verursacht 100% mehr Schaden. Zusätzlich wird Euer Zauberschaden um (2 * 60) erhöht, während eine Eurer ausgerüsteten Waffen mit 'Waffe der Flammenzunge' verzaubert ist."},
[415813] = {name = "Großer Geisterwolf", additional_info = "[q]Eure Fähigkeit 'Geisterwolf' kann nun drinnen benutzt werden und verringert sämtlichen erlittenen Schaden um 10%, so lange sie aktiv ist."},
[415816] = {name = "Flügeldrachenstoß", additional_info = nil},
[415817] = {name = "Schneller Tod", additional_info = "[q]Erhaltet die Fähigkeit 'Schneller Tod':\n\n\nVerringert die Abklingzeit von 'Schnellfeuer' um 80%, 'Schnellfeuer' erhöht zusätzlich das Nahkampfangriffstempo um 40% und Eure nächste Schussfähigkeit innerhalb von 20 sec, nachdem Ihr einen Gegner getötet habt, der Erfahrung oder Ehre gewährt, verursacht 20% mehr Schaden."},
[415818] = {name = "Scharfschützentraining", additional_info = "[q]Erhaltet die Fähigkeit 'Scharfschützentraining':\n\n\nDie kritische Trefferchance Eurer Schussfähigkeiten ist um 2% erhöht, wenn Ihr Euch in den letzten 2 Sek. nicht bewegt habt. Dieser Effekt stapelt sich pro Sekunde bis auf maximal 5 Stapel. Bei 5 Stapeln kann 'Gezielter Schuss' sofort gewirkt werden. Während Ihr Euch bewegt, verliert Ihr 1 Stapel pro Sekunde."},
[415822] = {name = "Raptorenfuror", additional_info = "[q]Erhaltet die Fähigkeit 'Raptorenfuror':\n\n\n'Raptorstoß' erhöht den durch 'Raptorstoß' und 'Mungobiss' verursachten Schaden 30 sec lang um 15%. Bis zu 5-mal stapelbar. Nachfolgende Einsätze verlängern nicht die Dauer des Effekts."},
[415918] = {name = "Umhang prägen - Blutroter Sturm", additional_info = "Wirken in 3 sek.\nBenötigt Umhang"},
[415922] = {name = "Umhang prägen - Donnerbüchse", additional_info = "Wirken in 3 sek.\nBenötigt Umhang\n[q]Prägt Euren Umhang mit der Rune 'Donnerbüchse':\n\n\nFeuert einen Musketenschuss auf bis zu 4 Gegner und verursacht in einem kegelförmigen Bereich vor dem Schurken [(5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 192 / 100 + 48 / 100 * Attack power] bis [(5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 288 / 100 + 48 / 100 * Attack power] körperlichen Schaden."},
[415926] = {name = "Stiefel prägen - Auflauern", additional_info = "Wirken in 3 sek.\nBenötigt Stiefel\n[q]Prägt Eure Stiefel mit der Rune 'Auflauern':\n\n\nDie Treffer Eurer Fähigkeiten 'Hinterhalt' und 'Meucheln' bringen Euer Ziel aus dem Gleichgewicht, was die Zeit zwischen seinen Nahkampfangriffen um 10% erhöht sowie seine Bewegungsgeschwindigkeit um 50% verringert. Hält 8 sec lang an."},
[415934] = {name = "Stiefel prägen - Zaubermacht", additional_info = "Wirken in 3 sek.\nBenötigt Stiefel\n[q]Prägt Eure Stiefel mit der Rune 'Zaubermacht':\n\n\nErhöht den Schadensbonus bei kritischen Treffern aller Zauber um 50%."},
[415936] = {name = "Handschuhe prägen - Lebende Bombe", additional_info = "Wirken in 3 sek.\nBenötigt Handschuhe\n[q]Prägt Eure Handschuhe mit der Rune 'Lebende Bombe':\n\n\nDas Ziel wird zu einer lebenden Bombe und erleidet im Verlauf von 12 sec [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 85 / 100 * 4] Feuerschaden. Nach Ablauf von 12 sec, oder wenn der Zauber gebannt wird, explodiert das Ziel und fügt allen Gegnern innerhalb von 10 Metern [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 171 / 100] Feuerschaden zu."},
[415939] = {name = "Hosen prägen - Rasende Regeneration", additional_info = "Wirken in 3 sek.\nBenötigt Hosen\n[q]Prägt Euren Hosen mit der Rune 'Massenregeneration':\n\n\nHeilt alle verbündeten Gruppenmitglieder des anvisierten Spielercharakters innerhalb von 43.5 Metern um den anvisierten Spielercharakter im Verlauf von 3 sec um [(38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) * 42 / 100 * 3] Gesundheit und belegt jedes Ziel für 15 Sek. mit 'Zeitenleuchtfeuer'.\n\n Zeitenleuchtfeuer\n\nErfasst die raumzeitliche Position des Subjekts. 80% sämtlichen Arkanschadens, den der Zaubernde verursacht hat, werden für alle aktuellen Ziele von 'Zeitenleuchtfeuer' des Zaubernden in chronomantische Heilung umgewandelt. Diese Heilung ist für den Zaubernden selbst um 50% verringert und wird zudem um 80% verringert, wenn durch arkane Zauber, die mehrere Ziele gleichzeitig treffen, Schaden verursacht wird."},
[415942] = {name = "Brustteil prägen - Erleuchtung", additional_info = "Wirken in 3 sek.\nBenötigt Brust, Brust\n[q]Prägt Euer Brustteil oder Eure Robe mit der Rune 'Erleuchtung':\n\n\nIhr verursacht 10% mehr Schaden, solange Ihr mehr als 70% Mana habt. Während Ihr weniger als 30% Mana habt, beträgt Eure Manaregeneration während des Zauberwirkens 10%."},
[415948] = {name = "Gürtel prägen - Zauberfrostblitz", additional_info = "Wirken in 3 sek.\nBenötigt Gürtel\n[q]Prägt Euren Gürtel mit der Rune 'Zauberfrostblitz':\n\n\nSchleudert einen Zauberfrostblitz auf den Gegner, der [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 305 / 100 * ( 1 ) ] bis [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 355 / 100 * ( 1 ) ] Zauberfrostschaden verursacht und seine Bewegungsgeschwindigkeit 9 sec lang um 40% verringert. Der Schaden dieses Zaubers wird gegen den jeweils geringeren Frost- oder Arkanwiderstandswert des Ziels gerechnet und zählt sowohl als Frost- als auch als Arkanschaden."},
[415988] = {name = "Vahi Knochenspalter - Zentaurenkopf gegen Runenfragment eintauschen", additional_info = nil},
[415991] = {name = "Helm prägen - Schmerz und Leid", additional_info = "Wirken in 3 sek.\nBenötigt Helme\n[q]Prägt Euren Helm mit der Rune 'Schmerz und Leid':\n\n\n'Gedankenschlag', 'Gedankenstachel' und 'Gedankenschinden' setzen die Dauer von 'Schattenwort: Schmerz', 'Pest der Leere' oder 'Vampirberührung' auf Eurem Ziel auf das Maximum zurück. Es wird immer die Fähigkeit mit der geringsten verbleibenden Dauer aufgefrischt."},
[415995] = {name = "Brustteil prägen - Glücksfall", additional_info = "Wirken in 3 sek.\nBenötigt Brust, Brust\n[q]Prägt Euer Brustteil oder Eure Robe mit der Rune 'Glücksfall':\n\n\nEure Heilung mit 'Blitzheilung' verringert die Zauberzeit Eures nächsten Einsatzes von 'Geringe Heilung', 'Heilung', 'Große Heilung' oder 'Gebet der Heilung' 20 sec lang um 20%. Bis zu 3-mal stapelbar."},
[415996] = {name = "Handschuhe prägen - Gedankenbrand", additional_info = "Wirken in 3 sek.\nBenötigt Handschuhe\n[q]Prägt Eure Handschuhe mit der Rune 'Gedankenbrand':\n\n\nLöst eine Explosion von Schattenmagie aus, die dem Ziel und Gegnern innerhalb von 10 Metern um das Ziel herum 5 sec lang alle 1 Sek. [70 / 100 * (9.456667 + 0.635108 * 60 + 0.039063 * 60 * 60)] bis [78 / 100 * (9.456667 + 0.635108 * 60 + 0.039063 * 60 * 60)] Schattenschaden zufügt."},
[415997] = {name = "Brustteil prägen - Kraftvolle Seele", additional_info = "Wirken in 3 sek.\nBenötigt Brust, Brust\n[q]Prägt Euer Brustteil oder Eure Robe mit der Rune 'Kraftvolle Seele':\n\n\n'Geringe Heilung', 'Heilung', 'Große Heilung' und 'Blitzheilung' verringern die verbleibende Dauer von 'Geschwächte Seele' auf den geheilten Zielen um 4 Sek. Zusätzlich erhalten Ziele Eures Zaubers 'Machtwort: Schild' 'Wut', wenn sie trotz absorbierten Schadens Schaden erleiden, und 'Zorn der Gerechtigkeit' wird durch von 'Machtwort: Schild' absorbiertem Schaden ausgelöst, als wäre es eine Heilung."},
[416002] = {name = "Gravierte Stiefel - Gladiatorhaltung", additional_info = "Wirken in 3 sek.\nBenötigt Stiefel\n[q]Prägt Eure Stiefel mit der Rune 'Gladiatorhaltung':\n\n\nEine aggressive Haltung, die beim Tragen eines Schildes den Schaden um 10% und die Blockchance um 10% erhöht, dabei jedoch die Rüstung um 30% und die erzeugte Bedrohung um 30% verringert. Zusätzlich erhaltet Ihr 50% mehr Wut, wenn Eure Nahkampfangriffe einem Gegner Schaden zufügen, der Euch nicht als Ziel hat.\n\n Während Ihr in der 'Gladiatorhaltung' einen Schild tragt, könnt Ihr sämtliche Fähigkeiten einsetzen, die auf andere Haltungen beschränkt sind."},
[416003] = {name = "Gürtel prägen - Zielstrebiger Furor", additional_info = "Wirken in 3 sek.\nBenötigt Handschuhe\n[q]Prägt Eure Handschuhe mit der Rune 'Zielstrebiger Furor':\n\n\nWenn Ihr mit zwei Waffen kämpft, wird Eure Bewegungsgeschwindigkeit um 10% erhöht und Ihr erhaltet immer, wenn Euer automatischer Angriff das selbe Ziel wie Euer vorheriger automatischer Angriff trifft, 2% Angriffstempo, bis zu einem Maximum von 5 Stapeln. Hält 10 sec lang an oder bis Eure automatischen Angriffe ein anderes Ziel treffen."},
[416004] = {name = "Gürtel prägen - Blutwoge", additional_info = "Wirken in 3 sek.\nBenötigt Gürtel\n[q]Prägt Euren Gürtel mit der Rune 'Blutwoge':\n\n\nBeim Einsatz von 'Heldenhafter Stoß', 'Blutdurst' und 'Wirbelwind' besteht eine Chance von 30%, dass Euer nächster Einsatz von 'Zerschmettern' innerhalb von 15 sec sofort eingesetzt wird, mit beiden Nahkampfwaffen zuschlägt und keine Wut kostet."},
[416005] = {name = "Gürtel prägen - Präzises Timing", additional_info = "Wirken in 3 sek.\nBenötigt Gürtel\n[q]Prägt Euren Gürtel mit der Rune 'Genau zur rechten Zeit':\n\n\n'Zerschmettern' wird jetzt sofort eingesetzt, hat allerdings eine Abklingzeit von 6 Sek."},
[416008] = {name = "Hosen prägen - Immerwährende Gebrechen", additional_info = "Wirken in 3 sek.\nBenötigt Hosen\n[q]Prägt Euren Hosen mit der Rune 'Immerwährende Gebrechen':\n\n\n'Blutsauger', 'Seelendieb', 'Schattenblitz', 'Schattenspalten', 'Sengender Schmerz', 'Einäschern' und 'Heimsuchung' setzen die Dauer Eurer 'Verderbnis' auf dem Ziel auf das Maximum zurück."},
[416009] = {name = "Brustteil prägen - Dämonische Taktiken", additional_info = "Wirken in 3 sek.\nBenötigt Brust, Brust\n[q]Prägt Euer Brustteil oder Eure Robe mit der Rune 'Dämonische Taktiken':\n\n\nErhöht die Chance für einen kritischen Nahkampf- oder Zaubertreffer von Euch und Eurem Dämon um 10%."},
[416014] = {name = "Stiefel prägen - Dämonisches Wissen", additional_info = "Wirken in 3 sek.\nBenötigt Stiefel\n[q]Prägt Eure Stiefel mit der Rune 'Dämonisches Wissen':\n\n\nErhöht Zauberschaden und -heilung um einen Wert, der 3% der maximalen Ausdauer plus der Intelligenz Eures Dämons entspricht."},
[416015] = {name = "Armschienen prägen - Verbrennen", additional_info = "Wirken in 3 sek.\nBenötigt Armschienen\n[q]Prägt Eure Armschienen mit der Rune 'Verbrennen':\n\n\nVerbrennt Euren Gegner, fügt ihm [222 / 100 * (6.568597 + 0.672028 * 60 + 0.031721 * 60 * 60)] bis [258 / 100 * (6.568597 + 0.672028 * 60 + 0.031721 * 60 * 60)] Schaden zu und erhöht jeglichen von Euch verursachten Feuerschaden 15 sec lang um 25%."},
[416017] = {name = "Stiefel prägen - Tanz des Tückischen", additional_info = "Wirken in 3 sek.\nBenötigt Stiefel\n[q]Prägt Eure Stiefel mit der Rune 'Tanz des Tückischen':\n\n\nIhr und Euer Dämon erhaltet jedes Mal, wenn Ihr einem Gegner einen kritischen Treffer zufügt, eine Ausweichchance entsprechend Eurer kritischen Zaubertrefferchance. Ihr beide gewinnt außerdem 2% Eures maximalen Manas zurück."},
[416028] = {name = "Stiefel prägen - Geheiligter Schild", additional_info = "Wirken in 3 sek.\nBenötigt Stiefel\n[q]Prägt Eure Stiefel mit der Rune 'Geheiligter Schild':\n\n\nJedes Mal, wenn das Ziel Schaden erleidet, wird es von einem geheiligten Schild umhüllt, der [36 * (38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) / 100] Schaden absorbiert und die Chance des Paladins, mit 'Lichtblitz' einen kritischen Treffer zu erzielen, bis zu 6 sec lang um 50% erhöht. Zusätzlich heilen Eure Einsätze von 'Lichtblitz' Ziele mit 'Geheiligter Schild' im Verlauf von 12 sec um weitere 100% Gesundheit. Dieser Effekt kann nur einmal alle 6 Sek. auftreten. Hält 1 min lang an. Es kann immer nur jeweils ein Ziel mit diesem Zauber belegt sein."},
[416031] = {name = "Stiefel prägen - Die Kunst des Krieges", additional_info = "Wirken in 3 sek.\nBenötigt Stiefel\n[q]Prägt Eure Stiefel mit der Rune 'Die Kunst des Krieges':\n\n\nEure kritischen Nahkampftreffer verringern die verbleibende Abklingzeit von 'Exorzismus' um 2 Sek., und die Manakosten von 'Exorzismus' werden um 80% verringert."},
[416035] = {name = "Stiefel prägen - Vom Licht behütet", additional_info = "Wirken in 3 sek.\nBenötigt Stiefel\n[q]Prägt Eure Stiefel mit der Rune 'Vom Licht behütet':\n\n\nJedes Mal, wenn Ihr ein Ziel mit Eurer Nahkampfwaffe trefft, gewinnt Ihr 15 sec lang alle 3 Sek. 5% Eures maximalen Manas. Während dieser Manaregeneration ist der durch Eure Heilzauber geheilte Wert jedoch um 50% verringert."},
[416037] = {name = "Hosen prägen - Aurenmeisterschaft", additional_info = "Wirken in 3 sek.\nBenötigt Hosen\n[q]Prägt Eure Hosen mit der Rune 'Aurenmeisterschaft':\n\n\nVerleiht allen durch Eure Fähigkeit 'Aura der Konzentration' gestärkten Zielen Immunität gegen Unterbrechungs- und Stilleeffekte. Die Effekte aller anderen Auren werden um 100% erhöht. Hält 6 sec lang an."},
[416042] = {name = "Brustteil prägen - Überleben des Stärkeren", additional_info = "Wirken in 3 sek.\nBenötigt Brust, Brust\n[q]Prägt Euer Brustteil oder Eure Robe mit der Rune 'Überleben des Stärkeren':\n\n\nVerringert die Chance, dass Ihr einen kritischen Treffer durch Nahkampfangriffe erleidet, um 6% und verringert jeglichen erlittenen Schaden um 10%. Verringert den erlittenen Schaden zusätzlich um 10%, während Ihr in Bärengestalt oder Terrorbärengestalt seid."},
[416044] = {name = "Handschuhe prägen - Sonnenfeuer", additional_info = "Wirken in 3 sek.\nBenötigt Handschuhe\n[q]Prägt Eure Handschuhe mit der Rune 'Sonnenfeuer':\n\n\nVerbrennt den Gegner und fügt ihm [130 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100] bis [152 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100] Naturschaden sowie im Verlauf von 12 sec [65 * 4 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100] zusätzlichen Naturschaden zu.\n\n Außerdem wird, während Ihr in Bärengestalt, Katzengestalt oder Terrorbärengestalt seid, Euer 'Mondfeuer' durch 'Sonnenfeuer (Bär)' oder 'Sonnenfeuer (Katze)' ersetzt. Dieser Zauber profitiert von allen Effekten von 'Mondfeuer' und löst diese aus.\n\n 'Sonnenfeuer (Bär)'\nVerbrennt den Gegner und fügt ihm [130 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100] bis [152 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100] Naturschaden sowie im Verlauf von 12 sec [65 * 4 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100] zusätzlichen Naturschaden zu.\n\n 'Sonnenfeuer (Katze)'\nVerbrennt den Gegner und fügt ihm [130 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100] bis [152 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100] Naturschaden sowie im Verlauf von 12 sec [65 * 4 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100] zusätzlichen Naturschaden zu. Generiert 1 Combopunkt."},
[416046] = {name = "Handschuhe prägen - Schädelstoß", additional_info = "Wirken in 3 sek.\nBenötigt Handschuhe\n[q]Prägt Eure Handschuhe mit der Rune 'Schädelstoß':\n\n\nStürmt auf ein Ziel innerhalb von 13 Metern zu und schlagt ihm gegen den Schädel, was das Wirken von Zaubern unterbricht und 2 sec lang verhindert, dass Zauber dieser Art gewirkt werden können. Gemeinsame Abklingzeit mit 'Wilde Attacke'."},
[416049] = {name = "Hosen prägen - Aufschlitzen", additional_info = "Wirken in 3 sek.\nBenötigt Hosen\n[q]Prägt Eure Hosen mit der Rune 'Aufschlitzen':\n\n\nSchlitzt ein gegnerisches Ziel auf, was im Verlauf von 15 sec [(9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) * 20 / 100 * 5] Blutungsschaden und pro existierender Anwendung von 'Aufschlitzen' auf dem Ziel 20% Waffenschaden verursacht. Generiert hohe Bedrohung. Dieser Effekt ist bis zu 5-mal auf demselben Ziel stapelbar."},
[416050] = {name = "Brustteil prägen - Samenkorn des Lebens", additional_info = "Wirken in 3 sek.\nBenötigt Brust, Brust\n[q]Prägt Euer Brustteil oder Eure Robe mit der Rune 'Samenkorn des Lebens':\n\n\nWenn Ihr mit Euren nicht regelmäßigen Heilzaubern einen kritischen Treffer erzielt, pflanzt Ihr dem Ziel für 50% des geheilten Wertes ein 'Samenkorn des Lebens' ein. Das Samenkorn wird erblühen, wenn das Ziel das nächste Mal Schaden erleidet oder nicht regelmäßige Heilung erhält. Hält 15 sec lang an."},
[416051] = {name = "Armschienen prägen - Feuer Elunes", additional_info = "Wirken in 3 sek.\nBenötigt Armschienen\n[q]Prägt Eure Armschienen mit der Rune 'Feuer Elunes':\n\n\nEinige Eurer Zauber und Fähigkeiten verlängern die Dauer Eurer regelmäßigen Schadens- und Heileffekte auf ihrem Ziel:\n\n 'Sternenfeuer' verlängert 'Mondfeuer' um 6 Sek.\n 'Zorn' verlängert 'Sonnenfeuer' um 3 Sek.\n 'Nachwachsen' verlängert 'Verjüngung' um 6 Sek.\n 'Schreddern' verlängert 'Zerfetzen' um 2 Sek.\n\n Jeder Effekt kann nur bis zur ursprünglichen Dauer verlängert werden."},
[416054] = {name = "Gürtel prägen - Kraftwoge", additional_info = "Wirken in 3 sek.\nBenötigt Gürtel\n[q]Prägt Euren Gürtel mit der Rune 'Kraftwoge':\n\n\nJedes Mal, wenn Euer 'Flammenschock' Schaden verursacht, besteht eine Chance von 5%, dass die Abklingzeiten von 'Lavaeruption' und 'Kettenblitzschlag' abgeschlossen werden und Euer nächster Einsatz von 'Lavaeruption' oder 'Kettenblitzschlag' innerhalb von 10 sec ein Spontanzauber ist. Jedes Mal, wenn Eure 'Springflut' heilt, besteht eine Chance von 5%, dass Euer nächster Einsatz von 'Kettenheilung' innerhalb von 10 sec ein Spontanzauber ist. Zusätzlich erhaltet Ihr alle 5 Sek. Mana in Höhe von 15% Eurer Intelligenz."},
[416055] = {name = "Helm prägen - Geistige Gewandtheit", additional_info = "Wirken in 3 sek.\nBenötigt Helme\n[q]Prägt Euren Helm mit der Rune 'Geistige Gewandtheit':\n\n\nSchaden mit 'Lavapeitsche' oder 'Sturmschlag' zu verursachen, erhöht 30 sec lang Eure Angriffskraft um 65% Eurer Intelligenz und Euren Zauberschaden um 20% Eurer gesamten Angriffskraft."},
[416057] = {name = "Brustteil prägen - Heilender Regen", additional_info = "Wirken in 3 sek.\nBenötigt Brust, Brust\n[q]Prägt Euer Brustteil oder Eure Robe mit der Rune 'Heilender Regen':\n\n\nWählt einen Bereich von 15 Metern um den anvisierten Spielercharakter aus und heilt alle Gruppenmitglieder des anvisierten Spielercharakters im Bereich pro Sekunde um [(29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60) * 15 / 100] Gesundheit."},
[416062] = {name = "Umhang prägen - Kohärenz", additional_info = "Wirken in 3 sek.\nBenötigt Umhang\n[q]Prägt Euren Umhang mit der Rune 'Kohärenz':\n\n\nDie Effektivität Eurer 'Kettenheilung' wird nur um 35% pro Übersprung verringert und die Effektivität von 'Kettenblitzschlag' nur um 20% Prozent pro Übersprung. Springt außerdem auf 1 zusätzliches Ziel über."},
[416066] = {name = "Helm prägen - Brennen", additional_info = "Wirken in 3 sek.\nBenötigt Helme\n[q]Prägt Euren Helm mit der Rune 'Brennen':\n\n\nEuer 'Flammenschock' trifft jetzt bis zu 5 Ziele, hat eine 6 Sek. längere Effektdauer und verursacht 100% mehr Schaden. Zusätzlich wird Euer Zauberschaden um (2 * 60) erhöht, während eine Eurer ausgerüsteten Waffen mit 'Waffe der Flammenzunge' verzaubert ist."},
[416081] = {name = "Kohärenz", additional_info = "[q]Erhaltet die Fähigkeit 'Kohärenz':\n\n\nDie Effektivität Eurer 'Kettenheilung' wird nur um 35% pro Übersprung verringert und die Effektivität von 'Kettenblitzschlag' nur um 20% Prozent pro Übersprung. Springt außerdem auf 1 zusätzliches Ziel über."},
[416083] = {name = "Helm prägen - Katzenhafte Reflexe", additional_info = "Wirken in 3 sek.\nBenötigt Helme\n[q]Prägt Euren Helm mit der Rune 'Katzenhafte Reflexe':\n\n\nErhöht Eure Ausweichchance um 20% und die Eures Begleiters um 9%. Außerdem wird die Abklingzeit Eurer Fähigkeit 'Flankenangriff' um 50% verringert."},
[416084] = {name = "Gürtel prägen - Aspekt der Viper", additional_info = "Wirken in 3 sek.\nBenötigt Gürtel\n[q]Prägt Euren Gürtel mit der Rune 'Aspekt der Viper':\n\n\nDer Jäger nimmt die Aspekte einer Viper an. Jeder Eurer automatischen Distanz- und Nahkampfangriffe regeneriert Mana, der gesamte verursachte Schaden wird jedoch um 10% verringert. Zusätzlich erhaltet Ihr alle 3 Sek. 10% Eures maximalen Manas. Das gewonnene Mana basiert auf dem Tempo Eurer Waffe. Es kann immer nur jeweils ein Aspekt aktiv sein."},
[416085] = {name = "Helm prägen - Sichern und Laden", additional_info = "Wirken in 3 sek.\nBenötigt Helme\n[q]Prägt Euren Helm mit der Rune 'Sichern und Laden':\n\n\nEach time one of your traps is triggered, your next Shot (except Scatter Shot) ability within 20 sec costs no mana and does not incur a cooldown."},
[416086] = {name = "Gürtel prägen - Nahkampfspezialist", additional_info = "Wirken in 3 sek.\nBenötigt Gürtel\n[q]Prägt Euren Gürtel mit der Rune 'Nahkampfspezialist':\n\n\n'Mungobiss' und 'Raptorstoß' haben bei jedem Angriff eine Chance von 30%, die Abklingzeiten von 'Mungobiss' und 'Raptorstoß' abzuschließen."},
[416087] = {name = "Gürtel prägen - Tödlicher Schuss", additional_info = "Wirken in 3 sek.\nBenötigt Gürtel\n[q]Prägt Euren Gürtel mit der Rune 'Tödlicher Schuss':\n\n\nIhr versucht, ein verletztes Ziel mit einem Distanzangriff zu töten, der 100% Waffenschaden plus [113 / 100 * 100 / 100 * (2.976264 + 0.641066 * 60 + 0.022519 * 60 * 60)] verursacht. 'Tödlicher Schuss' hat keine Minimaldistanz, und seine Abklingzeit wird zurückgesetzt, wenn er gegen einen Gegner mit 20% oder weniger Gesundheit eingesetzt wird."},
[416089] = {name = "Stiefel prägen - Flügeldrachenstoß", additional_info = "Wirken in 3 sek.\nBenötigt Stiefel"},
[416090] = {name = "Helm prägen - Schneller Tod", additional_info = "Wirken in 3 sek.\nBenötigt Helme\n[q]Prägt Euren Helm mit der Rune 'Schneller Tod':\n\n\nVerringert die Abklingzeit von 'Schnellfeuer' um 80%, 'Schnellfeuer' erhöht zusätzlich das Nahkampfangriffstempo um 40% und Eure nächste Schussfähigkeit innerhalb von 20 sec, nachdem Ihr einen Gegner getötet habt, der Erfahrung oder Ehre gewährt, verursacht 20% mehr Schaden."},
[416091] = {name = "Hosen prägen - Scharfschützentraining", additional_info = "Wirken in 3 sek.\nBenötigt Hosen\n[q]Prägt Eure Hosen mit der Rune 'Scharfschützentraining':\n\n\nDie kritische Trefferchance Eurer Schussfähigkeiten ist um 2% erhöht, wenn Ihr Euch in den letzten 2 Sek. nicht bewegt habt. Dieser Effekt stapelt sich pro Sekunde bis auf maximal 5 Stapel. Bei 5 Stapeln kann 'Gezielter Schuss' sofort gewirkt werden. Während Ihr Euch bewegt, verliert Ihr 1 Stapel pro Sekunde."},
[416093] = {name = "Armschienen prägen - Raptorenfuror", additional_info = "Wirken in 3 sek.\nBenötigt Armschienen\n[q]Prägt Eure Armschienen mit der Rune 'Raptorenfuror':\n\n\n'Raptorstoß' erhöht den durch 'Raptorstoß' und 'Mungobiss' verursachten Schaden 30 sec lang um 15%. Bis zu 5-mal stapelbar. Nachfolgende Einsätze verlängern nicht die Dauer des Effekts."},
