[417135] = {name = "Orkanwinde", additional_info = "[q]Erhöht den verursachten Schaden Eures Zaubers 'Hurrikan' um 100%, entfernt die Abklingzeit und reduziert seine Manakosten um 60%."},
[417141] = {name = "Berserker", additional_info = "Sofort 3 min Abklingzeit\n[q]Wenn aktiviert, lässt diese Fähigkeit 'Zerfleischen (Bär)' und 'Aufschlitzen' bis zu 3 Ziele treffen. 'Aufschlitzen' kostet keine Wut und 'Zerfleischen (Bär)' unterliegt keiner Abklingzeit. In Katzengestalt werden die Energiekosten aller Eurer Fähigkeiten um 50% verringert. Hält 15 sec lang an. Erfordert Katzengestalt, Bärengestalt oder Terrorbärengestalt.\n\n Entfernt sofort Furchteffekte und macht Euch während seiner Dauer gegen sie immun."},
[417145] = {name = "Aufspießen", additional_info = "[q]Wenn Ihr ein Ziel mit 'Aufschlitzen', 'Prankenhieb' oder 'Zermalmen' trefft, besteht eine Chance von 15%, dass die Abklingzeit von 'Zerfleischen (Bär)' abgeschlossen und 10 Wut erzeugt wird. Wenn Ihr ein Ziel mit 'Zerfleischen' (Katze) oder 'Schreddern' trefft, besteht eine Chance von 15%, dass die Abklingzeit von 'Tigerfuror' abgeschlossen wird.\n(Procchance: 15%, 100ms Abklingzeit)"},
[417146] = {name = "Erblühen", additional_info = nil},
[417147] = {name = "Erblühen", additional_info = "100 Meter Reichweite\n{Sofort} {10 sek. Abklingzeit}\n[q]Heilt alle Mitglieder der Gruppe oder des Schlachtzugs innerhalb von 15 Metern um den Zielort 15 sec lang alle 5 Sek um [(38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60) * 16 / 100] Gesundheit."},
