[417437] = {name = "Hauen (Katze)", additional_info = nil},
[417440] = {name = "Hauen (Bär)", additional_info = "{10 Wut} {8 Meter Reichweite}\n{Spontanzauber} {6 sek. Abklingzeit}\nBenötigt Bärengestalt, Terrorbärengestalt\n[q]Trifft Gegner in der Nähe, fügt ihnen [45 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100 + 0.092 * Attack power] Blutungsschaden zu und lässt sie 15 sec lang zusätzlich für [12 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100 * 5 + 0.125 * Attack power] Schaden bluten. Bei Anwendung in Bärengestalt ist dieser Effekt bis zu 3-mal stapelbar."},
[417441] = {name = "Hauen (Bär)", additional_info = nil},
[417448] = {name = "Hauen (Katze)", additional_info = "{40 Energie} {8 Meter Reichweite}\nSofort\nBenötigt Katzengestalt\n[q]Trifft Gegner in der Nähe, fügt ihnen [60 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100 + 0.104 * Attack power] Blutungsschaden zu und lässt sie 15 sec lang zusätzlich für [40 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100 * 5 + 0.0661 * 5 * Attack power] Schaden bluten. Gewährt 1 Combopunkt."},
[417450] = {name = "Hauen (Katze)", additional_info = nil},
[417453] = {name = "Hauen (Katze)", additional_info = "[q]Erhaltet mehrere neue dämonische Fähigkeiten: 'Unterbrechen', 'Dämonischer Ansturm', 'Dämonisches Heulen' und 'Infernalischer Schlag'.\n\n\nErstickt Euren Gegner mit einer Welle schattenhafter Energie, die 10 Schaden verursacht, das Wirken von Zaubern unterbricht und 5 sec lang verhindert, dass Zauber dieser Art gewirkt werden können.\n\n\nStürmt auf einen Gegner zu und betäubt ihn für 1 sec Kann nicht im Kampf verwendet werden.\n\n\nZwingt alle Gegner in der Nähe 6 sec lang, ihre Angriffe auf Euch zu konzentrieren.\n\n\nSpringt durch die Luft und schmettert auf alle Gegner im Umkreis von 8 Metern um das Zielgebiet hinab, verursacht 100 Schattenschaden und betäubt sie für 2 sec"},
