[424759] = {name = "Berserker", additional_info = "[q]Erhaltet die Fähigkeit 'Berserker':\n\n\nWenn aktiviert, lässt diese Fähigkeit 'Zerfleischen (Bär)' und 'Aufschlitzen' bis zu 3 Ziele treffen. 'Aufschlitzen' kostet keine Wut und 'Zerfleischen (Bär)' unterliegt keiner Abklingzeit. In Katzengestalt werden die Energiekosten aller Eurer Fähigkeiten um 50% verringert. Hält 15 sec lang an. Erfordert Katzengestalt, Bärengestalt oder Terrorbärengestalt.\n\n Entfernt sofort Furchteffekte und macht Euch während seiner Dauer gegen sie immun."},
