[425336] = {name = "Schamanistische Wut", additional_info = "Sofort 1 min Abklingzeit\n[q]Reduziert sämtlichen von Euch erlittenen Schaden um 20% und Ihr regeneriert 15 sec lang pro Sekunde Mana in Höhe von 5% Eures maximalen Manas. Eure Gruppen- und Schlachtzugsmitglieder im Umkreis von 40 Metern erhalten zudem Mana in Höhe von 18% des von Euch auf diese Weise bezogenen Manas."},
