[427069] = {name = "Schildmeisterschaft", additional_info = "[q]Erhaltet die Fähigkeit 'Schildmeisterschaft':\n\n\nErhöht den gesamten von Euch verursachten körperlichen Schaden um 10%, während Ihr ein Schild ausgerüstet habt, und verringert die Dauer aller auf Euch angewandten Entwaffnungseffekte um 50%. Dieser Effekt ist mit anderen Effekten, welche die Entwaffnungsdauer verringern, nicht stapelbar."},
[427070] = {name = "Toben", additional_info = "[q]Erhaltet die Fähigkeit 'Toben':\n\n\nLauft Amok und erhöht Eure Angriffskraft 30 sec lang um 10%. Diese Fähigkeit kann nur bei einem Wutanfall eingesetzt werden."},
[427073] = {name = "Schwert und Schild", additional_info = "[q]Erhaltet die Fähigkeit 'Schwert und Schild':\n\n\nWenn Eure Fähigkeiten 'Verwüsten' und 'Rache' Schaden verursachen, besteht eine Chance von 30%, die Abklingzeit von 'Schildschlag' abzuschließen und die Wutkosten der Fähigkeit 5 sec lang um 100% zu verringern."},
[427074] = {name = "Abrisskommando", additional_info = "[q]Erhaltet die Fähigkeit 'Abrisskommando':\n\n\nEure kritischen Nahkampftreffer machen Euch wütend (und aktivieren Fähigkeiten, für die Ihr wütend sein müsst) und erhöhen den Schaden von 'Tödlicher Stoß', 'Blutdurst' und 'Schildschlag' 12 sec lang um 10%."},
[427076] = {name = "Helm prägen - Verlangen nach Blut", additional_info = "Wirken in 3 sek.\nBenötigt Helme\n[q]Prägt Euren Helm mit der Rune 'Verlangen nach Blut':\n\n\nImmer wenn Eure Fähigkeit 'Verwunden' Schaden verursacht, wird Eure Fähigkeit 'Überwältigen' 9 sec lang oder für 1 Angriff aktiviert. Dieser Effekt tritt alle 6 Sek. höchstens einmal ein."},
[427078] = {name = "Helm prägen - Wachsamkeit", additional_info = "Wirken in 3 sek.\nBenötigt Helme\n[q]Prägt Euren Helm mit der Rune 'Wachsamkeit':\n\n\nFokussiert Euren schützenden Blick auf ein Gruppen- oder Schlachtzugsmitglied, verringert so seinen erlittenen Schaden um 3% und überträgt 10% seiner erzeugten Bedrohung auf Euch. Zusätzlich wird jedes Mal, wenn das Ziel von einem Angriff getroffen wird, die Abklingzeit Eurer Fähigkeit 'Spott' abgeschlossen. Hält 30 min lang an. Dieser Effekt kann nur auf jeweils einem Ziel wirken."},
[427080] = {name = "Helm prägen - Schildmeisterschaft", additional_info = "Wirken in 3 sek.\nBenötigt Helme\n[q]Prägt Euren Helm mit der Rune 'Schildmeisterschaft':\n\n\nErhöht den gesamten von Euch verursachten körperlichen Schaden um 10%, während Ihr ein Schild ausgerüstet habt, und verringert die Dauer aller auf Euch angewandten Entwaffnungseffekte um 50%. Dieser Effekt ist mit anderen Effekten, welche die Entwaffnungsdauer verringern, nicht stapelbar."},
[427081] = {name = "Armschienen prägen - Toben", additional_info = "Wirken in 3 sek.\nBenötigt Armschienen\n[q]Prägt Eure Armschienen mit der Rune 'Toben':\n\n\nLauft Amok und erhöht Eure Angriffskraft 30 sec lang um 10%. Diese Fähigkeit kann nur bei einem Wutanfall eingesetzt werden."},
[427082] = {name = "Armschienen prägen - Schwert und Schild", additional_info = "Wirken in 3 sek.\nBenötigt Armschienen\n[q]Prägt Eure Armschienen mit der Rune 'Schwert und Schild':\n\n\nWenn Eure Fähigkeiten 'Verwüsten' und 'Rache' Schaden verursachen, besteht eine Chance von 30%, die Abklingzeit von 'Schildschlag' abzuschließen und die Wutkosten der Fähigkeit 5 sec lang um 100% zu verringern."},
[427084] = {name = "Armschienen prägen - Abrisskommando", additional_info = "Wirken in 3 sek.\nBenötigt Armschienen\n[q]Prägt Eure Armschienen mit der Rune 'Abrisskommando':\n\n\nEure kritischen Nahkampftreffer machen Euch wütend (und aktivieren Fähigkeiten, für die Ihr wütend sein müsst) und erhöhen den Schaden von 'Tödlicher Stoß', 'Blutdurst' und 'Schildschlag' 12 sec lang um 10%."},
