[427712] = {name = "Pandemie", additional_info = "[q]Regelmäßiger Schaden durch Eure Fähigkeiten 'Verderbnis', 'Instabiles Gebrechen', 'Fluch der Pein', 'Feuerbrand', 'Fluch der Verdammnis' und 'Lebensentzug' kann jetzt kritisch treffen.\n[q]Modifies Critical Strike Damage +101%:\nAnrufung , Anrufung , Anrufung , Anrufung , Anrufung , Area Death (TEST) , Feuerbrand , Feuerbrand , Feuerbrand , Feuerbrand , Feuerbrand , Feuerbrand , Feuerbrand , Feuerbrand , Fluch der Pein , Fluch der Pein , Fluch der Pein , Fluch der Pein , Fluch der Pein , Fluch der Pein , Fluch der Verdammnis , Lebensentzug , Lebensentzug , Lebensentzug , Lebensentzug , Schattenflamme , Schattenflamme , Verderbnis , Verderbnis , Verderbnis , Verderbnis , Verderbnis , Verderbnis , Verderbnis"},
