[427717] = {name = "Instabiles Gebrechen", additional_info = "{15% von Grundmana} {30 Meter Reichweite}\nWirken in 1.5 sek.\n[q]Schattenenergie zerstört langsam das Ziel und verursacht im Verlauf von 18 sec insgesamt [110 * 6 * (6.568597 + 0.672028 * 60 + 0.031721 * 60 * 60) / 100] Schaden. Sollte 'Instabiles Gebrechen' gebannt werden, erleidet der Bannende [110 * 9 * (6.568597 + 0.672028 * 60 + 0.031721 * 60 * 60) / 100] Schaden und wird 5 sec lang zum Schweigen gebracht. Es kann pro Hexenmeister jeweils nur ein Effekt von 'Instabiles Gebrechen' oder 'Feuerbrand' gleichzeitig auf einem beliebigen Ziel aktiv sein."},
