[428713] = {name = "Baumrinde", additional_info = "{15% von Grundmana} {40 Meter Reichweite}\nSofort 1 min Abklingzeit\n[q]Die Haut des Ziels wird hart wie Rinde. Erlittener körperlicher Schaden wird um 20% verringert. Während des Schutzes verursacht erlittener Schaden keine Verzögerung beim Zaubern. Hält 15 sec lang an."},
