[428726] = {name = "Fokussiertes Feuer", additional_info = "100 Meter Reichweite\nSofort\n[q]Verbraucht alle Anwendungen von 'Raserei' auf Eurem Tier, was Eurer Distanzangriffstempo um 3% erhöht und Eurem Tier 4 Fokus für jede verbrauchte Anwendung von 'Raserei' verleiht. Hält 20 sec lang an.\n\n Immer wenn Euer Tier einen einfachen Angriff ausführt, erhält es 'Raserei', und sein Nahkampfangriffstempo wird 10 sec lang um 6% erhöht. Bis zu 5-mal stapelbar."},
