[428739] = {name = "Tieffrieren", additional_info = "{9% von Grundmana} {30 Meter Reichweite}\n{Sofort} {30 sek. Abklingzeit}\n[q]Betäubt das Ziel für 5 sec Funktioniert nur bei eingefrorenen Zielen. Fügt Zielen, die dauerhaft gegen Betäubungseffekte immun sind, [462 * (13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) / 100 * ( 1 ) ] bis [538 * (13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) / 100 * ( 1 ) ] Schaden zu."},
[428740] = {name = "Ätzbecken", additional_info = nil},
[428741] = {name = "Glühende Rüstung", additional_info = "28% von Grundmana\nSofort\n[q]Fügt einem Gegner [10 / 100 * (13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60)] Feuerschaden zu, wenn Ihr getroffen werdet. Erhöht Eure kritische Zaubertrefferchance um 5% und verringert die Chance, dass Ihr kritische Treffer erleidet, um 5%. Es kann immer nur ein Rüstungszauber zur selben Zeit auf dem Magier aktiv sein. Hält 30 min lang an."},
