[428878] = {name = "Qualfeuerblitz", additional_info = "{20% von Grundmana} {35 Meter Reichweite}\nWirken in 2.5 sek.\n[q]Entfesselt eine realitätsverzerrende Explosion aus roher Magie auf Euren Gegner, die ihm zwischen [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 280 / 100] und [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 420 / 100] Schimärenschaden zufügt. Immer wenn Ihr 'Qualfeuerblitz' wirkt, wird der Schaden Eures nächsten Einsatzes von 'Qualfeuerblitz' innerhalb von 30 sec um 10% erhöht und Eure Willenskraft wird 30 sec lang um 10% verringert. Beides wird bis zu 10-mal gestapelt. Fällt Eure Willenskraft dabei auf 0, sterbt Ihr sofort. Der Schaden dieses Zaubers wird gegen den geringsten Wert vom Arkan-, Feuer- und Frostwiderstand des Ziels gerechnet."},
[428885] = {name = "Zeitanomalie", additional_info = "{11% von Grundmana} {40 Meter Reichweite}\n{Sofort} {30 sek. Abklingzeit}\n[q]Schleudert eine Kugel aus Temporalenergie, die sich langsam vorwärts bewegt und allen nahen Gruppenmitgliedern jede 2 Sek. einen Schild gewährt, der 15 sec lang [100 * (13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) / 100] Schaden absorbiert. Dieser Schild häuft zusätzlichen Wert an, wenn Gruppenmitglieder in der Nähe der Kugel bleiben."},
