[429125] = {name = "Eisige Adern", additional_info = "3% von Grundmana\nSofort 3 min Abklingzeit\n[q]Beschleunigt Euer Wirken von Zaubern, erhöht das Zaubertempo um 20% und verringert die Dauer der durch erlittenen Schaden verursachten Zauberzeiterhöhung beim Wirken von Zaubern um 100%. Hält 20 sec lang an."},
[429133] = {name = "Verbessertes Refugium", additional_info = "[q]Erhöht den durch Euren 'Segen des Refugiums' verhinderten Schaden um 100% und erhöht den durch Euren 'Segen des Refugiums' verursachten Schaden um 30% Eures Schildblockwerts."},
[429139] = {name = "Zorn", additional_info = "[q]Der Schaden Eurer 'Weihe' kann nun kritisch treffen, und der Schaden Eurer Zauber 'Exorzismus', 'Heiliger Schock', 'Heiliger Zorn' und 'Weihe' erhält eine zusätzliche Chance auf kritische Treffer, die der kritischen Trefferchance Eurer Nahkampftreffer entspricht."},
[429142] = {name = "Fanatismus", additional_info = "[q]Erhöht Eure kritische Trefferchance mit Heiligzaubern um 18%. Zudem heilen Eure kritischen Heilzauber das Ziel im Verlauf von 12 sec für 60% der geheilten Menge."},
[429144] = {name = "Reinigende Macht", additional_info = "[q]Verringert die Abklingzeit von 'Exorzismus' und 'Heiliger Zorn' um 50%. 'Heiliger Zorn' kann jetzt auf jedes Ziel gewirkt werden und betäubt dämonische sowie untote Ziele für 2 sec"},
[429145] = {name = "Heiliger Zorn", additional_info = "645 ManaWirken in 2 sek. 1 min Abklingzeit\n[q]Schleudert Blitze heiliger Macht in alle Richtungen, fügt dabei allen Zielen im Umkreis von 20 Metern 368 to 435 Heiligschaden zu und betäubt dämonische sowie untote Ziele für 2 sec"},
