[429152] = {name = "Verbesserter Hammer des Zorns", additional_info = "[q]'Hammer des Zorns' ist nun ein Spontanzauber und seine Abklingzeit wird immer dann abgeschlossen, wenn er einem Gegner mit weniger als 10% Gesundheit Schaden zufügt."},
