[429283] = {name = "Pandemie", additional_info = "[q]Erhaltet die Fähigkeit 'Pandemie':\n\n\nRegelmäßiger Schaden durch Eure Fähigkeiten 'Verderbnis', 'Instabiles Gebrechen', 'Fluch der Pein', 'Feuerbrand', 'Fluch der Verdammnis' und 'Lebensentzug' kann jetzt kritisch treffen."},
[429303] = {name = "Tieffrieren", additional_info = "[q]Erhaltet die Fähigkeit 'Tieffrieren':\n\n\nBetäubt das Ziel für 5 sec Funktioniert nur bei eingefrorenen Zielen. Fügt Zielen, die dauerhaft gegen Betäubungseffekte immun sind, [462 * (13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) / 100 * ( 1 ) ] bis [538 * (13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) / 100 * ( 1 ) ] Schaden zu."},
