[429305] = {name = "Zeitanomalie", additional_info = "[q]Erhaltet die Fähigkeit 'Zeitanomalie':\n\n\nSchleudert eine Kugel aus Temporalenergie, die sich langsam vorwärts bewegt und allen nahen Gruppenmitgliedern jede 2 Sek. einen Schild gewährt, der 15 sec lang [100 * (13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) / 100] Schaden absorbiert. Dieser Schild häuft zusätzlichen Wert an, wenn Gruppenmitglieder in der Nähe der Kugel bleiben."},
[429306] = {name = "Helm prägen - Zeitanomalie", additional_info = "Wirken in 3 sek.\nBenötigt Helme\n[q]Prägt Euren Helm mit der Rune 'Zeitanomalie':\n\n\nSchleudert eine Kugel aus Temporalenergie, die sich langsam vorwärts bewegt und allen nahen Gruppenmitgliedern jede 2 Sek. einen Schild gewährt, der 15 sec lang [100 * (13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) / 100] Schaden absorbiert. Dieser Schild häuft zusätzlichen Wert an, wenn Gruppenmitglieder in der Nähe der Kugel bleiben."},
[429307] = {name = "Glühende Rüstung", additional_info = "[q]Erhaltet die Fähigkeit 'Glühende Rüstung':\n\n\nFügt einem Gegner [10 / 100 * (13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60)] Feuerschaden zu, wenn Ihr getroffen werdet. Erhöht Eure kritische Zaubertrefferchance um 5% und verringert die Chance, dass Ihr kritische Treffer erleidet, um 5%. Es kann immer nur ein Rüstungszauber zur selben Zeit auf dem Magier aktiv sein. Hält 30 min lang an."},
[429308] = {name = "Armschienen prägen - Glühende Rüstung", additional_info = "Wirken in 3 sek.\nBenötigt Armschienen\n[q]Prägt Eure Armschienen mit der Rune 'Glühende Rüstung':\n\n\nFügt einem Gegner [10 / 100 * (13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60)] Feuerschaden zu, wenn Ihr getroffen werdet. Erhöht Eure kritische Zaubertrefferchance um 5% und verringert die Chance, dass Ihr kritische Treffer erleidet, um 5%. Es kann immer nur ein Rüstungszauber zur selben Zeit auf dem Magier aktiv sein. Hält 30 min lang an."},
[429309] = {name = "Armschienen prägen - Verzerrung", additional_info = "Wirken in 3 sek.\nBenötigt Armschienen\n[q]Prägt Eure Armschienen mit der Rune 'Verzerrung':\n\n\nTeleportiert Euch dahin zurück, wo Ihr zuletzt 'Blinzeln' gewirkt habt, und schließt die Abklingzeit von 'Blinzeln' ab. Lässt sich nur innerhalb von 10 sec nach dem Wirken von 'Blinzeln' nutzen."},
[429310] = {name = "Qualfeuerblitz", additional_info = "[q]Erhaltet die Fähigkeit 'Qualfeuerblitz':\n\n\nEntfesselt eine realitätsverzerrende Explosion aus roher Magie auf Euren Gegner, die ihm zwischen [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 280 / 100] und [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 420 / 100] Schimärenschaden zufügt. Immer wenn Ihr 'Qualfeuerblitz' wirkt, wird der Schaden Eures nächsten Einsatzes von 'Qualfeuerblitz' innerhalb von 30 sec um 10% erhöht und Eure Willenskraft wird 30 sec lang um 10% verringert. Beides wird bis zu 10-mal gestapelt. Fällt Eure Willenskraft dabei auf 0, sterbt Ihr sofort. Der Schaden dieses Zaubers wird gegen den geringsten Wert vom Arkan-, Feuer- und Frostwiderstand des Ziels gerechnet."},
[429311] = {name = "Armschienen prägen - Qualfeuerblitz", additional_info = "Wirken in 3 sek.\nBenötigt Armschienen\n[q]Prägt Eure Armschienen mit der Rune 'Qualfeuerblitz':\n\n\nEntfesselt eine realitätsverzerrende Explosion aus roher Magie auf Euren Gegner, die ihm zwischen [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 280 / 100] und [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 420 / 100] Schimärenschaden zufügt. Immer wenn Ihr 'Qualfeuerblitz' wirkt, wird der Schaden Eures nächsten Einsatzes von 'Qualfeuerblitz' innerhalb von 30 sec um 10% erhöht und Eure Willenskraft wird 30 sec lang um 10% verringert. Beides wird bis zu 10-mal gestapelt. Fällt Eure Willenskraft dabei auf 0, sterbt Ihr sofort. Der Schaden dieses Zaubers wird gegen den geringsten Wert vom Arkan-, Feuer- und Frostwiderstand des Ziels gerechnet."},
