[429348] = {name = "[q4]Veränderliche silberne Brustplatte", additional_info = "Wirken in 45 sek.\nTools: Schmiedehammer\nReagenzien:\nLeuchtende silberne Brustplatte , Splitter der Leere\n[q4]Veränderliche silberne Brustplatte\nWird beim Aufheben gebunden\nEinzigartig anlegbar: [Void-Touched] (1)Brust Kette\n238 Rüstung\n+12 Stärke\n+5 Ausdauer\nHaltbarkeit 145 / 145\n25\nBenötigtSchmiedekunst\n(100)\n[q2]Anlegen: Dieser Gegenstand ist mit der rohen Macht der Leere erfüllt. Wenn der Träger angegriffen wird, hat dieser Gegenstand eine hohe Chance, einen schrecklichen Fluch zu wirken, durch den der Angreifer 15 Sek. lang zusätzlichen Schaden aus allen Quellen erleidet. (Procchance: 25%)\n[q2]Anlegen: Erhöht Eure Trefferchance mit allen Angriffen und Zaubern um 1%."},
