[429351] = {name = "[q4]Extraplanare Spinnenseidenstiefel", additional_info = "Wirken in 45 sek.\nReagenzien:\nSplitter der Leere , Spinnenseidenstiefel\n[q4]Extraplanare Spinnenseidenstiefel\nWird beim Aufheben gebunden\nEinzigartig anlegbar: [Void-Touched] (1)Füße Stoff\n35 Rüstung\n+5 Ausdauer\n+5 Intelligenz\n+6 Willenskraft\nHaltbarkeit 50 / 50\n25\nBenötigtSchneiderei\n(100)\n[q2]Benutzen: Tretet zeitweise in eine andere Existenzebene ein, was sofort die Bedrohung reduziert und allen erlittenen und verursachten Schaden 6 sec lang um 30% verringert. (10 Min Abklingzeit)\n[q2]Anlegen: Erhöht durch Zauber und magische Effekte zugefügten Schaden und Heilung um bis zu 7.\n[q2]Anlegen: Erhöht Eure Trefferchance mit allen Angriffen und Zaubern um 1%."},
