[429869] = {name = "[q4]Leerenberührte Lederstulpen", additional_info = "Wirken in 45 sek.\nReagenzien:\nSplitter der Leere , Gekräftigte Lederhandschuhe\n[q4]Leerenberührte Lederstulpen\nWird beim Aufheben gebunden\nEinzigartig anlegbar: [Void-Touched] (1)Hände Leder\n70 Rüstung\n+5 Ausdauer\n+7 Intelligenz\n+6 Willenskraft\nHaltbarkeit 70 / 70\n25\nBenötigtLederverarbeitung\n(100)\n[q2]Anlegen: Erhöht Eure Trefferchance mit allen Angriffen und Zaubern um 1%.\n[q2]Benutzen: Verfallt in Wahnsinn und erhöht so 10 sec lang Euren Zauberschaden um 10% sowie Eure erzeugte Bedrohung. (10 Min Abklingzeit)"},
