[431446] = {name = "Aufspießen", additional_info = "[q]Erhaltet die Fähigkeit 'Aufspießen':\n\n\nWenn Ihr ein Ziel mit 'Aufschlitzen', 'Prankenhieb' oder 'Zermalmen' trefft, besteht eine Chance von 15%, dass die Abklingzeit von 'Zerfleischen (Bär)' abgeschlossen und 10 Wut erzeugt wird. Wenn Ihr ein Ziel mit 'Zerfleischen' (Katze) oder 'Schreddern' trefft, besteht eine Chance von 15%, dass die Abklingzeit von 'Tigerfuror' abgeschlossen wird."},
[431447] = {name = "Helm prägen - Aufspießen", additional_info = "Wirken in 3 sek.\nBenötigt Helme\n[q]Prägt Euren Helm mit der Rune 'Aufspießen':\n\n\nWenn Ihr ein Ziel mit 'Aufschlitzen', 'Prankenhieb' oder 'Zermalmen' trefft, besteht eine Chance von 15%, dass die Abklingzeit von 'Zerfleischen (Bär)' abgeschlossen und 10 Wut erzeugt wird. Wenn Ihr ein Ziel mit 'Zerfleischen' (Katze) oder 'Schreddern' trefft, besteht eine Chance von 15%, dass die Abklingzeit von 'Tigerfuror' abgeschlossen wird."},
