[432237] = {name = "Statischer Schock", additional_info = "[q]Erhaltet die Fähigkeit 'Statischer Schock':\n\n\nEuer 'Blitzschlagschild' hat jetzt 9 Aufladungen und Eure Nahkampfangriffe haben eine Chance von 12% (beim Kämpfen mit zwei Waffen eine Chance von 6% ), eine dieser Aufladungen auszulösen und Eurem Ziel sofort Schaden zuzufügen."},
[432238] = {name = "Armschienen prägen - Statischer Schock", additional_info = "Wirken in 3 sek.\nBenötigt Armschienen\n[q]Prägt Eure Armschienen mit der Rune 'Statischer Schock':\n\n\nEuer 'Blitzschlagschild' hat jetzt 9 Aufladungen und Eure Nahkampfangriffe haben eine Chance von 12% (beim Kämpfen mit zwei Waffen eine Chance von 6% ), eine dieser Aufladungen auszulösen und Eurem Ziel sofort Schaden zuzufügen."},
[432240] = {name = "Überladen", additional_info = "[q]Erhaltet die Fähigkeit 'Überladen':\n\n\nEuer 'Blitzschlagschild' verliert nie seine Aufladungen, hat jetzt eine Abklingzeit von 3 Sek. und fügt allen Gegnern innerhalb von 8 Metern Schaden zu."},
