[435904] = {name = "[q4]Leuchtende Gneuro-verkettete Gugel", additional_info = "Wirken in 45 sek.\nReagenzien:\nHyperleitender Arkanfaden , Geschmeidiger dicker Balg (5), Seidenfaden (2), Schwach leuchtendes Leder (5)\n[q4]Leuchtende Gneuro-verkettete Gugel\nWird beim Aufheben gebunden\nKopf Leder\n118 Rüstung\n+14 Beweglichkeit\n+14 Ausdauer\nHaltbarkeit 70 / 70\n40\nBenötigtLederverarbeitung\n(225)\n[q2]Anlegen: Erhöht Eure Trefferchance mit allen Angriffen und Zaubern um 1%.\n[q2]Anlegen: +3 Waffenschaden.\n[q2]Benutzen: Belegt Euch mit 'Gneurologischer Schock', was Euch sofort 343 to 757 Schaden zufügt, aber auch Eure Nahkampf- und Distanzangriffe 10 sec lang um 20% beschleunigt. (10 Min Abklingzeit)"},
