[435908] = {name = "[q4]Gehärteter Interferenzen-negierender Helm", additional_info = "Wirken in 45 sek.\nTools: Schmiedehammer\nReagenzien:\nMithrilbarren (25), Echtsilberplatten mit geringer Grundstrahlung (4), Hyperleitender Arkanfaden , Schwach leuchtendes Leder (2)\n[q4]Gehärteter Interferenzen-negierender Helm\nWird beim Aufheben gebunden\nKopf Platte\n426 Rüstung\n+20 Stärke\n+14 Ausdauer\nHaltbarkeit 100 / 100\n40\nBenötigtSchmiedekunst\n(225)\n[q2]Anlegen: Erhöht Eure kritische Trefferchance aller Eurer Angriffe und Zauber um 1%.\n[q2]Benutzen: Gewährt höchste Konzentration, die 10 sec lang die Bewegungsgeschwindigkeit um 20% verringert, aber währenddessen Euren Zauberwiderstand gegen alle Magiearten um 50 sowie das Angriffstempo im Nahkampf um 20% erhöht. (10 Min Abklingzeit)\n[q]\"Schützt Euer Hirn garantiert vor allen Bedrohungen, physischen wie anderen!\""},
