[435949] = {name = "[q4]Leuchtende hyperleitende Schuppenkappe", additional_info = "Wirken in 45 sek.\nReagenzien:\nEchtsilberplatten mit geringer Grundstrahlung , Dicke Murlocschuppe (10), Schwach leuchtendes Leder (5), Isolierendes Gniodin\n[q4]Leuchtende hyperleitende Schuppenkappe\nWird beim Aufheben gebunden\nKopf Kette\n242 Rüstung\n+14 Ausdauer\n+15 Intelligenz\nHaltbarkeit 85 / 85\n40\nBenötigtLederverarbeitung\n(225)\n[q2]Anlegen: Erhöht durch Zauber und magische Effekte zugefügten Schaden und Heilung um bis zu 21.\n[q2]Benutzen: Belegt Euch mit 'Hyperleitender Schock', was Euch sofort 312 to 688 Schaden zufügt, aber auch Euer Zauberwirken 10 sec lang um 20% beschleunigt. (10 Min Abklingzeit)"},
[435950] = {name = "Muster: Leuchtende hyperleitende Schuppenkappe", additional_info = "100 Meter Reichweite\nWirken in 3 sek.\n[q]Lehrt Euch, wie man eine leuchtende hyperleitende Schuppenkappe herstellt."},
[435951] = {name = "[q4]Gneuro-leitende Kapuze des Kanalisierers", additional_info = "Wirken in 45 sek.\nReagenzien:\nIsolierendes Gniodin , Geschmeidiger dicker Balg (5), Schwach leuchtendes Leder (5), Hyperleitender Arkanfaden\n[q4]Gneuro-leitende Kapuze des Kanalisierers\nWird beim Aufheben gebunden\nKopf Leder\n118 Rüstung\n+11 Ausdauer\n+12 Intelligenz\n+11 Willenskraft\nHaltbarkeit 70 / 70\n40\nBenötigtLederverarbeitung\n(225)\n[q2]Anlegen: Erhöht durch Zauber und magische Effekte zugefügten Schaden und Heilung um bis zu 21.\n[q2]Benutzen: Gewährt 'Gneuromantische Meditation', wodurch 20 sec lang 100% Eurer Manaregeneration während des Zauberwirkens erhalten bleibt und der verursachte Schaden und die hervorgerufene Heilung Eurer Zauber um bis zu 50 erhöht werden. (10 Min Abklingzeit)"},
[435952] = {name = "Muster: Gneuro-leitende Kapuze des Kanalisierers", additional_info = "100 Meter Reichweite\nWirken in 3 sek.\n[q]Lehrt Euch, wie man eine Gneuro-leitende Kapuze des Kanalisierers herstellt."},
[435953] = {name = "[q4]Strahlungsresistente Schuppenkapuze", additional_info = "Wirken in 45 sek.\nReagenzien:\nEchtsilberplatten mit geringer Grundstrahlung , Geschmeidiger dicker Balg (5), Schwach leuchtendes Leder (5), Isolierendes Gniodin\n[q4]Strahlungsresistente Schuppenkapuze\nWird beim Aufheben gebunden\nKopf Kette\n[q2]342 Rüstung\n+10 Ausdauer\n+10 Intelligenz\nHaltbarkeit 85 / 85\n40\nBenötigtLederverarbeitung\n(225)\n[q2]Anlegen: Erhöht Eure Trefferchance mit allen Angriffen und Zaubern um 1%.\n[q2]Anlegen: +32 Angriffskraft.\n[q2]Benutzen: Aktiviert die Protokolle zur Strahlungsabschwächung in diesem Helm, die sofort alle aktiven Gifteffekte von Euch entfernen und Euch 3 sec lang immun gegen jeglichen Naturschaden machen. (10 Min Abklingzeit)"},
[435954] = {name = "Muster: Strahlungsresistente Schuppenkapuze", additional_info = "100 Meter Reichweite\nWirken in 3 sek.\n[q]Lehrt Euch, wie man eine strahlungsresistente Schuppenkapuze herstellt."},
[435956] = {name = "[q3]Polierte Echtsilberzahnräder", additional_info = "Wirken in 8 sek.\nTools: Schmiedehammer\nReagenzien:\nEchtsilberbarren , Haufen aus stumpfen Zahnrädern (5)\n[q3]Polierte Echtsilberzahnräder"},
[435957] = {name = "Bauplan: Polierte Echtsilberzahnräder", additional_info = "100 Meter Reichweite\nWirken in 3 sek.\n[q]Lehrt Euch, wie man polierte Echtsilberzahnräder herstellt."},
[435958] = {name = "[q4]Wirbelnder Echtsilberzahnradschild", additional_info = "Wirken in 45 sek.\nTools: Schmiedehammer\nReagenzien:\nEchtsilberplatten mit geringer Grundstrahlung (3), Polierte Echtsilberzahnräder (5), Schwach leuchtendes Leder (2), Mithrilgehäuse (2), Gyrochronatom (2), Mithrilbarren (15)\n[q4]Wirbelnder Echtsilberzahnradschild\nWird beim Aufheben gebunden\nSchildhand Schild\n1760 Rüstung\n29 Blocken\n+9 Stärke\n+10 Ausdauer\nHaltbarkeit 120 / 120\n40\nBenötigtIngenieurskunst\n(225)\n[q2]Anlegen: Erhöht Eure Chance, Angriffe mit einem Schild zu blocken, um 1%.\n[q2]Anlegen: Bei erfolgreichem Blocken fügen die wirbelnden rasiermesserscharfen Zahnräder dieses Schilds dem Angreifer 5 to 10 körperlichen Schaden und dem Träger 2 to 10 körperlichen Schaden zu.\n[q]\"Die rotierenden Schneiden dieses Schilds sind überraschend scharfkantig. Er wirkt genauso gefährlich für den Träger wie für den Angreifer.\""},
[435959] = {name = "Bauplan: Wirbelnder Echtsilberzahnradschild", additional_info = "100 Meter Reichweite\nWirken in 3 sek.\n[q]Lehrt Euch, wie man einen wirbelnden Echtsilberzahnradschild herstellt."},
[435960] = {name = "[q4]Hyperleitendes Goldnetz", additional_info = "Wirken in 45 sek.\nTools: Bogenlichtschraubenschlüssel\nReagenzien:\nPolierte Echtsilberzahnräder (3), Hyperleitender Arkanfaden (3), Schwach leuchtendes Leder , Goldbarren (10)\n[q4]Hyperleitendes Goldnetz\nWird beim Aufheben gebunden\nTaille Stoff\n40 Rüstung\n+9 Ausdauer\nHaltbarkeit 35 / 35\n40\nBenötigtIngenieurskunst\n(225)\n[q2]Anlegen: Erhöht Eure kritische Trefferchance aller Eurer Angriffe und Zauber um 1%.\n[q2]Anlegen: Erhöht Eure Trefferchance mit allen Angriffen und Zaubern um 1%.\n[q2]Benutzen: Ihr zieht eine hyperleitende Münze aus Eurem Gürtel und werft sie hoch. Kopf: Erhöht Eure kritische Trefferchance mit allen Zaubern und Angriffen 30 sec lang um 3%. Zahl: Erhöht Eure Bewegungsgeschwindigkeit 30 sec lang um 10%. (15 Min Abklingzeit)\n[q]\"Dieser Gürtel klickt leise, während Ihr Euch bewegt.\""},
[435961] = {name = "Bauplan: Hyperleitendes Goldnetz", additional_info = "100 Meter Reichweite\nWirken in 3 sek.\n[q]Lehrt Euch, wie man ein hyperleitendes Goldnetz herstellt."},
[435962] = {name = "Buchband der Erlösung", additional_info = nil},
[435963] = {name = "Hoch wirksame Strahlungsbombe", additional_info = "25 Meter Reichweite\nWirken in 1 sek.\n[q]Verursacht im Explosionsradius 150 to 250 Feuerschaden und zusätzlich 10 Sek. lang alle 2 Sek. 25 Naturschaden. Verringert außerdem die Bewegungsgeschwindigkeit von betroffenen Zielen until cancelled lang um 25%."},
[435964] = {name = "[q2]Hoch wirksame Strahlungsbombe", additional_info = "Wirken in 8 sek.\nTools: Schmiedehammer\nReagenzien:\nRobustes Sprengpulver , Ablagerung von Gnomeregan , Mithrilbarren (2)\n[q2]Hoch wirksame Strahlungsbombe\n(2)\n35\nBenötigtIngenieurskunst\n(200)\n[q2]Benutzen: Verursacht im Explosionsradius 150 to 250 Feuerschaden und zusätzlich 10 Sek. lang alle 2 Sek. 25 Naturschaden. Verringert außerdem die Bewegungsgeschwindigkeit von betroffenen Zielen until cancelled lang um 25%. (1 Min Abklingzeit)"},
[435965] = {name = "Bauplan: Hoch wirksame Strahlungsbombe", additional_info = "100 Meter Reichweite\nWirken in 3 sek.\n[q]Lehrt Euch, wie man eine hoch wirksame Strahlungsbombe herstellt."},
[435966] = {name = "[q2]EZ-Thro-Strahlungsbombe", additional_info = "Wirken in 8 sek.\nTools: Schmiedehammer\nReagenzien:\nRobustes Sprengpulver (2), Ablagerung von Gnomeregan , Mithrilbarren (2)\n[q2]EZ-Thro-Strahlungsbombe\n(2)\n40\n[q2]Benutzen: Verursacht im Explosionsradius 112 to 188 Feuerschaden und zusätzlich 10 Sek. lang alle 2 Sek. 10 Naturschaden. Verringert außerdem die Bewegungsgeschwindigkeit von betroffenen Zielen 10 sec lang um 25%. (1 Min Abklingzeit)\n[q]\"Eine abgeschwächte, aber nicht weniger tödliche Version ihres komplexeren Gegenstücks, für diejenigen, denen zwar die Kompetenz fehlt, die aber dafür Zuversicht im Überfluss haben.\""},
[435967] = {name = "Bauplan: EZ-Thro-Strahlungsbombe", additional_info = "100 Meter Reichweite\nWirken in 3 sek.\n[q]Lehrt Euch, wie man eine EZ-Thro-Strahlungsbombe herstellt."},
[435968] = {name = "EZ-Thro-Strahlungsbombe", additional_info = "25 Meter Reichweite\nWirken in 1.5 sek.\n[q]Verursacht im Explosionsradius 112 to 188 Feuerschaden und zusätzlich 10 Sek. lang alle 2 Sek. 10 Naturschaden. Verringert außerdem die Bewegungsgeschwindigkeit von betroffenen Zielen 10 sec lang um 25%."},
[435969] = {name = "[q3]Isolierendes Gniodin", additional_info = "Wirken in 3 sek.\nReagenzien:\nVerbleite Phiole , Kiste mit besudelter Gniodin-Lösung (5)\n[q3]Isolierendes Gniodin"},
[435970] = {name = "Rezept: Isolierendes Gniodin", additional_info = "100 Meter Reichweite\nWirken in 3 sek.\n[q]Lehrt Euch, wie man eine Phiole isolierendes Gniodin herstellt."},
[435971] = {name = "Leicht bestrahlter Verjüngungstrank", additional_info = "Wirken in 3 sek.\nReagenzien:\nKiste mit besudelter Gniodin-Lösung , Schwacher Verjüngungstrank , Ablagerung von Gnomeregan (3), Kristallphiole (5)\n(6)\nWird beim Aufheben gebunden\n35\nBenötigtAlchimie\n(225)\n[q2]Benutzen: Stellt 262 to 438 Mana und 340 to 460 Gesundheit wieder her. Erhöht zudem 20 sec lang die Angriffskraft um 40 und den durch alle Zauber verursachten Schaden um 35. (2 Min Abklingzeit)\n[q]\"Mögliche Nebenwirkungen: Schwindel, Mundtrockenheit, Erschöpfung, Appetitlosigkeit, akute Strahlenvergiftung, Mutation und Tod. Bei der Anwendung den Anweisungen folgen.\""},
[435972] = {name = "Rezept: Leicht bestrahlter Verjüngungstrank", additional_info = "100 Meter Reichweite\nWirken in 3 sek.\n[q]Lehrt Euch, wie man einen leicht bestrahlten Verjüngungstrank aufbrüht."},
