[442222] = {name = "Statischer Bogen", additional_info = "200 Meter Reichweite\nSofort\n[q]Der Elektrokutor 6000 entfesselt einen Blitzschlag auf das am weitesten entfernte Ziel, der 975 to 1025 Naturschaden verursacht und bis zu 0-mal überspringt. Jeder Spielercharakter, der von diesem Effekt getroffen wird, erleidet until cancelled lang 975 to 1025% mehr Schaden durch ' Statischer Bogen '."},
