[442948] = {name = "Segen des Schutzes", additional_info = "{7% von Grundmana} {30 Meter Reichweite}\nSofort\n[q]Ein anvisiertes Gruppenmitglied ist 10 sec lang vor allen körperlichen Angriffen geschützt, allerdings kann es dabei weder angreifen noch körperliche Fähigkeiten einsetzen. Spielercharaktere können pro Paladin immer nur von einem Segen profitieren. Einmal geschützt, kann das Ziel 1 min lang nicht erneut durch 'Gottesschild', 'Göttlicher Schutz' oder 'Segen des Schutzes' unverwundbar gemacht werden."},
