[446233] = {name = "Auslöser des Aufstiegs der Schlange", additional_info = "[q]Gewährt dem Benutzer beim Verursachen von Distanz- oder Nahkampfschaden eine kleine Chance, mit dem Segen der Schlange erfüllt zu werden. Distanz- und Nahkampfangriffskraft 12 sec lang um 150 erhöht.\n(Procchance: 3%, 2Min. Abklingzeit)"},
[446236] = {name = "[q4]Leerenaufgeladene Unterarmschienen des Herbeirufers", additional_info = "Wirken in 45 sek.\nTools: Bogenlichtschraubenschlüssel\nReagenzien:\nAlptraumsaat (10), Träger Mantel der Alpträume , Leerenaufgeladene Unterarmschienen , Goldkraftkern (2), Thoriumapparat (2)\n[q4]Leerenaufgeladene Unterarmschienen des Herbeirufers\nWird beim Aufheben gebunden\nHandgelenke Stoff\n37 Rüstung\n+7 Ausdauer\n+8 Intelligenz\nHaltbarkeit 35 / 35\n50\nBenötigtIngenieurskunst\n(250)\n[q2]Anlegen: Erhöht durch Zauber und magische Effekte zugefügten Schaden und Heilung um bis zu 21.\n[q2]Anlegen: Schützt gegen bestimmte Arten von psychischen Angriffen.\n[q2]Benutzen: Kanalisiert die Macht der Leere und verleiht 15 sec lang Immunität gegenüber Furcht. (10 Min Abklingzeit)\n[q]\"Die besten Ideen aus Ziris ursprünglichen Entwurf mit ein paar zusätzlichen Modifikationen.\""},
[446237] = {name = "[q4]Leerenaufgeladene Unterarmschienen des Rächers", additional_info = "Wirken in 45 sek.\nReagenzien:\nAlptraumsaat (10), Träger Mantel der Alpträume , Leerenaufgeladene Unterarmschienen , Dichtes Sprengpulver (3), Sternrubin (2)\n[q4]Leerenaufgeladene Unterarmschienen des Rächers\nWird beim Aufheben gebunden\nHandgelenke Leder\n75 Rüstung\n+9 Stärke\n+18 Beweglichkeit\n+5 Ausdauer\nHaltbarkeit 40 / 40\n50\nBenötigtIngenieurskunst\n(250)\n[q2]Anlegen: Schützt gegen bestimmte Arten von psychischen Angriffen.\n[q2]Benutzen: Kanalisiert die Macht der Leere und verleiht 15 sec lang Immunität gegenüber Furcht. (10 Min Abklingzeit)\n[q]\"Die besten Ideen aus Ziris ursprünglichen Entwurf mit ein paar zusätzlichen Modifikationen.\""},
[446238] = {name = "[q4]Leerenaufgeladene Unterarmschienen des Beschützers", additional_info = "Wirken in 45 sek.\nTools: Bogenlichtschraubenschlüssel\nReagenzien:\nAlptraumsaat (10), Träger Mantel der Alpträume , Leerenaufgeladene Unterarmschienen , Goldkraftkern (2), Thoriumröhre (2)\n[q4]Leerenaufgeladene Unterarmschienen des Beschützers\nWird beim Aufheben gebunden\nHandgelenke Platte\n275 Rüstung\n+10 Stärke\n+12 Ausdauer\nHaltbarkeit 55 / 55\n50\nBenötigtIngenieurskunst\n(250)\n[q2]Anlegen: Erhöht den Blockwert Eures Schildes um 19.\n[q2]Anlegen: Schützt gegen bestimmte Arten von psychischen Angriffen.\n[q2]Benutzen: Kanalisiert die Macht der Leere und verleiht 15 sec lang Immunität gegenüber Furcht. (10 Min Abklingzeit)\n[q]\"Die besten Ideen aus Ziris ursprünglichen Entwurf mit ein paar zusätzlichen Modifikationen.\""},
