[446240] = {name = "Siegel der lebendigen Träume", additional_info = "30 Meter Reichweite\nWirken in 3 sek.\n[q]Erhaltet ein verzaubertes Siegel der lebendigen Träume, das Euch ermächtigt, wodurch 30 min lang der verursachte Schaden und die hervorgerufene Heilung Eurer Zauber um bis zu 30 und Eure Angriffskraft um 30 erhöht wird. Dieser Effekt kann nur außerhalb des Kampfes angewandt werden."},
[446243] = {name = "[q2]Siegel der lebendigen Träume", additional_info = "Wirken in 3 sek.\nTools: Runenverzierte Echtsilberrute\nReagenzien:\nTraumstaub (5)\n[q2]Verzaubertes Siegel: Lebendige Träume\nWird beim Aufheben gebunden\nEinzigartig (5)\n50\nBenötigtVerzauberkunst\n(250)\n[q2]Benutzen: Erhaltet ein verzaubertes Siegel der lebendigen Träume, das Euch ermächtigt, wodurch 30 min lang der verursachte Schaden und die hervorgerufene Heilung Eurer Zauber um bis zu 30 und Eure Angriffskraft um 30 erhöht wird. Dieser Effekt kann nur außerhalb des Kampfes angewandt werden. (30 Min Abklingzeit)"},
