[446336] = {name = "Atal'aimojo des Krieges", additional_info = "Sofort\n[q]Erhöht die Nahkampf- und Distanzangriffskraft um 48. Bei Nahkampf- und Distanzangriffen besteht eine Chance, größer zu werden, wodurch 10 sec lang die Stärke oder Beweglichkeit um 35 erhöht wird (je nach dem, welcher Wert höher ist). Es kann immer nur ein Trank der Atal'ai zur selben Zeit aktiv sein. Dies hat außerhalb des Versunkenen Tempels keinen Effekt.\n(Procchance: 15%, 40s Abklingzeit)"},
[446338] = {name = "Kettenblitzschlag", additional_info = "{150 Mana} {30 Meter Reichweite}\n{Wirken in} {3 sek. 6 sek. Abklingzeit}\n[q]Trifft einen Gegner mit einem Blitzschlag, der auf einen Gegner in der Nähe überspringt. Der Zauber wirkt sich auf bis zu 3 Ziele aus und verursacht bei jedem folgenden Ziel immer größeren Naturschaden."},
