[450608] = {name = "S03 - Druid Energize Trigger - Wildheart Raiment", additional_info = "[q]2% Chance, dass Ihr beim Zaubern 300 Mana erhaltet. 6% Chance, dass Ihr bei einem autom. Nahkampfangriff 40 Energie erhaltet. 3% Chance, dass Ihr bei einem erlittenen Nahkampfangrifftreffer 10 Wut erhaltet.\n(Procchance: 6%)"},
