[450626] = {name = "Gegenstand - Der wilde Sturm (Proc)", additional_info = "[q]6% Chance beim autom. Haupthandangriff und 4% Chance beim Zaubern, Euren Schaden und Eure Heilung durch magische Zauber und Effekte 10 sec lang um bis zu 95 zu erhöhen.\n(Procchance: 6%)"},
