[460460] = {name = "[q4]Sulfuronhammer", additional_info = "Wirken in 1 min\nTools: Schmiedehammer\nReagenzien:\nSulfuronblock (8), Dunkeleisenbarren (20), Arkanitbarren (50), Essenz des Feuers (25), Blut des Berges (10), Lavakern (10), Feuerkern (10)\n[q4]Sulfuronhammer\nWird beim Anlegen gebunden\nZweihändig Streitkolben\n181 - 303 Schaden Tempo 3.80\n(63.68 Schaden pro Sekunde)\n+10 Stärke\n+10 Ausdauer\n+30 Feuerwiderstand\nHaltbarkeit 120 / 120\n60\n[q2]Trefferchance: Schleudert eine glühende Kugel hinaus, die 83 to 101 Punkt(e) Feuerschaden sowie zusätzlich 8 sec lang 16 Punkt(e) Schaden verursacht.\n[q2]Anlegen: Fügt jedem Feind 5 Punkt(e) Feuerschaden zu, der Euch mit einem Nahkampfangriff schlägt.\n[q2]Anlegen: +124 Angriffskraft in Katzengestalt, Bärengestalt oder Terrorbärengestalt."},
