[461633] = {name = "Waffe des Frostbrands", additional_info = "160 Mana\nSofort\nBenötigt Nahkampfwaffe\n[q]Erfüllt die Waffe des Schamanen mit Frostmagie. Bei jedem Treffer besteht eine Chance, zusätzlich 187 Frostschaden zu verursachen und das Bewegungstempo des Ziels 8 sec lang um 25% zu verringern. Hält eine Stunde lang an."},
