[461647] = {name = "[q4]Meisterlicher Sturmhammer des Himmelsreiters", additional_info = "Wirken in 1 min\nTools: Schmiedehammer\nReagenzien:\nMeisterlicher Sturmhammer , Elementarwetzstein (10), Arkanitbarren (15)\n[q4]Meisterlicher Sturmhammer des Himmelsreiters\nWird beim Anlegen gebunden\nWaffenhand Streitkolben\n53 - 114 Schaden Tempo 2.00\n(41.75 Schaden pro Sekunde)\n+9 Ausdauer\n+6 Intelligenz\nHaltbarkeit 105 / 105\n60\n[q2]Trefferchance: Überzieht bis zu 3 Ziele mit 105 to 145 Naturschaden.\n[q2]Anlegen: Erhöht durch Zauber und magische Effekte zugefügten Schaden und Heilung um bis zu 37."},
